INSERT INTO public.exercise_example_translations VALUES ('4afaaf91-a1f4-4a2a-86bd-358d99aef610', 'd2f28afc-e84c-467c-90d9-c6c2cb63acbc', 'en', '45 Degree Leg Press Calf Raise', 'Calf raise on a 45 leg press. Sit with hips/back supported and feet shoulder-width on the lower edge of the footplate so the heels hang off. Extend the legs to set the start position (keep knees locked or with a slight, constant bend). Lower the heels under control into dorsiflexion to a comfortable stretch, then plantarflex hard to the top; pause 12 s and avoid bouncing. Keep motion at the ankles only, brace the trunk, and maintain foot pressure through the ball of the foot. Safety: set/keep safeties engaged whenever adjusting foot placement; if you feel knee joint pressure, keep a slight bend and do not change knee angle during reps.', '2025-10-19 11:34:38.502499', '2025-10-19 11:34:38.502499');
INSERT INTO public.exercise_example_translations VALUES ('deaadd2e-9920-420e-9e3a-7ba50b41eab2', 'd2f28afc-e84c-467c-90d9-c6c2cb63acbc', 'ua', '         45', 'Calf raise on a 45 leg press. Sit with hips/back supported and feet shoulder-width on the lower edge of the footplate so the heels hang off. Extend the legs to set the start position (keep knees locked or with a slight, constant bend). Lower the heels under control into dorsiflexion to a comfortable stretch, then plantarflex hard to the top; pause 12 s and avoid bouncing. Keep motion at the ankles only, brace the trunk, and maintain foot pressure through the ball of the foot. Safety: set/keep safeties engaged whenever adjusting foot placement; if you feel knee joint pressure, keep a slight bend and do not change knee angle during reps.', '2025-10-19 11:34:38.502499', '2025-10-19 11:34:38.502499');
INSERT INTO public.exercise_example_translations VALUES ('9439cfdb-4b4c-417c-ba93-22ea88095167', 'd2f28afc-e84c-467c-90d9-c6c2cb63acbc', 'ru', '       45', 'Calf raise on a 45 leg press. Sit with hips/back supported and feet shoulder-width on the lower edge of the footplate so the heels hang off. Extend the legs to set the start position (keep knees locked or with a slight, constant bend). Lower the heels under control into dorsiflexion to a comfortable stretch, then plantarflex hard to the top; pause 12 s and avoid bouncing. Keep motion at the ankles only, brace the trunk, and maintain foot pressure through the ball of the foot. Safety: set/keep safeties engaged whenever adjusting foot placement; if you feel knee joint pressure, keep a slight bend and do not change knee angle during reps.', '2025-10-19 11:34:38.502499', '2025-10-19 11:34:38.502499');
