INSERT INTO public.exercise_example_translations VALUES ('7351da8c-a1be-4f6d-b378-d4c1ab5164e9', '64406a09-56a6-43da-9329-ff0fb0d83e4f', 'en', '45-Degree Leg Press', 'Sit with hips and low back firmly on the pad and place your feet shoulder-width on the sled (toes slightly out if comfortable). Unlock the safeties with soft knees, brace, and lower the sled under control until the knees reach about 90 of flexion (thighs near parallel to the sled) without the pelvis rolling off the pad. Drive through the mid-foot/heel to extend the knees and hips, keeping the knees tracking over the toes. Avoid bouncing, lifting the hips, or forcefully locking out at the top.', '2025-10-19 14:46:28.794058', '2025-10-19 14:46:28.794058');
