INSERT INTO public.exercise_example_translations VALUES ('ee3a99c9-2ec3-48fe-9db5-c308bb7d62b1', '1dcd59ab-674e-49d8-9a06-9c17c2a05730', 'en', 'Conventional Deadlift', 'Set the bar over mid-foot (about 23 cm from the shins). Take a hip-width stance and grip just outside the legs. Brace 360, set a neutral spine, pull the slack out, and engage the lats (bar to shins). Push the floor away: extend knees and hips together keeping the bar over mid-foot and close to the body. Stand tall by squeezing the glutes without hyperextending. Return by hinging back; once the bar passes the knees, bend them and guide the bar to the floor under control. Reset and repeat.', '2025-10-19 15:51:25.427007', '2025-10-19 15:51:25.427007');
INSERT INTO public.exercise_example_translations VALUES ('44cc8ddd-a7ae-417b-9641-aa0d48c7ce7c', '93e6b1c4-0510-41d4-983c-a1fde003881f', 'ru', '       ', '  ,   .  ,      ,    ,   .      .       .    ,         ;   ,     45  .            .        .', '2025-10-19 14:50:50.467794', '2025-10-19 14:50:50.467794');
INSERT INTO public.exercise_example_translations VALUES ('86f4166f-1c0a-442a-b788-d5bee8750165', '4d72c2f1-2c10-45a3-9f5e-1f04012c0681', 'en', 'Alternating Incline Dumbbell Curl', 'Set an adjustable bench to a 3045 incline (lower = harder). Sit, pick up two dumbbells, and lie back with your head/upper back supported. Hold with an underhand (supinated) grip, arms hanging and elbows slightly bent to keep tension. Keep shoulders back and elbows pinnedno swinging. Curl one dumbbell by flexing the elbow only until the forearm is near vertical; squeeze briefly, then lower under control to full extension without letting the shoulder roll forward. Alternate arms and repeat for reps.', '2025-10-19 14:52:39.137646', '2025-10-19 14:52:39.137646');
