INSERT INTO public.exercise_example_translations VALUES ('63f18aae-03dc-4cb0-9292-bb0ad4726cc4', '1f28edb2-29ae-467c-ad11-310c3f656fe2', 'en', 'Alternating Seated Hammer Curl', 'Sit on a flat bench with feet planted and torso tall. Hold two dumbbells at your sides with a neutral (hammer) grip; keep elbows tucked and still. Maintain slight elbow flexion to keep tension. Curl one dumbbell toward the shoulder without rotating the forearm or swinging the torso; squeeze briefly, then lower under control to full extension. Alternate arms rep to rep while the opposite arm stays braced. Keep wrists neutral and breathe steadily.', '2025-10-19 14:57:29.405658', '2025-10-19 14:57:29.405658');
