INSERT INTO public.exercise_example_translations VALUES ('eddc02f8-49d3-4185-9ae2-ff71d235de09', '194fa2ee-7f92-4982-903e-3db80293d773', 'en', 'Barbell Preacher Curl', 'Load the desired weight on a barbell and sit upright with your chest against the preacher pad. Press your upper arms firmly into the pad and use a supinated (palms up) grip about shoulder-width. Extend the elbows to a comfortable stretch without hyperextending. Brace, keep shoulders down, and curl the bar by bending only at the elbows until the bar reaches about shoulder height; pause and squeeze the biceps. Lower under control to the full stretch while keeping the arms glued to the pad. Repeat for the desired reps.', '2025-10-19 15:03:33.429616', '2025-10-19 15:03:33.429616');
