INSERT INTO public.exercise_example_translations VALUES ('ceebcc7f-c27f-4571-9843-11d76af94b69', '908341ec-de1f-44bd-b84d-74ff8a7162a0', 'en', 'Alternating Standing Dumbbell Curl', 'Stand tall holding dumbbells at your sides with a supinated grip (palms up), wrists neutral, and elbows pinned to your torso. Create light pre-tension in the biceps. Curl one dumbbell up without swinging or letting the elbow drift forward; squeeze briefly at the top, then lower under control (23 s). Alternate sides each rep while keeping the non-working arm still and shoulders relaxed. Repeat for the desired reps.', '2025-10-19 14:58:38.231955', '2025-10-19 14:58:38.231955');
