INSERT INTO public.exercise_example_translations VALUES ('c22836b6-c1a7-48b2-8c9a-4982cd6deb47', '22df24eb-6bb7-45bc-ab46-9d6022eec774', 'en', 'Barbell Back Squat', 'Set the bar across the upper back (not the neck), grip just outside shoulders, and unrack to step back with a shoulder-width stance. Brace the core, keep ribs down, and maintain a neutral spine. Sit the hips down and slightly back, let the knees track over the toes, and keep pressure through the whole foot (midfoot/heelnot the toes). Descend to parallel or as mobility allows without butt-wink, then stand by driving the floor away and finishing with hips under the torso. Avoid collapsing the chest or knee valgus; lock out under control without hyperextending.', '2025-10-19 14:59:43.102702', '2025-10-19 14:59:43.102702');
