INSERT INTO public.exercise_example_translations VALUES ('f7eccebd-dcc2-4243-8ba3-9aff39056a0e', '78b3c689-0222-46de-a7b3-9bd6c75b920c', 'en', 'Barbell Hip Thrust', 'Set your upper back on a flat bench and place a padded barbell across the crease of the hips. Plant the feet about shoulder-width with shins vertical at the top. Brace (ribs down, neutral spine), keep the chin tucked, and drive through the heels to extend the hips until the torso is parallel to the floor. Finish by squeezing the glutes with a slight posterior pelvic tiltavoid lumbar hyperextension. Lower under control by hinging at the hips and maintaining knee angle; pause lightly and repeat. Use smooth tempo and full hip extension without letting the knees cave in.', '2025-10-19 15:02:37.133798', '2025-10-19 15:02:37.133798');
