INSERT INTO public.exercise_example_translations VALUES ('5896ae01-4d4a-458b-8935-a548ff9776f3', '49ef1d62-a375-485a-84bd-289a5548e81b', 'en', 'Barbell Shrug', 'Stand tall with a barbell in front of the thighs and a double overhand grip. Brace the core, keep arms straight and neck neutral, then raise the shoulders straight up toward the ears (no rolling). Pause 12 s at the top and lower slowly to a full stretch, avoiding elbow bend or torso sway.
INSERT INTO public.exercise_example_translations VALUES ('c421ec3b-1d22-49f5-8d2d-a02fc9732470', '3488eaaa-a999-43c5-acd6-b177b8a3df8a', 'en', 'Dumbbell Flys', 'Isolation movement for the chest: lie on a flat bench, slight elbow bend (~1530) maintained throughout, palms facing each other. Lower arms in a wide arc until upper arms are near shoulder line (no overstretch), keep scapulae retracted/depressed, neutral wrists; bring the dumbbells together over the chest by horizontal adduction. Control tempo and range to minimize shoulder strain.', '2025-11-18 18:29:51.856972', '2025-11-18 18:29:51.856972');
