INSERT INTO public.exercise_example_translations VALUES ('e627067c-0697-4c7d-9a3a-4b3aa58a7833', 'd180a698-a12e-4731-8234-b96e8f3ca7d9', 'en', 'Barbell Upright Row', 'Stand with feet shoulder-width and grip the bar slightly inside shoulder width. Keep the bar close to the body and lead with the elbows, pulling to about upper-chest height while elevating the shoulders. Keep wrists neutral, torso upright, and avoid swinging or rolling the shoulders. Pause briefly at the top, then lower the bar under control. If shoulder discomfort occurs, widen the grip or reduce the range.', '2025-10-19 15:05:17.277437', '2025-10-19 15:05:17.277437');
INSERT INTO public.exercise_example_translations VALUES ('3810bcd0-72af-47a7-96ef-78bcf8ac994b', 'd180a698-a12e-4731-8234-b96e8f3ca7d9', 'ua', '   ', '             .         ,        ,   .  ,  ;     .   ,     .     ,      .', '2025-10-19 15:05:17.277437', '2025-10-19 15:05:17.277437');
