INSERT INTO public.exercise_example_translations VALUES ('12a9f1e9-d7d5-42a2-a34b-aa15e9e3e7ae', 'f5f03cc7-c2bc-4367-9042-107114d634ce', 'en', 'Barbell Wrist Curl (Over Bench)', 'Set up kneeling or seated behind a flat bench. Rest your forearms on the bench with wrists hanging past the edge, palms up (supinated), hands shoulder-width, and thumbs wrapped around the bar. Keep elbows fixed and shoulders relaxed. Lower the bar by extending the wrists under control, then curl it up by flexing the wrists until the bar approaches the forearms. Pause, avoid ulnar/radial deviation and momentum, keep forearms glued to the bench, and use a smooth full range of motion.', '2025-10-19 15:06:28.278795', '2025-10-19 15:06:28.278795');
