INSERT INTO public.exercise_example_translations VALUES ('e1eda434-34e7-4f6d-b3cf-990aa0d1eb31', '85a317d2-6cf2-4155-a6ea-a271afc4a803', 'en', 'Behind Neck Lat Pulldown', 'Attach a wide-grip lat bar to the pulldown. Sit with thighs locked, torso tall with a slight forward lean, and take a pronated grip wider than shoulders. Initiate by depressing and retracting the shoulder blades, then pull the bar behind the head toward the upper traps without craning the neck or flaring the ribs. Pause and squeeze, then return the bar overhead under control. Use a pain-free range and adequate shoulder external-rotation mobility; stop short of any discomfort.', '2025-10-19 15:07:54.255766', '2025-10-19 15:07:54.255766');
INSERT INTO public.exercise_example_translations VALUES ('da44d2e6-13a0-42c0-9643-a27a3a7be8aa', '8ca7bf65-0ddb-4c64-ba64-f71f25c85d7c', 'en', 'Wide Grip EZ Bar Curl', 'Grasp an EZ bar with a wider-than-shoulder underhand grip. Stand tall, ribs down, glutes/abs braced, elbows close to your sides and wrists neutral. Curl the bar under control until the forearms are near verticalsqueeze the bicepsthen lower slowly to full elbow extension without swinging or leaning. Keep shoulders down (dont shrug) and repeat for the desired reps.', '2025-11-22 14:07:32.738639', '2025-11-22 14:07:32.738639');
INSERT INTO public.exercise_example_translations VALUES ('b391e4a7-2658-47dd-9a37-eb3493725f20', '85a317d2-6cf2-4155-a6ea-a271afc4a803', 'ua', '    ', '    . ,  ,      ,     .       ,         ,       .      ,       .         ;    .', '2025-10-19 15:07:54.255766', '2025-10-19 15:07:54.255766');
