INSERT INTO public.exercise_example_translations VALUES ('5ce484bd-5040-4aef-8baa-8023bc108485', 'ddaf509f-3c99-437c-b872-a4651a91601f', 'en', 'Behind-The-Back Barbell Wrist Curl', 'Stand tall holding a barbell behind your hips with a shoulder-width overhand grip. Keep elbows straight but not locked, shoulders down, and torso still. Let the wrists extend under control, then flex to curl the bar up using the forearm flexors only; avoid elbow bending or shrugging. Pause briefly and lower through a full range of motion.', '2025-10-19 15:08:52.834166', '2025-10-19 15:08:52.834166');
