INSERT INTO public.exercise_example_translations VALUES ('072da1ad-c557-4160-834a-add030cf1aea', 'd7871e0c-5e1b-4ffd-a9ab-951028246a01', 'en', 'Behind-The-Back Cable Wrist Curl', 'Set a low pulley with a straight bar. Stand facing away from the stack with the bar held behind your hips, hands shoulder-width. Keep elbows straight, shoulders down, and forearms still. Let the wrists extend to feel a stretch in the forearms, then flex the wrists to pull the bar up toward your glutes; pause and lower under control. Avoid shrugging, bending the elbows, or using momentum to keep tension on the forearm flexors.', '2025-10-19 15:10:01.503193', '2025-10-19 15:10:01.503193');
