INSERT INTO public.exercise_example_translations VALUES ('0a773411-96f1-4615-899a-0ebd0dad10af', '950cd0cd-fc3b-442f-aba9-3c48bfc6cda9', 'en', 'Bent Over Barbell Row', 'Stand with a barbell using a double overhand (pronated) grip. Hinge forward until your torso is nearly parallel to the floor, keep a neutral spine and braced core, and let the shoulders protract slightly. Initiate by depressing/retracting the shoulder blades, then drive the elbows behind the body to pull the bar toward the lower ribs/belly button without shrugging. Pause and squeeze, then lower under control to a full stretch. Avoid torso swing or lumbar extension; keep the bar close throughout.', '2025-10-19 15:12:05.175587', '2025-10-19 15:12:05.175587');
