INSERT INTO public.exercise_example_translations VALUES ('31f18301-8a3f-4332-814e-5e6aaa7a4de2', '816440ad-f8f2-4ef7-a11f-b6a2bd63fcef', 'en', 'Bent Over Dumbbell Reverse Fly', 'Stand with feet hip-width and hinge from the hips until the torso is nearly parallel to the floor, keeping a neutral spine. Hold dumbbells with a neutral grip and a soft bend in the elbows; let arms hang under the shoulders. Brace, avoid shrugging, and lead with the elbows to raise the bells out to the sides (horizontal abduction) until upper arms reach about shoulder level. Pause, then lower under control without swinging and repeat.', '2025-10-19 15:13:14.651625', '2025-10-19 15:13:14.651625');
