INSERT INTO public.exercise_example_translations VALUES ('faa9add6-e68a-4c24-8b18-4c5e21d335b6', 'ed5db0ac-4343-4e68-a884-d5f84e4020c1', 'en', 'Bent Over Low Pulley Rear Delt Fly', 'Set both pulleys to the lowest position and attach single-grip handles. Hinge at the hips (~45) with a neutral spine, feet hip-width, arms hanging under shoulders. Reach across to grab each opposite handle with a neutral grip. With a slight elbow bend, raise the arms out to the sides in line with the rear delts; lead with the upper arm, not the hands. Avoid excessive scapular retraction or shruggingkeep the torso steady and tension on the cables. Pause at shoulder height, then lower under control to maintain constant tension. Repeat for the desired reps.', '2025-10-19 15:16:40.532317', '2025-10-19 15:16:40.532317');
INSERT INTO public.exercise_example_translations VALUES ('c9787922-6a49-4782-9679-31d7825cce80', 'ed5db0ac-4343-4e68-a884-d5f84e4020c1', 'ua', '        ', '         .     (~45),   ;    ,    .       .             ,     ,   .          ,   .     ,    ,   .    .', '2025-10-19 15:16:40.532317', '2025-10-19 15:16:40.532317');
INSERT INTO public.exercise_example_translations VALUES ('a0eace35-7c17-4118-a4ba-b56b1787f75d', 'bb9c756b-0c9e-4e87-826f-bb2cbd16d86b', 'en', 'Dumbbell Wrist Curl (Over Bench)', 'Sit on a flat bench and rest your forearm on the bench or thigh with the palm up (supinated), wrist just past the edge. Hold a dumbbell, keep the elbow fixed and shoulder relaxed. Lower into a full stretch by extending the wrist, then curl by flexing the wrist and briefly pausing at the top. Avoid elbow flexion, forearm rotation, or swinging to keep tension on the wrist flexors.', '2025-10-19 16:38:57.979', '2025-10-19 16:38:57.979');
INSERT INTO public.exercise_example_translations VALUES ('4b183c3d-7bda-408b-9b87-baf422f52d7a', 'ed5db0ac-4343-4e68-a884-d5f84e4020c1', 'ru', '        ', '         .     (~45),   ;    ,    .       .             ,     ,   .          ,   .        ,   .     .', '2025-10-19 15:16:40.532317', '2025-10-19 15:16:40.532317');
INSERT INTO public.exercise_example_translations VALUES ('283c24ec-1e31-4029-8c53-b69b9efff483', 'b8fa1238-0f58-4daa-ade8-0f8c6fa2d1b1', 'en', 'Bent Over Rear Delt Fly (Head on Bench)', 'Set an adjustable bench to ~7080. Hinge at the hips until your forehead rests lightly on the top of the bench; keep a neutral spine and feet hip-width. Hold dumbbells with a neutral grip, arms hanging under the shoulders with a slight elbow bend. Lead with the upper arm and raise the dumbbells out to the sides until roughly shoulder heightavoid shrugging and excessive scapular retraction to keep the load on the rear delts. Pause briefly, then lower under control to maintain tension. Repeat for the desired reps.', '2025-10-19 15:18:11.109825', '2025-10-19 15:18:11.109825');
INSERT INTO public.exercise_example_translations VALUES ('00f45147-04fc-4c2a-9913-5a63e14480de', 'b8fa1238-0f58-4daa-ade8-0f8c6fa2d1b1', 'ua', '     (  )', '    7080.    ,        ;   ,    .    ,         .             ;       ,      .  ,    ,  .    .', '2025-10-19 15:18:11.109825', '2025-10-19 15:18:11.109825');
