INSERT INTO public.exercise_example_translations VALUES ('3d18a142-6335-48e7-a7ac-e83a81b332e7', '2780e6d9-a86f-4038-b96f-ef59f961cb4b', 'en', 'Cable Chest Press', 'Stand between dual pulleys set at mid-chest height, attach D-handles, and take a stable split stance. Retract/depress the scapulae, tuck elbows ~4560, and press the handles forward on a horizontal path; finish with slight scapular protraction, then return under control to keep constant cable tension. Keep ribs down and torso still to avoid turning it into a dip or fly.', '2025-10-19 15:19:52.448299', '2025-10-19 15:19:52.448299');
INSERT INTO public.exercise_example_translations VALUES ('5dc4b2f2-4736-4f8a-8a8e-0cf5e8e38c7f', '2780e6d9-a86f-4038-b96f-ef59f961cb4b', 'ua', '   ', '     D-,     ,     .    ,    ~4560.      ;       ,    ,    .      ,          .', '2025-10-19 15:19:52.448299', '2025-10-19 15:19:52.448299');
