INSERT INTO public.exercise_example_translations VALUES ('5c34dfe0-1e95-4180-a5a1-fc2dee6197ea', '275097d4-3c8d-4040-9b2e-5f294919df04', 'en', 'Cable Concentration Tricep Extension', 'Attach a single handle to a high cable. Set up in a half-kneeling stance (inside knee down) with the working elbow braced against the inside of the front thigh. Grip the handle supinated (palm up). Keep the upper arm fixed, shoulder packed, wrist neutral, and core braced.
INSERT INTO public.exercise_example_translations VALUES ('82355743-c938-4e37-8bd3-d4b884c588a2', '21d5ce50-6ffa-44d9-869f-abcfeb518018', 'en', 'Dumbbell Goblet Split Squat', 'Hold one dumbbell vertically at chest level (goblet). Take a long split stance with the front foot flat and torso upright. Descend until the back knee approaches the floor, keeping the front knee tracking over the toes. Drive through the whole front foot to stand. Primary emphasis is on the quadriceps; glutes and adductors assist in hip extension and frontal-plane control; hamstrings act mainly eccentrically; calves and core stabilize; the anterior deltoid supports the goblet hold.', '2025-10-19 16:22:15.759031', '2025-10-19 16:22:15.759031');
INSERT INTO public.exercise_example_translations VALUES ('9bc45a08-cc94-4d52-8151-32eea7d07087', '275097d4-3c8d-4040-9b2e-5f294919df04', 'ua', '      ', '     .      (   ),        .    ( ).     ,  ,  ,  .      ,     ;  .    ~90   .     .    .', '2025-10-19 15:21:03.33208', '2025-10-19 15:21:03.33208');
INSERT INTO public.exercise_example_translations VALUES ('9dd3de8b-3eb0-4287-bb37-556536ba9fd1', '275097d4-3c8d-4040-9b2e-5f294919df04', 'ru', '      ', '     .       (   ),        .      ( ).     ,  ,  ,  .      ,     ;  .    ~90   .     .    .', '2025-10-19 15:21:03.33208', '2025-10-19 15:21:03.33208');
INSERT INTO public.exercise_example_translations VALUES ('8be4b152-6847-4049-969f-9dff07ced88e', 'e1361643-e92a-419b-8eb8-fe2a188016e0', 'en', 'Cable Crunch', 'Attach a rope to a high pulley and set an appropriate weight. Kneel facing the stack with shins on the floor and hips resting on your heels. Grip each end of the rope beside your head (elbows tucked). Brace, draw ribs down, and initiate a posterior pelvic tilt (tuck the tailbone). Curl the trunk to bring the sternum toward the pelvis, keeping the hips fixed (dont hinge). Pause briefly, then return under control without letting the rope pull you up. Breathe out as you crunch; keep the neck neutral and avoid pulling with the arms.
INSERT INTO public.exercise_example_translations VALUES ('aa2c26dd-387b-4f8a-866a-6f76008d4b9e', 'e1361643-e92a-419b-8eb8-fe2a188016e0', 'ua', '     ', '        .      ,   ,   .       ( ).  :  ,  ,     .  ,    ,     .       ,     .    ,  ,    .  ,    ;     ,    .     ,    .   ,   ,   .', '2025-10-19 15:23:50.721275', '2025-10-19 15:23:50.721275');
INSERT INTO public.exercise_example_translations VALUES ('aa06defe-1600-41f5-97c4-2aca2f0d890b', '4da455c2-c154-4da7-b9c5-6195bd137eec', 'en', 'Dumbbell Goblet Squat', 'Hold a dumbbell vertically against the chest in a goblet position with elbows tucked. Stand shoulder-width, brace the core, keep the torso tall, and let the knees track over the toes. Descend by sitting between the hips to at least thighs-parallel (or lower as mobility allows) while keeping heels down and a neutral spine. Drive up through the mid-foot/heel without bouncing or forcefully locking the knees; keep the weight close to the chest throughout.', '2025-10-19 16:23:50.169982', '2025-10-19 16:23:50.169982');
INSERT INTO public.exercise_example_translations VALUES ('208d1903-f9a5-453a-a4c8-3e1a0ef97c27', 'e1361643-e92a-419b-8eb8-fe2a188016e0', 'ru', '     ', '        .      ,   ,   .       ( ).  :  ,  ,     .  ,    ,     .     ,      .    ,  ,    .  ,    ;       ,    .     ,    .   ,   ,   .', '2025-10-19 15:23:50.721275', '2025-10-19 15:23:50.721275');
INSERT INTO public.exercise_example_translations VALUES ('1b1f8f56-3e92-4bc8-8256-f94183d6e77f', '2522a61a-2190-43e9-ae52-ca6bb023815e', 'en', 'Cable Curl', 'Attach a straight bar to the low pulley and select the load. Stand facing the stack, feet shoulder-width. Grip the bar shoulder-width with a supinated (palms up) grip. Set shoulders down and back, keep elbows tucked to your sides and wrists neutral. Curl the bar up until forearms are near vertical; pause and squeeze the biceps. Lower under control to near-full elbow extension without letting the shoulders roll forward. Repeat for desired reps.', '2025-10-19 15:24:36.189429', '2025-10-19 15:24:36.189429');
INSERT INTO public.exercise_example_translations VALUES ('f7094896-0f1d-437a-8db2-af471d75e543', 'ad76d69c-5e90-4643-b507-9e9226d8b5cd', 'ru', '  -', '  -   ,  . ,   .       (  ).  12  ,      ,      .', '2025-10-19 21:09:34.398282', '2025-10-19 21:09:34.398282');
