INSERT INTO public.exercise_example_translations VALUES ('e80f39d5-7644-49f2-8b21-62ab8fadb5aa', '13fcd794-54fb-413f-8bbf-44353cd29869', 'en', 'Cable Iron Cross', 'Stand centered in a cable crossover with D-handles set slightly above shoulder height. Take a staggered stance, brace the core, and keep a slight elbow bend (~1530). Retract and depress the scapulae, then sweep the arms in a wide arc to meet in front of the chest without changing elbow angle; pause and return under control to a deep stretch without letting the shoulders roll forward. Keep it a fly (no pressing) and avoid shrugging.', '2025-10-19 15:28:59.617727', '2025-10-19 15:28:59.617727');
INSERT INTO public.exercise_example_translations VALUES ('6fb4fd70-b372-465a-8cb6-2a3225fcb34d', '13fcd794-54fb-413f-8bbf-44353cd29869', 'ru', '   ', '   , D-     .    ,  ;     (~1530).    ,      ,         ;        ,     .    ( )    .', '2025-10-19 15:28:59.617727', '2025-10-19 15:28:59.617727');
INSERT INTO public.exercise_example_translations VALUES ('360af09b-60f4-4158-8b8c-fd3b23441e6c', '4353173b-93b2-4fb1-b462-fc8330b15ce5', 'en', 'Cable Lateral Raise', 'Set both pulleys to a low position and attach single handles. Stand facing away from the machine, grasp the opposite handle with each hand so the cables cross in front of you. Stand tall, brace the core, and keep a slight bend in the elbows. Lead with the elbows to raise the arms out to the sides in the scapular plane until about shoulder height without shrugging; pause, then lower under control to the start.', '2025-10-19 15:29:38.931243', '2025-10-19 15:29:38.931243');
INSERT INTO public.exercise_example_translations VALUES ('d100df7c-0875-4b46-8c9b-8b8347217575', '4353173b-93b2-4fb1-b462-fc8330b15ce5', 'ua', '     ', '         .         ,    .  ,  ,     .   ,          ,   ;       .', '2025-10-19 15:29:38.931243', '2025-10-19 15:29:38.931243');
