INSERT INTO public.exercise_example_translations VALUES ('727f5008-8a37-4e24-a976-367d974d1d28', '98791e1d-6029-4cb2-bcaf-611a337208ef', 'en', 'Cable Row to Neck', 'Attach a rope to a cable stack at chest height. Sit or stand tall with a neutral spine and thumbs-up grip. Initiate by depressing/retracting the scapulae, then pull the rope toward the upper chest/neck line while spreading the ends apart and letting the elbows travel high and wide. Squeeze the midupper back and rear delts briefly, then return under control with the shoulders protracting slightly. Keep the ribs down, avoid shrugging or cranking the neck, and maintain neutral wrists.', '2025-10-19 15:30:19.230676', '2025-10-19 15:30:19.230676');
INSERT INTO public.exercise_example_translations VALUES ('e9e5f930-8dc2-4804-a267-a17c8ed8b7d9', '98791e1d-6029-4cb2-bcaf-611a337208ef', 'ua', '     ', '      .            .      ,       /,         .    /    ,    ,     .   ,      ,  .', '2025-10-19 15:30:19.230676', '2025-10-19 15:30:19.230676');
INSERT INTO public.exercise_example_translations VALUES ('2f6170c9-60d4-4e0c-bca8-c3ceea0832e8', '61a31a0d-a736-48b5-b03e-44aa1ad7f3eb', 'en', 'Seated Barbell Wrist Curl', 'The seated barbell wrist curl isolates the wrist flexors of the forearm. Sit on a flat bench with forearms resting on your thighs (palms up), grip the bar slightly wider than hip width. Let the bar roll toward the fingers, then flex the wrists to raise it while keeping elbows and shoulders still. Use a controlled tempo (especially a slow eccentric) and avoid excessive range that causes pain.', '2025-10-19 19:11:20.325536', '2025-10-19 19:11:20.325536');
INSERT INTO public.exercise_example_translations VALUES ('c3e4721a-fa5e-44e4-a446-d8e672106126', '98791e1d-6029-4cb2-bcaf-611a337208ef', 'ru', '     ', '      .            .      ,       /,         .    /    ,   ,     .   ,      ,  .', '2025-10-19 15:30:19.230676', '2025-10-19 15:30:19.230676');
INSERT INTO public.exercise_example_translations VALUES ('9e54b286-8b27-48fe-a10f-bb9a7fe208c1', 'f451289a-6d35-4926-981d-8ebae71741a2', 'en', 'Cable Shrug', 'Set the cable to the lowest pulley and attach single handles. Stand tall with arms straight, wrists neutral, and the ribcage stacked over the pelvis. Raise the shoulders straight up toward the ears by contracting the upper traps (no elbow bend, no shoulder roll), pause 12 s at the top, then lower under control to a full stretch while keeping the head neutral and core braced. Use a load that allows smooth, vertical scapular elevation through the full range.', '2025-10-19 15:31:08.675654', '2025-10-19 15:31:08.675654');
INSERT INTO public.exercise_example_translations VALUES ('4fb8da87-cc0b-4227-a203-ac313c0b7d65', 'f451289a-6d35-4926-981d-8ebae71741a2', 'ua', '   ', '        .  ,  ,  ,    .      ,     (     ).  12         ,      .  ,         .', '2025-10-19 15:31:08.675654', '2025-10-19 15:31:08.675654');
INSERT INTO public.exercise_example_translations VALUES ('23a8824f-ae09-4588-a2d9-abe6a9e74a89', '7d823dc8-8303-4ddd-a25d-935569c662b7', 'en', 'Hyperextension', 'Set the pad so the top edge sits at your hip crease and lock your heels into the footplate. Keep a soft knee bend, brace (ribs down, neutral spine), and hinge at the hips to lower the torso under control without rounding the low back. Drive the hips into the pad and extend until your body forms a straight line; squeeze the glutes and avoid lumbar hyperextension. Pause briefly, then descend with a smooth tempo and repeat.', '2025-10-19 17:04:00.428536', '2025-10-19 17:04:00.428536');
INSERT INTO public.exercise_example_translations VALUES ('5de26eed-634e-4f38-a208-23b4091e931e', 'f451289a-6d35-4926-981d-8ebae71741a2', 'ru', '   ', '        .  ,  ,  ,    .      ,     (     ).  12        ,      .  ,        .', '2025-10-19 15:31:08.675654', '2025-10-19 15:31:08.675654');
