INSERT INTO public.exercise_example_translations VALUES ('4ad79808-1282-4764-9e68-578f1ce56e44', '738d7264-00af-48dd-a475-3c4d12e28188', 'en', 'Chin Up', 'Using a supinated (underhand) shoulder-width grip, hang from the bar with elbows fully extended. Take a deep breath, squeeze your glutes, and brace your abs. From an active hang, depress and retract the shoulder blades, then drive the elbows straight down to pull your upper chest to the bar (chin over the bar). Keep the ribs down and neck neutral; pause, then lower under control to a full hang without swinging or kipping.', '2025-10-19 15:37:57.358064', '2025-10-19 15:37:57.358064');
