INSERT INTO public.exercise_example_translations VALUES ('12408b65-1acd-4659-8ba9-dda512eb3848', 'be3c01a7-3bd0-448c-844b-583bd824c90b', 'en', 'Dumbbell Stiff Leg Deadlift', 'Stand with a hip-width stance holding dumbbells in front of the thighs. Brace, keep a neutral spine and soft knees (about 1015). Hinge by pushing the hips back, keeping shins nearly vertical and the dumbbells close to your legs. Lower until you feel a strong hamstring stretch (typically to mid-shin) without rounding. Keep lats tight and shoulders packed. Drive the hips forward to stand tall by contracting hamstrings and glutes; avoid hyperextending the lower back. Control the descent and repeat.', '2025-10-19 16:34:25.57058', '2025-10-19 16:34:25.57058');
INSERT INTO public.exercise_example_translations VALUES ('54240ef3-1ed6-44d3-8f8f-2bf2c22885c9', 'c25a5f07-d65f-4ba9-9b0d-cb4d5b426455', 'en', 'Close Grip Handle Pulldown', 'Attach a close-grip handle (triangle) to the lat pulldown and sit with thighs secured. Take a neutral grip, keep the torso tall with a slight forward lean, and initiate by depressing/retracting the shoulder blades before bending the elbows. Pull the handle to the upper chest until elbows align with the torso, pause, then return overhead under control without shrugging or leaning back. Keep ribs down and avoid using momentum.', '2025-10-19 15:48:28.485742', '2025-10-19 15:48:28.485742');
INSERT INTO public.exercise_example_translations VALUES ('3a16d64f-82ab-44e3-9012-3098178573d0', 'c25a5f07-d65f-4ba9-9b0d-cb4d5b426455', 'ua', '     ( )', '        ,  .   ,       .       ,   .      ,       ;       ,       .      .', '2025-10-19 15:48:28.485742', '2025-10-19 15:48:28.485742');
INSERT INTO public.exercise_example_translations VALUES ('a12ed7a3-7f24-4cc8-8b61-4df793b91174', '7470e789-9509-4e22-9078-67857074867d', 'en', 'One-Arm Seated Cable Row', 'Attach a single handle to a low cable. Sit tall with a neutral spine and slight hip hinge, feet braced. Grip the handle (neutral or overhand), set the shoulder by depressing/retracting the scapula, and pull the handle toward the mid-torso while keeping hips and shoulders square (avoid twisting). Pause and squeeze the working shoulder blade, then return under control to a full stretch without rounding. Do not shrug the shoulder.', '2025-10-19 18:09:59.393396', '2025-10-19 18:09:59.393396');
