INSERT INTO public.exercise_example_translations VALUES ('ba07928c-9134-4add-96f3-34578ed3e61e', 'd6743870-0d5a-4180-9671-181b8f65e03e', 'en', 'Decline Lying Tricep Extension (Skullcrusher)', 'Set a decline bench to ~2030. Select the desired weight and lie back, keeping the bar close to your chest; press to lockout over the shoulders. Use a narrow overhand grip on the EZ bar, wrists neutral, elbows slightly tucked and fixed. From a stable upper-arm position, unlock the elbows and lower the bar toward the forehead or just behind the head. When the forearms reach parallel or slightly below, extend the elbows to lockout by contracting the triceps. Avoid shoulder movement, pause briefly, then repeat for reps.', '2025-10-19 16:04:36.280536', '2025-10-19 16:04:36.280536');
