INSERT INTO public.exercise_example_translations VALUES ('d5ca6086-db06-4d51-8a6b-b11e6a5a8ade', '2bc37dec-7b06-404c-af63-99bf3f60fb68', 'en', 'Dumbbell Pullover', 'Compound upper-body movement bridging chest and back. Lie on a flat bench, hold one dumbbell with both hands above the chest, soft elbows (~1530). Inhale as you lower in an arc behind the head without losing ribcage/neutral spine; exhale and return by shoulder extension. To bias chest: keep elbows slightly wider and cue ribcage down; to bias lats: tuck elbows closer and drive upper arms toward hips. Keep scapulae depressed/retracted; avoid excessive lumbar arch.', '2025-10-19 16:28:41.504577', '2025-10-19 16:28:41.504577');
