INSERT INTO public.exercise_example_translations VALUES ('b64f7d20-6c0c-4a68-98b9-93b01077199e', '14dbd276-30fe-4558-9cf0-104751b58f2d', 'en', 'Dumbbell Rear Lunge', 'Step back into a long split stance with dumbbells at your sides, torso upright, and core braced. Drop straight down until the back knee lightly touches the floor, front knee tracking over toes; drive through the whole front foot to stand. The reverse step biases hip/quad loading while reducing forward knee shear. Keep pelvis square, neutral spine, and steady arms (no trunk lean). Primary: quadriceps; glutes/adductors assist; hamstrings act mostly eccentrically; calves and core stabilize; abductors manage frontal-plane control.', '2025-10-19 16:29:30.195497', '2025-10-19 16:29:30.195497');
