INSERT INTO public.exercise_example_translations VALUES ('be3fc275-0fc3-43b8-adde-40fa767d3358', '5de5124e-8ebb-4477-b4b3-e1122cc80496', 'en', 'Dumbbell Shrugs', 'Stand tall with a dumbbell in each hand at your sides. Keep arms straight, neck neutral, and raise your shoulders straight up toward your ears by contracting the traps. Pause briefly at the top, then lower slowly under control. Avoid rolling the shoulders or using momentum to maintain trap emphasis.', '2025-10-19 16:30:16.074184', '2025-10-19 16:30:16.074184');
