INSERT INTO public.exercise_example_translations VALUES ('6c599bed-223f-438d-9774-bdea7e30b4a6', '7e80becf-491c-4b48-a98a-a36fff26e29c', 'en', 'Dumbbell Side Bends', 'This exercise targets the obliques. Stand tall with a shoulder-width stance. Hold one dumbbell in the working hand (or two lighter dumbbells if preferred), palms facing in. Brace your core, keep your ribs down and spine neutral. Without leaning forward/back or rotating, slowly side-bend the torso toward the dumbbell until you feel a stretch on the opposite side. Exhale as you return to upright by contracting the obliques; avoid hiking the hip. Move through the torso only and keep the dumbbell close to your body. Alternate sides or complete all reps on one side. You may also perform this seated on a bench for more stability.', '2025-10-19 16:31:25.070657', '2025-10-19 16:31:25.070657');
INSERT INTO public.exercise_example_translations VALUES ('44161052-4e18-42ba-875d-8488e05bea8f', 'bb9c756b-0c9e-4e87-826f-bb2cbd16d86b', 'ua', '     ', '          ,   ( ),    .  ,  ,  .      ,  ,   ,  ,      .   ,    ,      .', '2025-10-19 16:38:57.979', '2025-10-19 16:38:57.979');
