INSERT INTO public.exercise_example_translations VALUES ('a6af1892-bcc5-4b57-bd77-997825ea9f7b', '24c43903-d3a7-4a39-9231-5bc7d5cec5da', 'en', 'Dumbbell Split Squat', 'Hold dumbbells at your sides, set a stable split stance, brace the core, and descend under control until the back knee nears the floor; drive through the whole front foot to stand. Quadriceps are primary; glutes assist hip extension; hamstrings contribute mainly eccentrically; adductors/abductors aid frontal-plane control; calves and core stabilize.
INSERT INTO public.exercise_example_translations VALUES ('53ec47a8-2710-4a60-b7da-7c098e16a74e', '24c43903-d3a7-4a39-9231-5bc7d5cec5da', 'ua', '-  ', '   ,     ,      ,       ; ,     .    ;     ;       ; /      ;    . :  ,      ,   ( ),    ,      .', '2025-10-19 16:32:18.268364', '2025-10-19 16:32:18.268364');
