INSERT INTO public.exercise_example_translations VALUES ('00406a42-a97f-44e6-b669-88e1673457f4', '978f906a-8584-4cdf-9d7f-f96d60865e3b', 'en', 'Dumbbell Squat', 'Hold a pair of dumbbells at your sides with a neutral grip, shoulders packed, feet about shoulder-width. Brace the core, keep the chest tall and spine neutral. Sit the hips down and slightly back, letting the knees track over the toes, until thighs reach parallel (or lower as mobility allows). Drive up through the whole foot without bouncing or forcefully locking the knees. Keep the bells close to the body and avoid knee valgus throughout.', '2025-10-19 16:33:20.630916', '2025-10-19 16:33:20.630916');
INSERT INTO public.exercise_example_translations VALUES ('9c89a739-a0af-4d70-a037-a0fa812ea416', '978f906a-8584-4cdf-9d7f-f96d60865e3b', 'ua', '  ', '      ,   ,     .  ,       .      ,      ,       (    ). ,    ,      .          .', '2025-10-19 16:33:20.630916', '2025-10-19 16:33:20.630916');
INSERT INTO public.exercise_example_translations VALUES ('1957e152-ea30-4a30-8cc3-f3c44c9b51c8', 'f11ef4dd-cc6b-42ad-844d-0e94cef691f0', 'en', 'Glute Ham Raise', 'Set up on a GHR/GHD with knees bent, hips extended, and torso upright. Brace, keep a neutral spine, and maintain hip extension throughout. Extend the knees until the body is straight and parallel to the floor; pause. Return by flexing the knees while keeping the hips open (no lumbar hyperextension). Move under control; avoid swinging.', '2025-10-19 16:51:59.425007', '2025-10-19 16:51:59.425007');
INSERT INTO public.exercise_example_translations VALUES ('4c39ff21-5fd4-41a8-afea-1c20c2f9922e', 'be3c01a7-3bd0-448c-844b-583bd824c90b', 'ua', '      ', '     ,   .  ,       ( 1015).  -,   :   ,    . ,         (   ),   .  ,   . ,         ;   .    .', '2025-10-19 16:34:25.57058', '2025-10-19 16:34:25.57058');
