INSERT INTO public.exercise_example_translations VALUES ('c82e6920-d72f-47f9-b490-1ececbccd5db', '8e687b8b-0142-49f7-92e9-4d5df9aa86c9', 'en', 'Wide Grip Pull Up', 'Using a pronated grip, grasp the pull-up bar wider than shoulder width. Take a deep breath, squeeze your glutes, and brace your abs. Initiate by depressing and slightly retracting the shoulder blades, then drive the elbows straight down to lift your chin over the bar while keeping ribs down and neck neutral. Pause briefly and lower to a full hang under control without swinging or kicking.', '2025-10-19 21:18:38.238518', '2025-10-19 21:18:38.238518');
INSERT INTO public.exercise_example_translations VALUES ('f4787ec2-9c7e-487a-9f4e-bfc1a07fc894', 'de763854-d06d-43e9-9973-f4ca8839201b', 'en', 'Dumbbell Walking Lunge', 'Hold dumbbells at your sides, step forward into a lunge, descend until the back knee approaches the floor while the front knee tracks over the toes, then drive through the whole front foot to stand and step through. Quadriceps are primary; glutes assist hip extension; hamstrings contribute mainly eccentrically; adductors/abductors control the frontal plane; calves and core stabilize.
INSERT INTO public.exercise_example_translations VALUES ('43147598-129e-4cdd-96e1-dba13c6ec414', 'de763854-d06d-43e9-9973-f4ca8839201b', 'ua', '    ', '   .     , ,       ,       ; ,     ,     .    ;     ;      ; /   ;     . :  ,  ,    ,    ,  .', '2025-10-19 16:37:49.135669', '2025-10-19 16:37:49.135669');
