INSERT INTO public.exercise_example_translations VALUES ('8a913d81-4d82-47ff-b915-93d9b9cbc6df', '53defdc5-bfec-4af4-bfba-60440e3493cc', 'en', 'EZ Bar Incline Skullcrusher', 'Set an adjustable bench to 2030. Sit, lie back with the EZ bar close to your chest, then press to lockout over the shoulders. Keep upper arms fixed and elbows tucked. Unlock the elbows and lower the bar toward the forehead (or just behind the head) until forearms are slightly below parallel. Extend the elbows to return to lockout, keeping wrists neutral and torso still. Repeat for reps.', '2025-10-19 16:40:00.269534', '2025-10-19 16:40:00.269534');
