INSERT INTO public.exercise_example_translations VALUES ('172d9f38-a73d-431c-9d09-4135358dd784', '1fdffa53-d9cb-4aa1-9999-5c83fdb9be80', 'en', 'Hip Abduction Machine', 'Set up seated upright with your back against the pad, spine neutral, and pads on the outer thighs just above the knees. Grip the handles and brace your core. Exhale and abduct the hips by driving the knees outward to open the pads without leaning back or arching the lower back. Pause briefly at end range, then return under control to a comfortable stretch. Keep knees tracking with toes and avoid bouncing. Repeat for the desired reps.', '2025-11-19 10:42:52.303312', '2025-11-19 10:42:52.303312');
INSERT INTO public.exercise_example_translations VALUES ('3520d392-87ce-46bd-b79c-72d3182df02b', 'b515dd55-701a-45f4-938f-fdb26d2d5cba', 'en', 'Seated Cable Wrist Curl', 'Set a low pulley and attach a straight bar. Sit on a flat bench facing the stack with your forearms resting on your thighs or the bench and wrists hanging past the edge, palms up. Grip shoulder-width with thumbs wrapped. Keep elbows and forearms fixed, shoulders relaxed. Lower by allowing controlled wrist extension, then curl the bar by flexing the wrists until it nears the forearms. Pause, avoid shoulder/hip motion and ulnarradial deviation, and use a smooth full range of motion.', '2025-10-19 19:15:47.224713', '2025-10-19 19:15:47.224713');
INSERT INTO public.exercise_example_translations VALUES ('71845404-bb49-4d49-8cfe-d2e99bc9b911', '5ab252b3-204d-4846-80e8-a7629f2d2e25', 'en', 'Frog Squat', 'Bodyweight squat with a wider stance and toes slightly turned out. Drop hips between the knees while keeping the chest up and spine neutral; elbows can gently press against the inner knees to encourage knee tracking. Descend under control to a comfortable depth and stand by driving through the mid-foot/heel. Emphasizes knee flexion (quadriceps) with notable adductor/glute contribution; hamstrings act mainly eccentrically; calves and core stabilize.
INSERT INTO public.exercise_example_translations VALUES ('e98eaaf0-1e8b-4aea-ac30-e4da8b35052b', '5ab252b3-204d-4846-80e8-a7629f2d2e25', 'ua', ' ', '        .    ,       ;       ,   .        ,    /.      ();     ;      ;    . :    ,    ,   / ,  .', '2025-10-19 16:48:48.006851', '2025-10-19 16:48:48.006851');
INSERT INTO public.exercise_example_translations VALUES ('fb99d392-44a0-4bf9-b6fc-c8736c533abe', '47f00a63-05df-4db7-b2c7-68000c72be9b', 'en', 'Incline Dumbbell Bench Press', 'Incline dumbbell press emphasizing the upper chest. Set bench at ~3045, retract/depress scapulae, feet planted, neutral wrists. Lower dumbbells in a slight arc until forearms are vertical near the bottom without losing shoulder position; press up and back over the shoulders. Keep elbows ~4560 to the torso. Dumbbells improve ROM and side-to-side balance versus a barbell.', '2025-11-23 14:34:16.866501', '2025-11-23 14:34:16.866501');
INSERT INTO public.exercise_example_translations VALUES ('e7538bbc-c0ab-476a-b789-2e0200e24bae', '5ab252b3-204d-4846-80e8-a7629f2d2e25', 'ru', ' ', '        .    ,      ;        ,    .       ,    /.      ();     ;       ;     . :     ,    ,   / ,  .', '2025-10-19 16:48:48.006851', '2025-10-19 16:48:48.006851');
INSERT INTO public.exercise_example_translations VALUES ('31f0626c-d7f7-473e-b278-82d9c9f061e8', '2fd70951-2d44-407e-a7ee-daa94bf6af87', 'en', 'Front Squat', 'Set up in a front rack (clean grip or cross-arm), elbows high, chest up, and bar over mid-foot. Brace the core, sit straight down keeping a relatively upright torso, knees tracking over toes, and stand by driving through the whole foot. Anterior load increases knee flexion demand (quadriceps) while glutes and adductors assist; hamstrings contribute mainly eccentrically; calves and core stabilize; upper back (traps/rhomboids) maintains thoracic extension.
INSERT INTO public.exercise_example_translations VALUES ('5b8137fc-59bd-4aad-bf1d-95f3a671bbc2', '2fd70951-2d44-407e-a7ee-daa94bf6af87', 'ua', ' ', ' - (    ),  ,   ,    .  ,       ,     ;    . ,  .         ();    ;      ;    ;   (/)   . :   ,   ,   ( -/ ),     .', '2025-10-19 16:49:53.411335', '2025-10-19 16:49:53.411335');
