INSERT INTO public.exercise_example_translations VALUES ('92bac37a-3002-49a2-805e-1df0e790ca43', 'b39cc5b5-8335-4918-a504-f9cdfb85ceba', 'en', 'Good Mornings', 'Set a barbell across the upper back (not the neck) and unrack from a squat rack. Stand hip-width with a slight knee bend, feet flat. Brace the torso (ribs down), keep a neutral spine, and pin the bar in place by pulling elbows down and lats tight. Hinge by pushing the hips back until you feel a strong hamstring stretch while shins stay near vertical; stop before lumbar flexion. Drive the floor and extend the hips to stand tall without hyperextending. Move under control with consistent tempo; use light-to-moderate loads and spotter arms when learning.', '2025-10-19 16:53:35.030468', '2025-10-19 16:53:35.030468');
