INSERT INTO public.exercise_example_translations VALUES ('7591a8b2-eb21-4007-b6bd-112b17fcda9c', '3a39a222-7b4d-4e0e-9e7e-034d78b5d6bf', 'en', 'Good Mornings Off Pins', 'Set safety pins in a rack at the bottom of your desired range (torso near parallel to floor). Position the bar on your upper back against the pins, take a hip-width stance, and grip just outside shoulder-width. Inhale and brace, keep a neutral spine and soft knees (1015). Drive the hips forward to lift the bar off the pins and stand tall. Hinge by pushing the hips back with shins nearly vertical, keep lats tight and elbows pulled down. Lower under control until the bar lightly contacts the pins, pause (dead stop), fully re-brace, and repeat. Avoid lumbar rounding or hyperextension throughout.', '2025-10-19 16:54:24.85911', '2025-10-19 16:54:24.85911');
INSERT INTO public.exercise_example_translations VALUES ('7ad24aef-10d4-4664-a7cf-bb76aaa6bc8e', '3a39a222-7b4d-4e0e-9e7e-034d78b5d6bf', 'ua', '    ', '       (   ).       ,    ,    .     ,       (1015).  ,       .  -,       ,   ,   .   ,      ,   (dead stop),     .     .', '2025-10-19 16:54:24.85911', '2025-10-19 16:54:24.85911');
