INSERT INTO public.exercise_example_translations VALUES ('6416a105-f568-4e9c-b56a-a00cc9beb31e', 'c1ca2c25-9148-4977-99fe-3acda0b4ad33', 'en', 'One Arm Dumbbell Row', 'Stand holding one dumbbell with a neutral grip. Hinge until your torso is near parallel to the floor, keep a neutral spine, square the hips/shoulders, and brace the core. Initiate by depressing/retracting the working-side shoulder blade, then drive the elbow behind the body to pull the dumbbell toward the lower ribs/hip without shrugging or rotating. Pause and squeeze, then lower under control to a full stretch. Optionally brace the free hand on a flat bench or rack for stability.', '2025-10-19 18:05:38.899198', '2025-10-19 18:05:38.899198');
INSERT INTO public.exercise_example_translations VALUES ('5d11f3c3-bf8f-4cbf-9027-5a309f64254b', 'ea89fe55-c50f-4bbf-acc1-96e7df46101a', 'en', 'One Leg 45 Degree Leg Press', 'Use one foot centered on the 45 leg press platform. Keep hips/pelvis square to the pad, brace the core, and track the knee over the toes. Lower under control to ~90 knee flexion and press through the mid-foot/heel. Unilateral setup increases frontal-plane control demands (glute medius/adductors) while quadriceps remain the primary driver; glutes/hamstrings assist hip extension; calves stabilize the ankle.
INSERT INTO public.exercise_example_translations VALUES ('72a2bcfd-9208-4cfd-9750-7d7052dcb369', '7d823dc8-8303-4ddd-a25d-935569c662b7', 'ua', '', '  ,         ,     .     ,   ( ,  )     ,       .      ,      ;      .  ,       .', '2025-10-19 17:04:00.428536', '2025-10-19 17:04:00.428536');
