INSERT INTO public.exercise_example_translations VALUES ('e8788536-ac41-4214-9a03-de23a11801d2', '91f6781b-915e-4bb4-8d8c-e345aa66e42d', 'en', 'Incline Bench Two Arm Dumbbell Row', 'Prone, chest-supported dumbbell row that reduces lower-back demand while targeting the upper/mid-back. Set an adjustable bench to ~3045, lie face down with a dumbbell in each hand (pronated grip), and keep a neutral spine and braced core. Drive the elbows back at ~3060 to the torso, pulling toward the lower ribs while retracting/depressing the shoulder blades. Pause briefly, then lower under controlallowing a gentle scapular protractionwithout shrugging or using hip/leg drive.', '2025-10-19 17:10:18.870095', '2025-10-19 17:10:18.870095');
INSERT INTO public.exercise_example_translations VALUES ('150345f3-aa9a-47e0-9236-109b676c6fb5', '91f6781b-915e-4bb4-8d8c-e345aa66e42d', 'ua', '      ( )', '            /  .    ~3045          ( ).     .     ~3060  ,    ,  / .  ,    ,    ;       /.', '2025-10-19 17:10:18.870095', '2025-10-19 17:10:18.870095');
INSERT INTO public.exercise_example_translations VALUES ('0e29f503-de43-4ca9-adb2-2e6c45c2ce6a', '88baf661-c550-4ecd-b15a-0d1ca4d41116', 'en', 'One Leg Dumbbell Squat (AKA Dumbbell Bulgarian Split Squat)', 'Rear foot elevated on a bench (laces down) in a split stance. Hold dumbbells at the sides with a neutral grip. Brace, descend on the front leg until the back knee approaches the floor, keeping the front knee tracking over toes, pelvis level, and full-foot pressure. Minimize push-off from the rear leg; drive through the mid-foot/heel to stand while maintaining hipkneeankle alignment. Primary emphasis is on the quadriceps; glutes and adductors assist hip extension and frontal-plane control; hamstrings co-contract; calves and abdominals stabilize; forearms support the grip.', '2025-10-19 18:07:50.018104', '2025-10-19 18:07:50.018104');
INSERT INTO public.exercise_example_translations VALUES ('aadc01ba-855b-4c49-8eaf-2cfe1b29df4b', '91f6781b-915e-4bb4-8d8c-e345aa66e42d', 'ru', '      ()', ',     ,        / .    ~3045          ( ).     .     ~3060  ,    ,  / .  ,   ,    ;       /.', '2025-10-19 17:10:18.870095', '2025-10-19 17:10:18.870095');
INSERT INTO public.exercise_example_translations VALUES ('a32f9111-0aa4-490b-b7a6-19cbb8757262', 'ff2d84fc-ff6d-4637-8128-91c1495c98e8', 'en', 'Incline Cable Flys', 'Set an adjustable bench to an incline between dual adjustable pulleys. Attach D-handles, lie supine, keep a slight fixed elbow bend, and sweep the arms up/in over the upper chest; return under control to maintain constant cable tension. Keep scapulae retracted/depressed to bias the upper pecs and avoid turning the movement into a press.', '2025-10-19 17:11:35.410049', '2025-10-19 17:11:35.410049');
INSERT INTO public.exercise_example_translations VALUES ('0ade3d0e-90ce-4771-bba4-9fe056ed03dc', 'ff2d84fc-ff6d-4637-8128-91c1495c98e8', 'ru', '     ', '       ,  D-    .           /   ;  ,    .    ,      ;     .', '2025-10-19 17:11:35.410049', '2025-10-19 17:11:35.410049');
INSERT INTO public.exercise_example_translations VALUES ('a1c7bcbc-5df8-445d-acce-688a8821c9b4', '4a2c7160-6cf2-456d-8ef4-80040b720420', 'en', 'Lat Pulldown', 'Attach a wide-grip bar to the lat pulldown and sit tall with feet flat. Grasp the bar with a pronated grip just outside shoulder width. Brace your core, initiate by depressing and slightly retracting the shoulder blades, then drive the elbows down to pull the bar toward the upper chest. Pause briefly, keep ribs down and wrists neutral, then return to a full overhead stretch under control without shrugging or leaning back.', '2025-10-19 17:43:43.164964', '2025-10-19 17:43:43.164964');
INSERT INTO public.exercise_example_translations VALUES ('774d146b-b202-43e0-b524-3bdcbf6d542c', 'd806b4f1-399c-4ceb-bb91-663ec0350e6d', 'en', 'Reverse Hyperextension', 'Set up prone on a reverse hyper or GHD with your hips at the front edge of the pad and legs hanging freely. Grip the handles, brace (ribs down), keep a neutral spine with a slight posterior pelvic tilt. Initiate by squeezing the glutes to extend the hips, raising the legs until your body is roughly in line; avoid lumbar hyperextension and swinging. Pause briefly, then lower under control, allowing a gentle stretch below hip line. Keep knees soft, torso quiet, and breathe/brace each rep. Add ankle straps or a light load only if you can maintain perfect control.', '2025-10-19 19:03:40.684865', '2025-10-19 19:03:40.684865');
INSERT INTO public.exercise_example_translations VALUES ('d7358e00-57f8-468a-9493-d9c2f8c6fec5', '4a2c7160-6cf2-456d-8ef4-80040b720420', 'ua', '    ', '         ,   .      .  ,        ,    ,      .  ,      ,               .', '2025-10-19 17:43:43.164964', '2025-10-19 17:43:43.164964');
INSERT INTO public.exercise_example_translations VALUES ('fcbb0af6-43a0-40bf-953e-67fd53c38359', '04d3e242-807d-4cba-9be4-e3d11a8efbc4', 'en', 'Reverse Hack Squat', 'Load the reverse hack squat machine. Face the pads with your chest on the chest pad and shoulders under the shoulder pads. Place your feet about shoulder-width on the lower platform with toes slightly turned out. Brace, keep a neutral spine and pelvis, press up to take the weight, and disengage the safeties. Descend under control by bending knees and hips, letting the knees track over the toes with heels planted until thighs are roughly parallel to the platform. Drive the platform away by extending knees and hips, squeeze the glutes at the top without locking the knees. Re-engage the safeties when finished.', '2025-10-19 19:02:21.749727', '2025-10-19 19:02:21.749727');
INSERT INTO public.exercise_example_translations VALUES ('934417b2-2fdb-40f6-9086-88771e357356', '4a2c7160-6cf2-456d-8ef4-80040b720420', 'ru', '    ', '         ,   .      .  ,        ,    ,      .  ,      ,               .', '2025-10-19 17:43:43.164964', '2025-10-19 17:43:43.164964');
INSERT INTO public.exercise_example_translations VALUES ('c712244f-b05e-4273-a1a8-6591f4c207b1', '05b3842c-2a19-484e-bae3-a12e86c2fa4c', 'en', 'Leg Curl', 'Adjust the machine so your knee joint aligns with the machines pivot and the ankle pad rests just above the heel/Achilles. Set the hip/chest pad snug to prevent the hips from lifting. Brace, keep a neutral pelvis and ribs down. Flex the knees to curl the pad toward the glutes without swinging; squeeze briefly, then lower under control (23 s) to near full extension without locking out. Keep the movement at the kneeminimal hip motion. Dorsiflex the ankles to bias the hamstrings (plantarflexion increases calf involvement).', '2025-10-19 17:44:33.017035', '2025-10-19 17:44:33.017035');
INSERT INTO public.exercise_example_translations VALUES ('f6404265-088e-49cb-95b6-bae65259dda5', '1959abd3-4ab1-42d4-b7e2-45693b899d51', 'en', 'Military Press (AKA Overhead Press)', 'Set the bar in a rack at upper-chest height. Take a shoulder-width stance and grip just outside shoulder width with a pronated grip. Unrack, brace abs and glutes, ribs down. Inhale, tuck the chin and press the bar overhead in a straight path by moving the head slightly back, then bring the head through under the bar at midline. Lock out without excessive shrugging, then lower to the upper chest under control and repeat.', '2025-10-19 18:03:20.607613', '2025-10-19 18:03:20.607613');
INSERT INTO public.exercise_example_translations VALUES ('c6c81e0b-4613-4970-a974-370e219e2340', '05b3842c-2a19-484e-bae3-a12e86c2fa4c', 'ua', '   ', ' :        ,    /.    / ,    .  ,  ,  .  ,      ;  ,   23       .    ,   .           (   ).', '2025-10-19 17:44:33.017035', '2025-10-19 17:44:33.017035');
