INSERT INTO public.exercise_example_translations VALUES ('e8298227-ae3d-495f-9bda-611f0751a683', '10f8ff0e-38c6-465d-b99a-26c4026d22c6', 'en', 'Leg Extension', 'Set up on the leg extension machine with the seat depth adjusted so your knees align with the machines pivot/axis. Position the back pad to maintain a neutral spine and place the shin pad just above the ankles. Grip the handles, keep hips and glutes anchored to the seat, dorsiflex the ankles, and extend the knees to fully contract the quadriceps without forcefully locking out. Pause briefly, then lower the weight under control (slightly slower on the way down) while keeping the pelvis level and avoiding momentum.', '2025-10-19 17:48:15.7611', '2025-10-19 17:48:15.7611');
