INSERT INTO public.exercise_example_translations VALUES ('41d3c907-4000-41d1-a8fa-f4e9eaea78bb', '8a39b1e7-986c-41e7-a0b9-44a4efb46360', 'en', 'Reverse Grip Dumbbell Bench Press', 'Lie on a flat bench with a supinated (reverse) grip on dumbbells, wrists straight and forearms vertical. Set scapular retraction and slight depression, feet planted. Lower the bells toward the upper chest/clavicles with elbows tucked ~3045, keeping forearms under the handles. Press to full elbow extension without losing rib cage position; control the tempo and range.', '2025-10-19 18:39:40.519672', '2025-10-19 18:39:40.519672');
INSERT INTO public.exercise_example_translations VALUES ('db732c92-a072-4dc5-ae4e-b711026488fb', '1959abd3-4ab1-42d4-b7e2-45693b899d51', 'ua', '  (  )', '        .           .  ,    ,  .             ,        .      ,          .', '2025-10-19 18:03:20.607613', '2025-10-19 18:03:20.607613');
INSERT INTO public.exercise_example_translations VALUES ('c1efcdf4-fe15-40f0-97f8-4960c9fd733b', 'b99df7e8-eb44-4be1-be81-701347580781', 'en', 'Lying Incline Bench Barbell Curl', 'Set an adjustable bench to ~30 and lie prone with your chest supported at the end of the bench. Grasp an EZ bar with a shoulder-width supinated grip, wrists neutral, elbows hanging under the shoulders. Brace, keep the torso still (no shrugging or swinging), and curl the bar under control. Squeeze the biceps near the top without letting the elbows drift forward, then lower slowly to full elbow extension. Repeat for the desired reps.', '2025-10-19 17:50:48.008116', '2025-10-19 17:50:48.008116');
