INSERT INTO public.exercise_example_translations VALUES ('f117760f-ef7d-4deb-adc8-224ef9e36029', '4dc80274-2d3e-482e-a736-9f9399330c76', 'en', 'Machine Hack Squat', 'Set feet shoulder-width on the hack platform, toes slightly out, and keep hips/back flat against the pad. Brace, descend by bending knees while allowing knees to track over toes, then drive through the mid-foot/heel to stand without locking out hard. Keep ribs down, neutral spine, and full foot contact. Primary emphasis is on the quadriceps; glutes and adductors assist hip extension and frontal-plane control; hamstrings contribute minimally (mostly co-contraction), while calves and abs stabilize.', '2025-10-19 17:52:52.647992', '2025-10-19 17:52:52.647992');
INSERT INTO public.exercise_example_translations VALUES ('ce05ef2f-3bfa-4de4-ba12-eff19b3479b9', '4dc80274-2d3e-482e-a736-9f9399330c76', 'ua', '  -', '    -   ,   ,       .  ; ,         ,  ,    /,   .   ,       .    ;            ;       ( -);     .', '2025-10-19 17:52:52.647992', '2025-10-19 17:52:52.647992');
INSERT INTO public.exercise_example_translations VALUES ('c8305c17-b9e6-481b-b981-11d305f0e6fe', 'b22e5ada-86c1-4104-828b-b7e06a7f5d16', 'en', 'Seated Neutral Grip Dumbbell Shoulder Press', 'Set an adjustable bench to 90. Pick up dumbbells with a neutral grip (palms facing in), sit, and knee-kick them to shoulder height. Start with forearms vertical, wrists stacked over elbows, ribs down, and back against the pad. Inhale and press overhead without shrugging, finishing with biceps near ears and elbows extended but not hyperextended. Control the descent to ~90 elbow angle (or slightly below based on comfort), maintain the neutral grip, and repeat for reps.', '2025-10-19 19:29:23.975789', '2025-10-19 19:29:23.975789');
