INSERT INTO public.exercise_example_translations VALUES ('5e02036d-ee14-42db-9eb9-e9e81fef0927', '7a933584-128c-4b82-8e5b-5e7312cadfdf', 'en', 'One-Arm Cable Front Raise', 'Attach a single-grip handle to a low pulley and select a moderate load. Stand facing away from the stack and grasp the handle with an overhand grip. Step forward to keep tension; feet shoulder-width, ribs down, wrist neutral, slight bend in the elbow. Raise the arm in the sagittal plane to shoulder height without swinging or leaning and avoid shrugging. Pause briefly, then lower under control without letting the stack touch. Repeat for reps and then switch arms.', '2025-10-19 18:09:03.410767', '2025-10-19 18:09:03.410767');
