INSERT INTO public.exercise_example_translations VALUES ('5e213843-5da5-4813-be36-27efaf91f389', '10870aab-3086-462e-a64e-14710e3fbffe', 'en', 'One-Arm Seated Dumbbell Wrist Curl', 'Sit on a flat bench and work one arm at a time. Rest the forearm on the bench or thigh with the palm up (supinated) and the wrist just beyond the edge. Hold a dumbbell, keep the elbow fixed and shoulder relaxed. Lower into wrist extension under control, then flex the wrist to curl the weight, pausing briefly at peak. Avoid elbow flexion, forearm rotation, or swinging to keep tension on the wrist flexors. Unilateral execution helps address side-to-side imbalances.', '2025-10-19 18:11:33.941411', '2025-10-19 18:11:33.941411');
