INSERT INTO public.exercise_example_translations VALUES ('82a0f84c-cabd-4488-8564-69eb65784c16', '8cccb149-8553-494d-bcb5-ffa9b06e7c0f', 'en', 'Pendlay Row', 'A strict bent-over row from a dead stop on the floor to build explosive pulling strength and upper-back development. Set the bar over mid-foot, hinge until the torso is nearly parallel to the floor, brace, and keep a flat back. Grip double overhand and pull explosively toward the lower chest/upper stomach while retracting the shoulder blades; elbows track roughly 4560. Lower under control back to the floor and let the plates settle before the next rep. Avoid using hip extension or torso rise for momentum.', '2025-10-19 18:21:39.406079', '2025-10-19 18:21:39.406079');
