INSERT INTO public.exercise_example_translations VALUES ('5e7acbc2-0804-4f03-881f-ed09f224d64a', 'c5864272-ae27-4363-add6-7ead1b7b3379', 'en', 'Reverse Grip Barbell Curl', 'Stand with a shoulder-width pronated (overhand) grip on a barbell. Keep elbows tight to your sides, upper arms still, and wrists neutral (no wrist curling). Flex the elbows to raise the bar until forearms are near vertical, pause, then lower under control to full extension. Avoid swinging, shrugging, or leaning back.', '2025-10-19 18:32:08.226206', '2025-10-19 18:32:08.226206');
