INSERT INTO public.exercise_example_translations VALUES ('ecd0f08e-c04c-470f-925b-b9123af11b79', 'd3f54e1c-6333-4a15-b09b-0264ec0b68fe', 'en', 'Reverse Grip Barbell Curl (EZ Bar)', 'Stand tall holding an EZ bar with a pronated (overhand) grip about shoulder-width. Keep elbows pinned to your sides, wrists neutral (avoid flexing/extension), and torso still. Flex the elbows to curl until forearms are near vertical, then lower under control without swinging or shrugging. The pronated grip shifts emphasis toward the brachioradialis and forearm extensors while the biceps assist.', '2025-10-19 18:33:08.202414', '2025-10-19 18:33:08.202414');
