INSERT INTO public.exercise_example_translations VALUES ('12132061-2e87-4cb5-9a80-242e471cf01c', '6bb0675d-eba0-496c-bd20-5fd11a4a0282', 'en', 'Reverse Grip Incline Bench Barbell Row', 'Set an incline bench to ~30 and lie prone with the chest and hips anchored. Take a shoulder-width underhand (supinated) grip, keep elbows tucked, shoulders down and back, and pull the bar toward the lower chest/upper ribs. Squeeze the back at the top, then lower under control to a full stretch. Avoid shrugging or excessive neck extension; the chest-supported setup reduces lower-back strain while emphasizing the lats.', '2025-10-19 18:58:48.147737', '2025-10-19 18:58:48.147737');
