INSERT INTO public.exercise_example_translations VALUES ('d63fe7a3-7603-409f-a295-7bc9fc1c27bf', 'bd3338ee-1841-4686-a98c-3493ab9cfa7e', 'en', 'Reverse Grip Lat Pulldown', 'Attach a straight bar to the lat pulldown and sit with thighs secured. Grasp the bar with a supinated (underhand) grip at or just inside shoulder-width. Sit tall, brace, depress the shoulder blades, and keep the elbows tucked as you drive them down and slightly back to pull the bar to the upper chest. Pause and squeeze the lats, then return overhead under control without shrugging, leaning back, or letting the ribs flare.', '2025-10-19 18:59:58.090228', '2025-10-19 18:59:58.090228');
