INSERT INTO public.exercise_example_translations VALUES ('fabcc063-0114-42a8-8323-a8c35cd67993', '60bd8dbc-6bb8-4be0-9ee7-f4c5a295c5b4', 'en', 'Reverse Grip Preacher Curl (EZ Bar)', 'Set the preacher bench so your upper arm is fully supported and the armpit meets the top of the pad. Grip an EZ bar with a shoulder-width reverse (pronated) grip on the angled segments. Lock the upper arm to the pad, brace the core, and keep wrists neutral. From full elbow extension, flex the elbows to raise the bar without letting the shoulders roll forward; pause near the top, then lower under control to full extension without bouncing. Avoid wrist curling and torso sway to keep tension on the elbow flexors and forearms.', '2025-10-19 19:01:16.234946', '2025-10-19 19:01:16.234946');
