INSERT INTO public.exercise_example_translations VALUES ('a435b195-cc87-4ea7-8f6f-27cd28cd7eb1', 'b5c6e6a6-6eec-422c-ad4a-8dca82287312', 'en', 'Romanian Deadlift (RDL)', 'Position the bar over mid-foot (shoelaces) and take a hip-width stance. Grip double-overhand just outside hip width and deadlift the bar to the start with hips and knees locked. Soften the knees slightly, brace, keep a neutral spine, and push the hips back to hinge while keeping the bar close (slides along thighs) and shins nearly vertical. Lower until you feel strong hamstring tension or the bar is just below the kneesno lumbar rounding. Drive through the whole foot to extend the hips, stand tall without hyperextending, briefly pause, then repeat. Control the descent and re-brace each rep.', '2025-10-19 19:05:03.55588', '2025-10-19 19:05:03.55588');
INSERT INTO public.exercise_example_translations VALUES ('6bc1b6e3-8df5-4866-84ee-0fe507388f2c', '6e4bc8b2-33ab-46da-9b79-9fff2266cd27', 'en', 'Seated Calf Raise', 'Sit on the seated calf raise machine with the balls of your feet on the platform (toes forward) and heels hanging off. Position the knee pad on the lower thighs just above the knees. Brace your torso, keep the knees bent ~90 and still. Extend the ankles to release the safety, then lower the heels under control to a comfortable stretch. Drive up by plantarflexing through the ball of the foot; pause 12 s at the top and avoid bouncing. Keep reps slow and controlled; do not let the heels rest on the platform between reps. If you feel pressure in the bottom of the foot or behind the knee, reduce the depth.', '2025-10-19 19:17:56.781259', '2025-10-19 19:17:56.781259');
INSERT INTO public.exercise_example_translations VALUES ('d6d5b418-caea-4f32-8cb6-c32906352133', '7b006564-2c61-4661-ab8c-d4cf60fdb3ed', 'en', 'Smith Machine Squat', 'A barbell squat performed on a Smith machine. Stand with feet under the bar, brace the core, descend to at least parallel keeping a tall torso and knees tracking with toes; drive through the whole foot to stand. The fixed bar path reduces global stabilization and keeps the pattern more knee-dominant (quadriceps). Glutes assist hip extension; hamstrings contribute mainly eccentrically; adductors and calves aid stability; core and upper back support the bar.
INSERT INTO public.exercise_example_translations VALUES ('a0469975-9672-45c1-922e-f32869a9bffa', 'b5c6e6a6-6eec-422c-ad4a-8dca82287312', 'ua', '  (RDL)', '     (  )      .                  .   , ,         -,    (  ),   .                   .   ,  ,   ;    .         .', '2025-10-19 19:05:03.55588', '2025-10-19 19:05:03.55588');
