INSERT INTO public.exercise_example_translations VALUES ('3699079b-769c-471a-8e04-20bc36857d70', 'b53daf0a-c7b6-4be8-9230-b33695eb5340', 'en', 'Seated Reverse Barbell Wrist Curl', 'Sit on a flat bench with your forearms resting on your thighs or the bench, wrists just past the edge so they can move freely. Grip a barbell shoulder-width with a pronated (palms-down) grip. Fix the elbows and forearms; only the wrists move. Start with the wrists flexed (bar lowered), then extend the wrists to raise the bar; pause, and lower under control to a full stretch without letting the bar roll from your hands. Keep shoulders relaxed and avoid elbow lift or torso sway.', '2025-10-19 19:31:58.934445', '2025-10-19 19:31:58.934445');
