INSERT INTO public.exercise_example_translations VALUES ('d7a687f6-0bff-4332-bbc5-505f2bdf8da5', '7545289f-f7c8-456b-98e9-f7b15600254c', 'en', 'Seated Reverse Dumbbell Wrist Curl', 'Sit on a flat bench with forearms supported on your thighs/bench, palms down (pronated) and wrists just past the edge. Hold dumbbells lightly, keep elbows still and shoulders relaxed. Extend at the wrists to lift the backs of your hands, pause, then lower under control to a full stretch. Avoid elbow flexion, swinging, or supination to keep tension on the forearm extensors.', '2025-10-19 19:33:02.22299', '2025-10-19 19:33:02.22299');
INSERT INTO public.exercise_example_translations VALUES ('bbdfffa1-6619-40d2-a005-8c0858c843d3', '7545289f-f7c8-456b-98e9-f7b15600254c', 'ua', '     ( )', '   ,    /   (),    .  ,  ,  .  ,    ;         .   ,   ,      .', '2025-10-19 19:33:02.22299', '2025-10-19 19:33:02.22299');
INSERT INTO public.exercise_example_translations VALUES ('1076cd7a-e2ec-453b-8cfb-08919d661a76', 'a2f8dd49-606e-4d86-ae04-8af61c0b40e9', 'en', 'Seated Reverse Grip Cable Wrist Curl', 'Set a low pulley and attach a straight bar. Sit on a flat bench facing the stack with forearms resting on your thighs or the bench edge, wrists hanging off. Take a shoulder-width reverse (overhand) grip with thumbs wrapped. Keep elbows and forearms fixed, shoulders relaxed. From wrist flexion, extend the wrists to lift the bar; pause near neutral/comfortable extension, then lower under control back into flexion. Avoid elbow movement, torso sway, and ulnar/radial deviation; use a smooth full range of motion.', '2025-10-19 19:34:36.73101', '2025-10-19 19:34:36.73101');
INSERT INTO public.exercise_example_translations VALUES ('7a7f0500-281a-43b5-951b-8c4973f1cb61', 'a2f8dd49-606e-4d86-ae04-8af61c0b40e9', 'ua', '      ( )', '      .       ,       ,    .   ()    ,    .    ,  .     ,  ;    /      .   ,    / ;     .', '2025-10-19 19:34:36.73101', '2025-10-19 19:34:36.73101');
