INSERT INTO public.exercise_example_translations VALUES ('b9c765e1-bb5a-43e3-9355-5070ededc5ec', '7976a83a-f4db-4cc5-9cac-7f16f2bc430f', 'en', 'Seated Row (Rope Extension)', 'Attach a rope to a low cable row. Sit tall with a neutral spine, feet braced, and a slight hip hinge. Grip the rope with a neutral grip, set the shoulders by depressing/retracting the scapulae, then pull toward the mid-section (navel/low ribs) while spreading the rope ends apart. Pause and squeeze the shoulder blades together, then return under control to a full stretch without rounding the back. Avoid shrugging or excessive torso lean.', '2025-10-19 20:16:14.110348', '2025-10-19 20:16:14.110348');
INSERT INTO public.exercise_example_translations VALUES ('9544505f-e2cc-4794-86ce-a9c498c4ed5f', '7976a83a-f4db-4cc5-9cac-7f16f2bc430f', 'ua', '     ', '      .        -,  .   , /       (/ ),      .               .       .', '2025-10-19 20:16:14.110348', '2025-10-19 20:16:14.110348');
