INSERT INTO public.exercise_example_translations VALUES ('77ae015e-20db-42e6-ba24-41a3cea8ce44', 'cbb152c0-ba9c-47ea-a8a3-28ad88f56eb6', 'en', 'Smith Machine Bent-Over Row', 'A compound pulling row on a fixed bar path that targets the lats, rhomboids, and midlower traps with added machine stability. Stand facing the bar, grip overhand slightly wider than shoulder-width, unlock, and hinge to ~3045 with a neutral spine and braced core. Keep shins vertical, bar over midfoot, and torso angle fixed. Drive elbows back to pull the bar toward the lower chest/upper stomach, squeeze the shoulder blades, pause briefly, then lower under control without shrugging or using hip drive.', '2025-10-19 20:21:12.584493', '2025-10-19 20:21:12.584493');
INSERT INTO public.exercise_example_translations VALUES ('2b2e36dc-0686-4f78-bfe0-9fbfff433df7', 'cbb152c0-ba9c-47ea-a8a3-28ad88f56eb6', 'ua', '      ', '    ,   ,   -    .    ,      ,      -  ~3045     .   ,    ,   .   ,      / ,     ;          .', '2025-10-19 20:21:12.584493', '2025-10-19 20:21:12.584493');
INSERT INTO public.exercise_example_translations VALUES ('2e696fc5-364e-4f40-9753-b6ccb04c79e7', '82890348-a566-4762-b9b4-f89e52534936', 'en', 'Cable Crossovers (Upper Chest)', 'Set the pulleys low on a cable crossover and attach D-handles. Take a staggered stance, brace the core, and keep a slight bend in the elbows (1530). Retract/depress the scapulae, then sweep the arms on a low-to-high arc to meet around upper-chest/eye level without changing elbow angle; pause and return under control to a stretch. Keep it a fly (not a press), avoid shrugging or overextending the low back.', '2026-01-05 15:16:36.889913', '2026-01-05 15:16:36.889913');
INSERT INTO public.exercise_example_translations VALUES ('8fa07490-0a95-4531-8b99-075612cb2ce0', 'cbb152c0-ba9c-47ea-a8a3-28ad88f56eb6', 'ru', '      ', '    ,  ,   -     .    ,      ,      -  ~3045     .   ,    ,   .   ,      / ,     ;         .', '2025-10-19 20:21:12.584493', '2025-10-19 20:21:12.584493');
INSERT INTO public.exercise_example_translations VALUES ('fcc1770c-acc8-42f8-94a9-6d8620826187', '4ef87c39-b004-4c4c-82a8-ddd0338de8c8', 'en', 'Smith Machine Front Squat', 'A front-loaded squat performed on a Smith machine. Keep an upright torso, brace the core, and let the knees track over the toes as you descend to depth; drive through the mid-foot to stand. The fixed bar path lowers global stabilization demands and keeps emphasis on knee extension (quadriceps). Glutes assist hip extension; hamstrings contribute mainly eccentrically; calves and core stabilize; upper back (rhomboids) supports the front rack.
INSERT INTO public.exercise_example_translations VALUES ('94442f86-3934-470b-ab60-b9d57718d623', '4ef87c39-b004-4c4c-82a8-ddd0338de8c8', 'ua', '    ', '     .   ,  , ,     ,   ; ,    .             ().     ;      ;    ;   ( )  -. :  / ,  ,   ,     .', '2025-10-19 20:23:40.73371', '2025-10-19 20:23:40.73371');
INSERT INTO public.exercise_example_translations VALUES ('e22070d1-6d8c-4ba4-b4d4-e7935da9e5a3', '6115df45-ddad-4fa6-bfb0-1c0cd72de766', 'en', 'Smith Machine Stiff Leg Deadlift', 'Load the Smith machine and set the bar to a comfortable height. Stand feet hipshoulder width and grasp the bar overhand. Position the feet slightly forward to keep the bar tracking vertically over midfoot. Keep a neutral spine, soft (not locked) knees, and hinge at the hipspush the hips back while keeping the bar close to your legs and shins nearly vertical. Lower until you feel a strong hamstring stretch without rounding or posterior pelvic tilt. Brace, keep lats engaged, then drive the hips forward by contracting hamstrings and glutes to stand tall without hyperextending. Control the descent and repeat.', '2025-10-19 20:32:42.285653', '2025-10-19 20:32:42.285653');
INSERT INTO public.exercise_example_translations VALUES ('2f13a021-e62f-4262-a18f-98577f79b308', 'cae7b841-a7f8-4973-baf0-4aadbbdcd0ca', 'ua', '   ', ' ,          .  ,           ( ).  12  ,       ,       .', '2025-10-19 20:28:37.315449', '2025-10-19 20:28:37.315449');
