INSERT INTO public.exercise_example_translations VALUES ('ecafd456-0ca6-49c7-8f3b-151f3e0c4a42', '1e51b837-215d-4069-9d14-c9510c1b1b61', 'en', 'Smith Machine Lunge', 'A unilateral lunge performed on a Smith machine. Set feet in a split stance under the bar, keep the bar path vertical over the mid-foot, brace the core, and descend until the back knee nears the floor; drive through the whole front foot to stand. The fixed bar path lowers global stabilization while the unilateral setup increases frontal-plane control demands. Quadriceps are primary; glutes and adductors assist hip extension and pelvis control; hamstrings act mainly eccentrically; calves and core stabilize.
INSERT INTO public.exercise_example_translations VALUES ('84ac46ec-e20f-44bd-92b1-75729a8bfcce', '1e51b837-215d-4069-9d14-c9510c1b1b61', 'ua', '   ', '    .      ,       .  ,   /      ,    .              ().          ;      ;    . :     ,  ,  ,        .', '2025-10-19 20:26:24.608095', '2025-10-19 20:26:24.608095');
