INSERT INTO public.exercise_example_translations VALUES ('2b349d58-75d5-405a-b6e5-76427cd1f2cc', 'cae7b841-a7f8-4973-baf0-4aadbbdcd0ca', 'en', 'Smith Machine Shrug', 'Set the safeties, stand with feet shoulder-width, and grasp the Smith bar with an overhand grip. Brace the core, keep arms straight, and elevate the shoulders straight up toward the ears (no rolling). Pause 12 s at the top, then lower under control to a full stretch while keeping the neck neutral and elbows extended.', '2025-10-19 20:28:37.315449', '2025-10-19 20:28:37.315449');
INSERT INTO public.exercise_example_translations VALUES ('683680f6-f059-4889-b97a-7d3c4545562f', '7b006564-2c61-4661-ab8c-d4cf60fdb3ed', 'ua', '   ', '     .  ,     ,  .    ,        ; ,   .            - (  ).     ;      ;    ;      . :    ,  ,   ,      .', '2025-10-19 20:31:11.639376', '2025-10-19 20:31:11.639376');
