INSERT INTO public.exercise_example_translations VALUES ('7bb29af2-54e1-4020-aa6c-58fbc948bfc8', '385fb192-7c2c-405a-b483-f36e32e241c8', 'en', 'Close Grip Chest Press', 'Adjust rack height if needed and load the bar. Lie on a flat bench with feet planted. Take a close overhand grip (~812 in, just inside shoulder width). Retract and depress the shoulder blades, keep a slight arch and neutral wrists, then unrack to lockout over mid-chest.
INSERT INTO public.exercise_example_translations VALUES ('a06bc90f-b48f-4f2a-a8d7-feb99597a8c9', '385fb192-7c2c-405a-b483-f36e32e241c8', 'ua', '    ', '       .    ,    .     (~812  / ~2030 ,    ).    ,      ,           .        /     ,   ~3045  ,  .    ,      .        .    .', '2025-11-23 11:37:50.850026', '2025-11-23 11:37:50.850026');
INSERT INTO public.exercise_example_translations VALUES ('8f9387b9-c668-4fb9-8ecb-cc757ecd90c3', 'a4bf88ee-8865-4b1f-88a3-28cf59d28739', 'en', 'Zercher Squat', 'Hold a barbell in the crook of your elbows (Zercher), brace the core, keep the torso relatively upright, and squat to depth with knees tracking over toes. The front-loaded position increases quadriceps demand; glutes and adductors assist hip extension and frontal-plane control; the core stabilizes; biceps/forearms support the cradle hold; hamstrings act mainly eccentrically; calves stabilize the ankle.
