INSERT INTO public.exercise_example_translations VALUES ('86622b86-e457-4699-9da3-5b18488a53ba', '9572d666-227a-4639-9ea3-defd67123fbc', 'en', 'Smith Machine Zercher Squat', 'Set the Smith bar in the crooks of your elbows (Zercher position). Stand with feet shoulder-width, brace the core, and squat with an upright torso. The fixed bar path lowers global stabilization demands while the anterior load increases knee extension demand, shifting emphasis to the quadriceps. Glutes and adductors assist hip extension and frontal-plane control; hamstrings act mainly eccentrically; calves and core stabilize; biceps and forearms support the cradle hold.
