INSERT INTO public.exercise_example_translations VALUES ('1d22abfb-9f20-4a00-b949-433594947b64', '4de0744d-0a78-4052-aa1b-e5340959d9fe', 'en', 'Standing Dumbbell Reverse Curl', 'Select the desired weight from the rack and take a shoulder-width stance. Using a pronated (palms down) grip, keep your elbows pinned to your sides and your wrists straight. Curl the dumbbells toward your shoulders by flexing only at the elbowsavoid swinging or letting the shoulders roll forward. Briefly squeeze at the top, then lower under control for 23 seconds to full elbow extension. Repeat for the desired reps.', '2025-10-19 20:43:04.7603', '2025-10-19 20:43:04.7603');
INSERT INTO public.exercise_example_translations VALUES ('7b375919-bd98-4273-b799-7e9099146b1f', '4de0744d-0a78-4052-aa1b-e5340959d9fe', 'ru', '      ', '       .    ( ) ,    ,  .  ,           .   ,    23    .     .', '2025-10-19 20:43:04.7603', '2025-10-19 20:43:04.7603');
INSERT INTO public.exercise_example_translations VALUES ('b5e066cf-9c08-4d37-86c4-67bd052d7722', 'c2059aab-d7b5-4532-a8a7-ad15a4054b33', 'en', 'Standing High to Low Cable Fly', 'Set pulleys high on a dual-cable station, attach D-handles, and take a stable split stance. With a slight fixed elbow bend and scapulae retracted/depressed, sweep the arms down and in toward the hips to bias the lower chest; return under control to keep constant cable tension. Avoid turning it into a press (no elbow extension).', '2025-10-19 20:46:24.946866', '2025-10-19 20:46:24.946866');
INSERT INTO public.exercise_example_translations VALUES ('1e6e9965-b9e4-48d3-b300-9d423204d41d', 'c2059aab-d7b5-4532-a8a7-ad15a4054b33', 'ua', '     ', '           .        -           ,      .   ,    .      (  ),   ,  ,      .', '2025-10-19 20:46:24.946866', '2025-10-19 20:46:24.946866');
INSERT INTO public.exercise_example_translations VALUES ('eb25c7e7-7512-4fc5-a8ea-bebb81ec3b82', '46b1efa3-a4f8-4492-a81c-9e48c650dd3d', 'en', 'Toes In Smith Machine Calf Raise', 'Smith machine standing calf raise with toes internally rotated (~1530). Place a step/block under the bar for more ROM; set the bar across the upper traps, balls of the feet on the edge, heels hanging. Unlock the hooks, keep knees softly extended and hips stacked over ankles. Plantarflex at the ankles to rise; pause 12 s at the top; lower under control to a comfortable stretch without letting heels rest. Move only at the ankles (no knee bend), maintain steady tempo, avoid bouncing. Toes-in may bias the lateral gastrocnemius, but evidence is mixed.', '2025-11-23 13:00:08.441338', '2025-11-23 13:00:08.441338');
INSERT INTO public.exercise_example_translations VALUES ('39747961-7eb4-4c58-91c7-e6b73607c860', 'c2059aab-d7b5-4532-a8a7-ad15a4054b33', 'ru', '     ', '           .        -            ,     .  ,    .      (  ),   ,  ,      .', '2025-10-19 20:46:24.946866', '2025-10-19 20:46:24.946866');
INSERT INTO public.exercise_example_translations VALUES ('83b96d44-7da5-48fb-9b88-f2c1eb5d7843', 'f467d244-5568-40f6-bd7a-b3bdcad82398', 'en', 'Standing High to Low Cable Fly', 'Set the pulleys high on a dual-cable station and attach D-handles. Take a stable split stance, brace, and keep a slight fixed elbow bend with the scapulae retracted/depressed. Sweep the arms down and in toward the hips to bias the lower chest; pause, then return along the same arc under control. Avoid elbow extension so it stays a fly, not a press.', '2025-10-19 20:47:51.766722', '2025-10-19 20:47:51.766722');
