INSERT INTO public.exercise_example_translations VALUES ('fab3eb94-f03e-4698-9d9e-c73da93224de', 'b720265e-a3ce-48d3-8e8e-87e05c07b8a3', 'en', 'Standing Low to High Cable Fly', 'Set the pulleys at the lowest setting on a dual-cable station and attach D-handles. Take a stable split stance, brace the core, keep a slight fixed elbow bend, and sweep the arms up and in toward upper-chest level; pause, then return along the same arc under control. Maintain scapular retraction/depression and avoid elbow extension so it remains a fly, not a press.', '2025-10-19 20:49:07.638704', '2025-10-19 20:49:07.638704');
