INSERT INTO public.exercise_example_translations VALUES ('7add3c46-c238-4a24-952e-becfe83e9d16', 'ad98534e-b2d9-4fef-9983-578ef12b28f7', 'en', 'Stiff Leg Deadlift', 'Position the bar over mid-foot (shoelaces) in a hip-width stance. Hinge by pushing the hips back with minimal knee bend (515) and grasp the bar shoulder-width, double-overhand. Brace, keep a neutral spine, set the lats, and keep shins nearly vertical as the bar tracks straight over mid-foot. Extend the hips to stand tall without hyperextending the lumbar spine. Reverse by pushing the hips back and lowering until you feel strong hamstring tension or plates reach mid-shinno lumbar rounding. Keep the bar close, control the descent, re-brace, and repeat.', '2025-10-19 20:50:17.380984', '2025-10-19 20:50:17.380984');
