INSERT INTO public.exercise_example_translations VALUES ('6d578b5c-65ed-4437-a6c2-3287152b10f6', 'ad76d69c-5e90-4643-b507-9e9226d8b5cd', 'en', 'Trap Bar Shrug', 'Stand inside the trap bar with feet hip-width and a neutral grip. Brace the core, keep arms straight, and elevate the shoulders straight up toward the ears (no rolling). Pause 12 s at the top, then lower under control to a full stretch while keeping the neck neutral and elbows extended.', '2025-10-19 21:09:34.398282', '2025-10-19 21:09:34.398282');
