INSERT INTO public.exercise_example_translations VALUES ('cbcfa55a-7b2c-43b1-8378-fa886d189f34', 'f4041256-a9ac-430d-b611-d8a957e2aeb0', 'en', 'Straight Arm Lat Pulldown', 'Attach a straight bar to a high cable and stand tall with a slight hip hinge. Grip the bar pronated at shoulder width. Keep the elbows softly bent and fixed (no elbow flexion). Initiate by depressing the shoulder blades, then extend the shoulders to sweep the bar in an arc down to your thighs. Pause, keep ribs down, and return overhead under control without shrugging or extending the lower back.', '2025-10-19 20:51:52.125741', '2025-10-19 20:51:52.125741');
INSERT INTO public.exercise_example_translations VALUES ('ab90f3c2-4b86-4549-b00f-ddaa64698474', 'f4041256-a9ac-430d-b611-d8a957e2aeb0', 'ua', '    ', '       ,   -.      .      ( /).    ,   ,      .  ,         ,        .', '2025-10-19 20:51:52.125741', '2025-10-19 20:51:52.125741');
INSERT INTO public.exercise_example_translations VALUES ('c1127138-1f53-41eb-97c5-bec432ef45f3', '676f21e5-7b5a-4c11-a505-4545822673de', 'en', 'Trap Bar Romanian Deadlift', 'Stand inside the trap bar with a hip-width stance and neutral grip. Deadlift to the top (hips/knees locked). Brace, keep a neutral spine and soft knees, then push the hips back to hinge while keeping the handles close and shins nearly vertical. Lower to just below knee height or until strong hamstring tensionno lumbar rounding. Keep lats tight, drive through the whole foot, extend the hips by squeezing the glutes to return to the start without hyperextending. Control the descent and repeat.', '2025-10-19 21:08:22.051063', '2025-10-19 21:08:22.051063');
INSERT INTO public.exercise_example_translations VALUES ('aff63483-f23f-4693-b4f5-a910967d490f', 'f4041256-a9ac-430d-b611-d8a957e2aeb0', 'ru', '    ', '       ,   -.      .      ( /).    ,   ,       .  ,        ,        .', '2025-10-19 20:51:52.125741', '2025-10-19 20:51:52.125741');
INSERT INTO public.exercise_example_translations VALUES ('1e34c373-c52e-4df5-a56a-fa295461e815', '89ffca84-73f0-4a69-871f-9d9c96521a05', 'en', 'Toes Out Smith Machine Calf Raise', 'Smith machine standing calf raise with toes externally rotated (~1530). Place a step/block under the bar for more ROM; set the bar across the upper traps, balls of the feet on the edge, heels hanging. Unlock the hooks, keep knees softly extended and hips stacked over ankles. Plantarflex to rise; pause 12 s at the top; lower under control to a comfortable stretch without letting heels rest. Move at the ankles only (no knee bend), maintain steady tempo, avoid bouncing. Toes-out may bias the medial gastrocnemius, though this is debated and individual.', '2025-10-19 21:06:01.799916', '2025-10-19 21:06:01.799916');
INSERT INTO public.exercise_example_translations VALUES ('2bc8c6ba-a1f6-4867-8a13-eacd2a943a7a', 'c18b086c-b0c3-4d1c-a6a3-2653e36c5dff', 'en', 'Straight Leg Deadlift', 'Set the bar on the rack just below hip height and load your plates. Stand shoulder-width and grasp the bar with a double overhand grip. Brace, keep a neutral spine and a slight (soft) knee bend, and hinge by pushing the hips back while keeping the bar over midfoot and close to your legs (shins nearly vertical). Lower until the bar is just below the kneecap without rounding. Keep lats tight, drive through the whole foot, and extend the hips to stand tall by squeezing the glutesavoid hyperextending the lower back. Control the descent; maintain the same knee angle throughout, and repeat.', '2025-10-19 20:54:45.501226', '2025-10-19 20:54:45.501226');
INSERT INTO public.exercise_example_translations VALUES ('2e8b933e-2155-4999-923d-7dcc156ff79f', '8508cffc-1df6-4db2-9447-3bafd74a1325', 'ru', '   ', '    ,   .       (  ),  ,    ,  .              ;     ,      ,  .   ,     .     .', '2025-11-18 17:50:09.321444', '2025-11-18 17:50:09.321444');
