INSERT INTO public.exercise_example_translations VALUES ('206d402a-c78a-4714-9b1d-ea7ae07e9808', 'ca38bcba-658f-4c7a-be54-b2c3f845fbe0', 'en', 'Sumo Deadlift', 'Set a wide (sumo) stance with toes turned out and the bar over mid-foot. Grip the bar shoulder-width with a double overhand inside the knees. Brace, keep a neutral spine, push the knees out, and wedge the hips toward the bar with lats tight. Drive the floor away as you extend the knees and hips, keeping the bar close on a near-vertical path. Stand tall to lock out by squeezing the glutes (no lumbar hyperextension), then hinge back to lower under control.', '2025-10-19 20:55:59.717384', '2025-10-19 20:55:59.717384');
