INSERT INTO public.exercise_example_translations VALUES ('18b28685-6fac-4ede-af14-226f9e535f8d', 'db9ff44c-2e27-42df-8f6a-1b64429999e1', 'en', 'Chest Dip', 'Lean your torso slightly forward (1030), keep shoulders depressed and scapulae retracted. Lower under control until shoulders are just below elbows or a comfortable chest stretch, elbows tracking ~3045 from the torso. Drive up by pressing through the palms and squeezing the chest; avoid shrugging and excessive lockout. Brace the core and master bodyweight before adding load.', '2025-11-18 17:59:47.283604', '2025-11-18 17:59:47.283604');
