INSERT INTO public.exercise_example_translations VALUES ('e37b88ae-5901-422c-af74-97f16e1d20a6', '379d64cd-24bf-4a81-9b97-936c9a088e17', 'en', 'Trap Bar Deadlift', 'Stand inside the trap bar with a hip-width stance and grab the neutral handles. Brace your core, set a neutral spine and pelvis, and pull the slack out of the bar. Find mid-foot pressure with chest up and lats tight. Drive the floor away by extending knees and hips together, keeping the load centered over the foot. Stand tall without overextending the lower back, then return the bar under control by hinging at the hips and bending the knees. Reset your brace and repeat.', '2025-10-19 21:07:08.793125', '2025-10-19 21:07:08.793125');
