INSERT INTO public.exercise_example_translations VALUES ('b9d4b2d3-d3d3-494b-99f4-2314da7928da', 'cfb2d83a-b3dc-44e9-ab08-53f9269752d6', 'en', 'Concentration Curl', 'Sit tall on a flat bench and hinge forward slightly. Plant feet, then wedge the working elbow against the inside of the same-side thigh near the knee. Hold a dumbbell with a supinated grip, wrist neutral. Keep torso still, shoulder packed, and elbow pinned. Curl the dumbbell toward the shoulder, squeeze the biceps at the top, then lower under control to a near-full stretch without letting the elbow slide. Repeat for both sides.', '2025-11-18 22:02:55.73752', '2025-11-18 22:02:55.73752');
