INSERT INTO public.exercise_example_translations VALUES ('84b49df9-eb91-4999-ba4f-5a80e9d9c2ea', 'da809d98-950b-4ca0-a71b-c67d21fd66da', 'en', 'Seated Dumbbell Curl', 'Sit tall on a flat bench with feet planted and a dumbbell in each hand, palms facing up (supinated). Keep elbows tucked to your sides, chest up, and wrists neutral. Curl both dumbbells by flexing only at the elbowsavoid swinging or letting the shoulders roll forward. Squeeze at the top, then lower under control for 23 seconds to full elbow extension. Repeat for the desired reps.', '2025-11-26 10:45:04.735684', '2025-11-26 10:45:04.735684');
