INSERT INTO public.exercise_example_translations VALUES ('c4f13730-7737-47fa-90e5-21961606477a', '21e7460d-aa00-448b-8c82-994a73e0164c', 'en', 'Dumbbell Tate Press', 'Sit on a flat bench with a pair of dumbbells. Lie back keeping the weights close to your chest, then press them to near lockout.
INSERT INTO public.exercise_example_translations VALUES ('adb0c240-3e0b-4c7c-b41d-dd96ac121c4b', 'e84c6031-9d71-41a1-ae2c-6c9901ea1d6b', 'en', 'Wide Grip Lat Pulldown', 'Attach a wide-grip bar to the lat pulldown machine and sit tall with feet planted. Grasp the bar with a pronated (overhand) grip wider than shoulder width. Brace, hinge slightly at the hips without leaning back, depress the shoulder blades, then drive the elbows down and out to pull the bar to the upper chest (not behind the neck). Pause and squeeze, then return overhead under control without shrugging or swinging.', '2025-10-19 21:17:50.741811', '2025-10-19 21:17:50.741811');
