INSERT INTO public.exercise_example_translations VALUES ('532ffce7-5ea9-4ab0-8c6b-e73e1fceb0b8', '89f423d0-315f-4d93-b346-dcb468a97045', 'en', 'Zottman Curl', 'Stand with feet shoulder-width apart holding dumbbells at your sides. Using a supinated (palms up) grip, keep elbows tucked and curl the dumbbells toward your shoulders without swinging. At the top, rotate to a pronated (palms down) position and lower the weights slowly under control. Re-supinate at the bottom and repeat for the desired reps.', '2025-10-19 21:23:01.897753', '2025-10-19 21:23:01.897753');
INSERT INTO public.exercise_example_translations VALUES ('7807f087-d362-43e9-83db-c3033be4a6cc', '8508cffc-1df6-4db2-9447-3bafd74a1325', 'en', 'Seated Hammer Curl', 'Sit tall on a flat bench with feet planted. Hold dumbbells at your sides with a neutral (thumbs-up) grip, wrists straight, elbows tucked to your ribs, and torso braced. Curl the dumbbells without swinging or letting the elbows drift forward until you reach comfortable elbow flexion; pause and squeeze, then lower under control to full extension while keeping tension. Inhale before lifting, exhale near the top. Repeat for reps.', '2025-11-18 17:50:09.321444', '2025-11-18 17:50:09.321444');
