INSERT INTO public.exercise_example_translations VALUES ('133d07c3-67d1-4204-9317-fb284d370b7d', 'ec09f8c7-04cf-4219-8033-3dd17ea5c1d9', 'en', 'Incline Dumbbell Flys', 'Set an adjustable bench to ~3045. With dumbbells held above the shoulders and a soft elbow bend, retract/depress the scapulae and lower in a wide arc until you feel a chest stretch (avoid overstretching the shoulder). Hug the arms back together on the same arc, squeezing the upper chest at the top. Keep wrists neutral, elbows slightly flexed throughout, and dont let the shoulders roll forward.', '2025-11-18 18:58:51.672782', '2025-11-18 18:58:51.672782');
