INSERT INTO public.exercise_example_translations VALUES ('e37d9d4c-bdd2-499a-9b6f-a8344257c810', '3edb750e-4725-4338-a079-d48dc8797917', 'en', 'Decline Dumbbell Flys', 'Set a decline bench (1530). With a slight fixed elbow bend, lower the dumbbells in a wide arc until a stretch in the lower chest, then bring them together over the chest without turning it into a press. Keep scapulae retracted/depressed and control the eccentric; stop range if shoulder discomfort occurs.', '2025-11-18 19:46:08.929623', '2025-11-18 19:46:08.929623');
