INSERT INTO public.exercise_example_translations VALUES ('d274e37b-0e85-43b7-8021-a7aa09255a98', '548b3de6-0980-4795-ab86-763c20dbc325', 'en', 'Dumbbell Bench Press', 'Flat dumbbell press emphasizing the pectorals with higher stabilizer demand than a barbell. 5-point setup (feet, glutes, upper back, head), scapulae retracted/depressed, neutral wrists. Lower to around mid-sternum with elbows ~4570; press in a slight arc up and back over the shoulders. Control tempo; avoid bouncing or excessive elbow flare.', '2025-11-18 22:29:08.177313', '2025-11-18 22:29:08.177313');
