INSERT INTO public.exercise_example_translations VALUES ('7ae13031-1b1b-4816-989f-dd5e20941f24', 'a8f9abc7-4515-4f5e-a4f5-095b1b17b9e1', 'en', 'Hip Adduction Machine', 'Set up seated upright with your back against the pad, spine neutral, and pads resting on the inner thighs just above the knees. Grip the handles and brace your core. Exhale and adduct the hips by squeezing the pads together without leaning back or rocking the pelvis. Pause briefly when the pads meet, then return under control to a comfortable stretch. Keep knees tracking with toes and avoid bouncing. Repeat for the desired reps.', '2025-11-19 11:44:01.741463', '2025-11-19 11:44:01.741463');
INSERT INTO public.exercise_example_translations VALUES ('6bd86cfd-45e2-49d4-9947-7716ae94580e', '3d0c8e76-37a9-4f4c-84fa-47a6a07aaacc', 'ua', '       ', '          .    ,   .      /  ,   ~45.          ,   ,       .', '2025-11-20 19:50:48.735977', '2025-11-20 19:50:48.735977');
