INSERT INTO public.exercise_example_translations VALUES ('2af3ba87-1674-441b-a69f-832b9be93556', '2f49a8e8-6f42-422c-aa6f-c23e215620e2', 'en', 'Decline Sit-Up', 'Set the decline bench to ~3045. Secure your legs under the pads and lie back. Cross your arms over your chest (or lightly touch your templesdo not pull on the neck). Start with a slight posterior pelvic tilt so the low back is gently flattened and shoulder blades hover off the pad. Exhale as you curl the ribcage toward the pelvis until the torso is vertical; avoid yanking with the hip flexors. Pause 12 s at the top, then lower under control without letting your back touch the bench. Keep the tempo slow and the range of motion pain-free. Optional: add a small twist for more oblique emphasis or hug a plate/dumbbell for added load.', '2025-11-20 23:07:20.815036', '2025-11-20 23:07:20.815036');
INSERT INTO public.exercise_example_translations VALUES ('2135786a-4fe5-4672-8c72-41713f279fa8', 'a8f9abc7-4515-4f5e-a4f5-095b1b17b9e1', 'ru', '    ', ' ,    ,  ;         .      .    ,        .  ,   ,      .     ,   .    .', '2025-11-19 11:44:01.741463', '2025-11-19 11:44:01.741463');
INSERT INTO public.exercise_example_translations VALUES ('df59c42b-ab0d-460b-942b-9386f1874555', '9e348a26-e5d0-4ee0-b3e6-fe58563ac698', 'en', 'Hack Squat Calf Raise', 'Machine calf raise performed on a hack squat. Setup: stand on the foot plate (toes on edge or a block for more ROM), chest against the pad, shoulders under pads, feet hip-width, neutral pelvis. Unlock the safety, keep knees softly extended (no hyperextension). Raise heels by plantarflexing only at the ankles; pause 12 s at peak, then lower under control without letting heels fully rest. Maintain straight line from hips to shoulders and steady tempo throughout the set.', '2025-11-20 16:47:12.722701', '2025-11-20 16:47:12.722701');
INSERT INTO public.exercise_example_translations VALUES ('506d973f-192a-41a7-baa7-2365cf6b76a2', '9e348a26-e5d0-4ee0-b3e6-fe58563ac698', 'ua', '    -', '   (        ),     ,   ,    ,  .  ,    ( ).  ,       ;  12       ,     .            .', '2025-11-20 16:47:12.722701', '2025-11-20 16:47:12.722701');
