INSERT INTO public.exercise_example_translations VALUES ('6e0b1928-d340-4600-a0b6-9fac281824f8', 'c5901a9a-580c-411b-85bd-2ec738123e14', 'en', 'Hanging Knee Raise', 'Hang from a pull-up bar with a shoulder-width grip (widen if your feet touch the floor). Pack the shoulders (scapular depression), brace, and keep the legs together. Raise the knees by flexing the hips and posteriorly tilting the pelvis to bring the knees toward the chest; avoid swinging. Pause 12 s, then lower under control to a full stretch. Keep the torso still and the tempo slow throughout. Progression: hold a dumbbell between the feet when strong enough.', '2025-11-20 16:50:46.550602', '2025-11-20 16:50:46.550602');
INSERT INTO public.exercise_example_translations VALUES ('0d184594-bf8e-4069-a652-493d8c945176', 'c5901a9a-580c-411b-85bd-2ec738123e14', 'ua', '   ', '       (      ).  ,      .  ,         ,    ;  .  12        .  ,  . :    ,   .', '2025-11-20 16:50:46.550602', '2025-11-20 16:50:46.550602');
