INSERT INTO public.exercise_example_translations VALUES ('7b2ea820-15d0-4b9b-9f6f-0a1bf1a7de3a', '3a41edcb-2c19-4d06-9585-8fe745aba723', 'en', 'Machine Lateral Raise', 'Select the desired weight on the lateral raise machine. Adjust the seat so the pads line up with mid-forearm/elbow height. Sit tall with feet flat, eyes forward. Secure your arms against the pads and set a slight bend in the elbows. Keeping the torso still and shoulders down, raise the arms out to the sides in a smooth arc until the forearms are just above parallel. Pause and contract the delts, then lower under control along the same path. Avoid shrugging or swinging; move only at the shoulders.', '2025-11-20 19:35:07.880903', '2025-11-20 19:35:07.880903');
