INSERT INTO public.exercise_example_translations VALUES ('c45e794c-38e9-4b1a-b717-4076062a8281', 'cfd086be-f452-4f1d-b0cc-3988d677a8b4', 'en', 'Dumbbell Hammer Preacher Curl', 'Select a dumbbell and sit with your chest supported against the preacher bench. Pin your upper arm to the pad and use a neutral (thumbs-up, palms facing each other) grip. From full elbow extension, lower the weight under control, keeping the wrist straight and the shoulder still. When the biceps/brachialis are fully lengthened, curl back up without letting the elbow lift off the pad; pause and squeeze, then lower to the start. Repeat for both sides.', '2025-11-20 19:44:53.579032', '2025-11-20 19:44:53.579032');
