INSERT INTO public.exercise_example_translations VALUES ('43983de2-3e14-4eba-895c-0bc9065db778', '3d0c8e76-37a9-4f4c-84fa-47a6a07aaacc', 'en', 'Decline Bench Press', 'Set up on a decline bench with a secure foot hold. Retract and depress the scapulae, take a medium grip, and lower the bar toward the lower chest/upper abdomen with elbows at ~45. Touch lightly and press to full elbow extension while keeping the ribcage stacked and glutes in contact with the bench.', '2025-11-20 19:50:48.735977', '2025-11-20 19:50:48.735977');
