INSERT INTO public.exercise_example_translations VALUES ('518a5632-2f62-44d9-b6bf-93f0809c7d3a', 'e68781f2-7021-4907-af54-de18b80d181a', 'en', 'Decline Push Up', 'Place your feet on a flat bench or box (body angled downward), hands slightly wider than shoulder width. Brace the core, keep a straight line from head to heels, retract/depress the scapulae, and lower the chest between the hands with elbows ~45. Press back up, finishing with gentle scapular protraction. Maintain controlled tempo and neutral neck.', '2025-11-20 23:10:32.635662', '2025-11-20 23:10:32.635662');
