INSERT INTO public.exercise_example_translations VALUES ('4d438814-ac61-4dfd-818f-f4ac24664e59', '16ba69dc-e99d-4a71-bbcb-0f3ce096a9d9', 'en', 'Machine Shoulder Press', 'Adjust the seat so the handles are at or just below shoulder height. Sit tall with your back and head supported, feet planted. Grip the handles (neutral or pronated), brace your core, keep ribs down, and avoid excessive lumbar arch. Press overhead in the scapular plane until the elbows extend without shrugging; pause, then lower under control to just above shoulder level and repeat.', '2025-11-20 23:14:26.040947', '2025-11-20 23:14:26.040947');
