INSERT INTO public.exercise_example_translations VALUES ('275f4618-cf40-4ce1-ba2f-fbdf2038404b', '506d1cc7-529a-42af-b5bf-4c4d0a9aa409', 'en', 'Smith Machine Shoulder Press', 'Set an adjustable bench to upright (90) inside the Smith machine and position the bar around eye level. Sit with your back supported, feet planted, and take a pronated grip slightly wider than shoulder-width. Brace, keep ribs down and wrists stacked. Press overhead in the scapular plane without shrugging; finish with elbows extended but not locked. Lower under control to about chinupper-chest level, touch softly, and repeat.', '2025-11-20 23:19:34.314592', '2025-11-20 23:19:34.314592');
INSERT INTO public.exercise_example_translations VALUES ('9468d212-26df-45e6-9154-85cfcf83d054', '1f8abb63-8024-46ca-ac1e-2574a839eed6', 'en', 'Push Press', 'Set the bar in a rack at just below shoulder height and load plates. Take a shoulder-width stance, grip the bar just outside shoulder width (pronated), elbows slightly in front of the bar, and unrack with a neutral spine. Take two steps back, inhale and brace (ribs down, glutes tight). Dip 510% at knees and hips with a vertical torso and heels down, then drive hard through the legs and press the bar in a straight line to lockout overhead. Finish with biceps near ears and no lower-back overextension. Control the bar back to the shoulders, re-brace, and repeat for reps.', '2025-11-21 12:59:23.858674', '2025-11-21 12:59:23.858674');
