INSERT INTO public.exercise_example_translations VALUES ('7c04b3dd-8398-4383-829d-b1b91d59deb6', '3b828d2f-797f-4a45-9d1d-1d3efe38fb54', 'ua', '     ()', '    .      (      ).    ,  ,       .        ~90    (  ,  ),       .  ,  ,      .     .', '2025-11-20 23:24:49.200931', '2025-11-20 23:24:49.200931');
