INSERT INTO public.exercise_example_translations VALUES ('c98b9cd8-3c42-4bbb-8fcc-b293e9f61810', '6da53baf-d357-4392-927f-7da1bf7449dc', 'en', 'Incline Bench Barbell Row', 'Set an incline bench to ~30 and lie prone with the chest supported. Take a wide overhand (pronated) grip, keep a neutral head and ribs down, depress/retract the shoulder blades, and row the bar toward the lower chest/upper ribs leading with the elbows. Pause and squeeze between the shoulder blades, then lower under control to a full stretch. Avoid shrugging or jerking; the chest support minimizes lower-back strain.', '2025-11-21 12:22:46.39912', '2025-11-21 12:22:46.39912');
