INSERT INTO public.exercise_example_translations VALUES ('6b03d563-2021-4198-915c-ef6cdd96763d', 'ff20bd08-57ae-465f-aa54-d1ba0f7862a9', 'en', 'Push Up', 'Set up in a straight-line plank (wrists under shoulders, ribs down, glutes/braced). Lower the chest between the hands keeping elbows ~3045 from the torso and forearms vertical. Maintain neutral neck and packed shoulders; avoid sagging hips. Press the floor away to full lockout with slight protraction at the top. Breathe behind the brace; move in control.', '2025-11-21 14:29:04.729186', '2025-11-21 14:29:04.729186');
