INSERT INTO public.exercise_example_translations VALUES ('662a82f3-7f8d-4d10-85d8-c8d9ac438588', '21370a0a-b01b-4e32-8f43-8648a54cd35c', 'en', 'Pec Dec (Butterfly)', 'Adjust the seat so the handles align with mid-chest. Retract/depress the scapulae, keep a slight bend in the elbows, and bring the forearms together on a wide arc to meet just in front of the sternum. Pause and squeeze the chest, then control the eccentric to a comfortable stretch. Avoid elbow flexion/extension and shrugging to keep the load on the pecs. Primarily targets the sternocostal pec fibers with assistance from the clavicular head and anterior deltoid.', '2025-11-22 09:51:07.241352', '2025-11-22 09:51:07.241352');
INSERT INTO public.exercise_example_translations VALUES ('2cef1698-477e-4edc-bc06-3ab627a4dab6', '21370a0a-b01b-4e32-8f43-8648a54cd35c', 'ua', '    (-/)', '  ,       .    ,            ,     .   ,       .  /     ,     .    -    ;      .', '2025-11-22 09:51:07.241352', '2025-11-22 09:51:07.241352');
