INSERT INTO public.exercise_example_translations VALUES ('2dc13913-dcce-4c01-8971-3cc0545e9352', 'f2cf498f-d991-4b85-b08e-58c5f9ff563e', 'en', 'Hanging Leg Raise', 'The hanging leg raise builds the anterior core. Hang from a pull-up bar with a shoulder-width grip, depress the shoulders, and brace the midsection. With legs straight, posteriorly tilt the pelvis (tuck the tailbone) and raise the legs as one unit until they reach at least hip heighthigher if control allows. Pause briefly, then lower under control without swinging. Keep the torso still, ribs down, and avoid using momentum. Advanced lifters can add load by holding a dumbbell between the feet.', '2025-11-22 09:58:31.740071', '2025-11-22 09:58:31.740071');
