INSERT INTO public.exercise_example_translations VALUES ('a78d1edd-206e-48e1-ad7d-7b251ad33955', '8324ae75-08e9-48de-a00b-55d229085712', 'en', 'Standing Hammer Curl', 'Stand tall with feet hip-width, core braced. Hold dumbbells at your sides with a neutral grip (palms facing in), shoulders down and elbows tucked. Without swinging or leaning back, curl by flexing the elbows until forearms are near vertical; keep wrists neutral throughout. Squeeze briefly at the top, then lower under control to full extension while maintaining tension. Repeat for reps.', '2025-11-22 10:56:19.557104', '2025-11-22 10:56:19.557104');
INSERT INTO public.exercise_example_translations VALUES ('f39eacfe-2be5-4dea-a492-505d6ee4956c', '8324ae75-08e9-48de-a00b-55d229085712', 'ua', '     ', '    ,  .       (   ),  ,  .         ,  ,      ;  .   ,       ,  .    .', '2025-11-22 10:56:19.557104', '2025-11-22 10:56:19.557104');
