INSERT INTO public.exercise_example_translations VALUES ('40313a7e-7cb0-4098-a72a-6911b551b713', 'af39600b-6fc5-435a-a5f8-a1d0a9994030', 'en', 'Incline Bench Dumbbell Curl', 'Set an adjustable bench to ~45. Sit at the top end and brace the back of your upper arm on the pad. Hold a dumbbell with an underhand (supinated) grip, arm fully extended without letting the shoulder roll forward. Keep the elbow pinned and the wrist neutral. Curl by flexing the elbow only until the forearm is near vertical, squeeze briefly, then lower under control to full extension. Maintain steady torso contact with the bench and avoid shrugging or swinging. Repeat for reps, then switch arms.', '2025-11-22 12:02:59.108573', '2025-11-22 12:02:59.108573');
INSERT INTO public.exercise_example_translations VALUES ('fba4ad96-4f07-4a42-abe2-560dea68505d', 'af39600b-6fc5-435a-a5f8-a1d0a9994030', 'ua', '    ', '     45.             .    ,   ,     .  ,  .  ,    ,      ;          .      ,     .       .', '2025-11-22 12:02:59.108573', '2025-11-22 12:02:59.108573');
