INSERT INTO public.exercise_example_translations VALUES ('db61540e-98c7-4f6a-a29f-fd7e6d034ffc', '101f365e-5c84-438a-84b4-c8e798bd0aff', 'en', 'Incline Bench Hammer Curl', 'Set an adjustable bench to ~45. Sit at the top end and hold a dumbbell with a neutral (hammer) grip. Brace the back of your upper arm on the pad and let the arm fully extend without letting the shoulder drift. Keep the wrist neutral and the elbow pinned to the pad. Curl the dumbbell by flexing the elbow only; do not supinate or swing. Squeeze briefly at the top, then lower under control to full extension. Repeat for reps, then switch arms.', '2025-11-22 12:13:21.60577', '2025-11-22 12:13:21.60577');
INSERT INTO public.exercise_example_translations VALUES ('c8cfaa52-f036-4b9b-8391-3b6f4de2724d', '101f365e-5c84-438a-84b4-c8e798bd0aff', 'ua', '      ', '    45.         () .            ,     .  ,    .       ,     .      ,       .       .', '2025-11-22 12:13:21.60577', '2025-11-22 12:13:21.60577');
