INSERT INTO public.exercise_example_translations VALUES ('9409f73c-e171-4714-bbe0-6640d55e5cc6', '4f1c3655-21e7-4225-a39e-944774f59f76', 'en', 'Wide Grip Standing Barbell Curl', 'Stand tall with feet shoulder-width apart. Grasp a barbell with a wide underhand (supinated) grip slightly wider than shoulder width. Pin your elbows to your sides, keep wrists neutral, shoulders down and back, and torso braced. Curl the bar toward your shoulders until full elbow flexion without letting the elbows drift forward or the body sway; pause briefly, then lower under control to full extension. Inhale before initiating the curl and exhale near the top. Repeat for reps.', '2025-11-22 14:04:19.600568', '2025-11-22 14:04:19.600568');
