INSERT INTO public.exercise_example_translations VALUES ('05c9031e-9afe-4af9-9581-ad292f5b01e5', 'a9545ccb-3ec7-4646-95c9-f3a708d0d968', 'en', 'Two-Arm Low Pulley Cable Curl', 'Use a cable machine with two low pulleys and single handles. Stand centered between the stacks and take a small step forward to pre-tension the cables; arms extended slightly behind the body with a supinated grip. Brace, keep elbows pinned by your sides and shoulders still, then curl the handles toward your shoulders. Squeeze at the top without letting the elbows drift forward, and lower under control to full extension. Repeat for the desired reps.', '2025-11-22 14:21:06.628701', '2025-11-22 14:21:06.628701');
