INSERT INTO public.exercise_example_translations VALUES ('03a2204a-b99a-45b2-a456-893215b8e594', 'de4e9652-b068-4558-9fd3-38d45e5aa0d9', 'en', 'Toes In Seated Calf Raise', 'Seated machine calf raise with toes internally rotated (~1530). Sit with knees ~90 under the pad, balls of the feet on the platform edge (heels hanging). Extend the ankles to release the safety. Lower under control into dorsiflexion to a comfortable stretch, then plantarflex strongly to the top; pause 12 s and avoid letting the heels rest at the bottom. Keep movement at the ankle only (no knee pumping), use a steady tempo, and drive through the ball of the foot. Toes-in may bias the lateral gastrocnemius; the seated position emphasizes the soleus.', '2025-11-23 11:48:17.443036', '2025-11-23 11:48:17.443036');
