INSERT INTO public.exercise_example_translations VALUES ('5cc3c354-85cc-4834-aeae-c1a7993ed9ce', 'f11c8751-e5ca-413e-b30d-2b387ec14733', 'en', 'Toes Out Seated Calf Raise', 'Seated machine calf raise with toes externally rotated (~1530). Place the balls of the feet on the platform (use a block for more ROM), knees ~90 under the pad, spine neutral. Unlock safety, keep knees softly extended (no knee pumping). Plantarflex the ankles to lift the pad; pause 12 s at the top, then dorsiflex under control without letting heels fully rest. Move through the ball of the foot, keep tempo steady. Toes-out biases the medial gastrocnemius; the seated position emphasizes the soleus.', '2025-11-23 13:12:06.25262', '2025-11-23 13:12:06.25262');
INSERT INTO public.exercise_example_translations VALUES ('a2c05a6c-31b4-4115-bcc3-efba2e68cb82', '5b7d739c-d130-466c-a5ac-9e8b318b77ad', 'en', 'Smith Machine Bench Press', 'Set a flat bench under the Smith bar and position the bar over mid-chest. Retract/depress the scapulae, plant feet, and grip slightly wider than shoulder width. Unrack, lower to the mid-lower chest with elbows tucked ~4560, forearms vertical, then press back to full elbow extension under control. Set safeties to just below chest depth.', '2025-11-25 20:53:08.860137', '2025-11-25 20:53:08.860137');
INSERT INTO public.exercise_example_translations VALUES ('f5a130d2-72ef-4f5b-8752-5c2112384dc5', 'f11c8751-e5ca-413e-b30d-2b387ec14733', 'ua', '    (  )', '     (  ROM  ),     (~1530).    ~90,  .  ,     ( ).      ,  ;  12    .      ,     .    ,   .          ;    .', '2025-11-23 13:12:06.25262', '2025-11-23 13:12:06.25262');
