INSERT INTO public.exercise_example_translations VALUES ('1cbb2697-af9d-48b4-8874-6e61cb7aa691', '7fd82f79-1f5f-4bae-8f2d-b94ecae595d5', 'en', 'Machine Bicep Curl', 'Adjust the seat so your elbows align with the machines pivot and your upper arms rest fully on the pad. Select a load, grasp the handle with a shoulder-width underhand grip, set your shoulders down/back, and keep wrists neutral. Create light pre-tension, then curl without letting the elbows lift or torso shift. Squeeze briefly at the top, and lower under control (23 s) to a full stretch without locking out. Repeat for the desired reps.', '2025-11-23 13:34:03.325265', '2025-11-23 13:34:03.325265');
