INSERT INTO public.exercise_example_translations VALUES ('54250692-f3cf-4036-ae9a-0e99af61b62b', '3a70ce9c-b1f0-43a7-8775-7d3e7c109c5d', 'en', 'Machine Reverse Fly', 'Adjust the seat so the handles align with your mid-delts (about shoulder height). Sit facing the pad with chest supported and feet flat. Grasp the handles with a neutral or pronated grip, keep a slight bend in the elbows, wrists neutral, and avoid shrugging. Initiate by leading with the elbows, moving the upper arms in a wide arc (horizontal abduction) until hands are roughly in line with the shoulders; pause briefly, then return under control without letting the shoulders roll forward.', '2025-11-23 13:39:54.931031', '2025-11-23 13:39:54.931031');
