INSERT INTO public.exercise_example_translations VALUES ('1c8fa353-bf5a-4ec5-b2de-6979e2cde7a2', '5e3c933f-7511-463e-88b1-a139c8276e69', 'en', 'Cross Body Hammer Curl (Pinwheel Curls)', 'Stand tall with dumbbells at your sides in a neutral grip (palms facing in). Brace your core, keep shoulders down, and pin your upper arm to your torso. Curl one dumbbell across the body toward the opposite shoulder/pec with the thumb leading; avoid swinging or rotating the torso. Pause and squeeze at the top, then lower under control to a full stretch. Keep the wrist neutral and the non-working arm still. Alternate sides rep by rep.', '2025-11-23 21:07:39.717403', '2025-11-23 21:07:39.717403');
