INSERT INTO public.exercise_example_translations VALUES ('ade06e47-bab7-4319-8629-72311f0230d0', '90b8d661-a9ef-47e5-8c98-b0599874a972', 'en', 'Seated Behind the Neck Shoulder Press', 'Set the barbell on a rack just below shoulder height and load plates. Place an adjustable bench upright under the bar. Sit, take a pronated grip slightly wider than shoulder width, and unrack with a neutral spine. Inhale, brace, tuck the chin, and lower the bar to the upper traps/back of the neck (only within your available shoulder mobility). Press to lockout while keeping the ribs down and elbows under the bar. Control the descent and repeat for the desired reps.', '2025-11-23 21:49:42.838083', '2025-11-23 21:49:42.838083');
