INSERT INTO public.exercise_example_translations VALUES ('901f4b67-4500-4140-99d0-e5bc45c4233e', '885918a3-5c64-4f15-982e-1b9a91cb3743', 'en', 'Incline Bench Press', 'Incline bench press targets the upper chest (clavicular head) with strong assistance from the anterior deltoids and triceps. Use a 3045 bench angle, retract/scapulae, keep wrists stacked over elbows, and press the bar in a slight arc up and back toward the shoulders. Moderate grip (just outside shoulder width) helps emphasize the upper chest and shoulder stability.', '2025-11-24 16:55:31.235049', '2025-11-24 16:55:31.235049');
INSERT INTO public.exercise_example_translations VALUES ('2325c620-44c2-4d56-be8e-097e1d1dd5ae', '885918a3-5c64-4f15-982e-1b9a91cb3743', 'ua', '     ', '       ( )       .    3045, / ,                .   (    )       .', '2025-11-24 16:55:31.235049', '2025-11-24 16:55:31.235049');
