INSERT INTO public.exercise_example_translations VALUES ('8c3e24ae-c185-4bce-8d38-a4440f3cfa62', '09386394-e4e1-4a6d-adce-d5f5a518485c', 'en', 'Incline Dumbbell Curl', 'Set an incline bench to ~5565. Sit back with your head, upper back, and glutes on the pad; arms hang straight down. Grip the dumbbells supinated, shoulders set, elbows slightly behind the torso. Without swinging or letting the shoulders roll forward, curl the bells toward the shoulders, squeeze the biceps, then lower under control to a near-full stretch. Repeat for reps.', '2025-11-24 21:44:51.79968', '2025-11-24 21:44:51.79968');
INSERT INTO public.exercise_example_translations VALUES ('6a68f704-a47b-4493-8590-36eab61fa532', '6d5dc164-3c35-4719-85f1-5c75558f0125', 'en', 'Wide Grip Cable Curl', 'Attach a straight bar to a low pulley and select the load. Stand tall facing the stack with feet shoulder-width apart. Grasp the straight bar with a supinated grip slightly wider than shoulder width; keep elbows tucked to your sides, wrists neutral, and torso still. Curl the bar toward your shoulders until full elbow flexion, squeeze briefly, then lower under control to full extension without letting the shoulders roll forward. Breathe in before the curl and exhale near the top. Repeat for reps.', '2025-11-28 12:02:55.023736', '2025-11-28 12:02:55.023736');
INSERT INTO public.exercise_example_translations VALUES ('e16d2868-6ba3-4e64-8b5a-0c49195d826d', '09386394-e4e1-4a6d-adce-d5f5a518485c', 'ua', '      ', '    ~5565. ,  ,      ;   .    ,   ,    .          ,   ,        .    .', '2025-11-24 21:44:51.79968', '2025-11-24 21:44:51.79968');
