INSERT INTO public.exercise_example_translations VALUES ('31135b82-f844-480d-a248-ddcd326da151', '9ab8fe00-58de-48c4-942d-b10e8d16f1c1', 'en', 'Seated Arnold Press', 'Set an adjustable bench to 8590. Sit tall with your back supported and feet planted. Clean the dumbbells to shoulder level, starting with palms facing you and elbows slightly forward. Brace, keep ribs down and wrists stacked. Press overhead while rotating the dumbbells to palms-forward; finish with biceps near the ears without shrugging. Lower under control, reversing the rotation to ~90 elbow angle, and repeat.', '2025-11-24 21:56:19.824174', '2025-11-24 21:56:19.824174');
INSERT INTO public.exercise_example_translations VALUES ('905f0bde-036a-4d36-bb06-e07697098e6d', '9ab8fe00-58de-48c4-942d-b10e8d16f1c1', 'ua', '- ', '    8590.  ,   ,   .     ,   ,    .  ,  ,   .  ,       ;       .   ,       ~90,  .', '2025-11-24 21:56:19.824174', '2025-11-24 21:56:19.824174');
INSERT INTO public.exercise_example_translations VALUES ('4fa36f64-7b50-48cc-892e-a097906948b0', 'ac45c513-55f3-437f-a10f-ba3c0763a746', 'en', 'Standing Dumbbell Front Raise', 'Choose a pair of dumbbells with a pronated (overhand) grip and stand shoulder-width. Brace your abs, keep a slight bend in the elbows, and raise the arms straight in front until they reach shoulder height (avoid leaning back or swinging). Pause briefly, then lower under control to the start. Keep ribs down, shoulders relaxed (allow natural upward rotation), and move only at the shoulder. Repeat for the desired reps.', '2025-11-25 21:51:34.492929', '2025-11-25 21:51:34.492929');
INSERT INTO public.exercise_example_translations VALUES ('71b43b3f-165d-4651-b473-c9ab91392146', '9ab8fe00-58de-48c4-942d-b10e8d16f1c1', 'ru', '  ', '    8590.  ,   ,   .    ,    ,    .  ,  ,   .  ,       ;       .  ,       ~90,  .', '2025-11-24 21:56:19.824174', '2025-11-24 21:56:19.824174');
INSERT INTO public.exercise_example_translations VALUES ('a940356f-f4ea-44b3-83e9-81b876302d37', '4035dfef-3cc6-4a15-a97f-c167bd274d02', 'en', 'Seated Barbell Shoulder Press', 'Set a squat rack so the bar is just below shoulder height and place an adjustable bench upright inside the rack. Sit tall with your back supported, feet planted, and take a pronated grip slightly wider than shoulder-width. Brace, keep ribs down and wrists stacked, then lower the bar to around upper chest without excessive arching. Press back up in the scapular plane to full elbow extension without shrugging; pause briefly and lower under control.', '2025-11-24 21:59:56.408482', '2025-11-24 21:59:56.408482');
INSERT INTO public.exercise_example_translations VALUES ('8f3ee5b4-c0de-4a1e-85dc-0bf5c1b527a8', '4035dfef-3cc6-4a15-a97f-c167bd274d02', 'ua', '    ', '  ,       ,       .     ,   .      .  ,  ,   .         ,             .      .', '2025-11-24 21:59:56.408482', '2025-11-24 21:59:56.408482');
