INSERT INTO public.exercise_example_translations VALUES ('b6031a83-de38-4274-91b4-b2bc21de840b', '01dff88c-893b-4410-8d54-1e36013b9fdb', 'en', 'Seated Dumbbell Calf Raise', 'Sit on the end of a flat bench with a step/block under the forefoot and heels hanging off. Place the ends of two dumbbells on the thighs close to the knees (use a towel for comfort). Keep knees bent ~90 and still. Lower the heels under control into a comfortable stretch, then drive up by plantarflexing through the ball of the foot; pause 12 s at the top and avoid bouncing. Do not let the heels touch down between reps; keep the torso braced and the motion at the ankles only.', '2025-11-24 22:13:19.154792', '2025-11-24 22:13:19.154792');
