INSERT INTO public.exercise_example_translations VALUES ('3871045f-f336-434e-af95-aefa491f611e', 'bbfbcfe2-1f56-492e-afa6-75e595b84fde', 'en', 'Standing Barbell Curl', 'Stand tall with feet hip-width, ribs down, glutes and abs braced. Grip a barbell shoulder-width with a supinated grip, arms fully extended, elbows tucked to sides. Without leaning back or swinging, curl the bar by flexing the elbows until forearms are near vertical; squeeze the biceps, then lower under control to full extension while keeping wrists neutral and the bar off the body. Repeat for reps.', '2025-11-24 22:19:11.450047', '2025-11-24 22:19:11.450047');
INSERT INTO public.exercise_example_translations VALUES ('a26fd20a-7b20-434f-8668-4ae78a04154e', '5985d847-0473-444e-8fe0-9da5341ef986', 'en', 'Cable Tricep Extension With V-Bar', 'Attach a V-bar to a high cable. Stand tall with a slight hip hinge and soft knees. Grip the V-bar with a semi-pronated grip, tuck your elbows to your sides, keep the upper arms fixed, shoulders down and back, and brace the core.
