INSERT INTO public.exercise_example_translations VALUES ('3d5bcead-a9d6-4122-a356-36a1268b8481', 'ddc2e877-7197-42fa-ae1e-59706d209774', 'en', 'Standing Dumbbell Curl', 'Stand tall with feet hip-width and core braced. Hold dumbbells at your sides with a supinated grip (palms up), shoulders down and elbows tucked. Without swinging or leaning back, curl by flexing the elbows until forearms are near vertical; keep wrists neutral. Squeeze briefly at the top, then lower under control to full elbow extension while maintaining tension. Repeat for reps.', '2025-11-24 22:26:14.403369', '2025-11-24 22:26:14.403369');
