INSERT INTO public.exercise_example_translations VALUES ('1e623c8b-765f-4acb-8291-02c444a3fb94', 'fff561d6-3738-4360-a110-f93dcb3c8c10', 'en', 'Hammer Strength Bench Press', 'Set the seat so the handles align with mid-chest. Retract and depress the scapulae, keep a slight arch, wrists neutral. Press the independent arms to full elbow extension without shrugging; lower under control to a comfortable chest stretch. Use a steady tempo (e.g., 23 s down), maintain feet planted and ribcage up to bias the pecs. Best used after barbell/dumbbell presses for higher-rep hypertrophy work.', '2025-11-25 19:58:13.799362', '2025-11-25 19:58:13.799362');
