INSERT INTO public.exercise_example_translations VALUES ('70da9725-4935-4e04-bf27-f8178d7eb951', 'f6dd98f1-ad1d-4ea2-ba97-9939ce0fc028', 'en', 'Smith Machine Incline Bench Press', 'Set an adjustable bench to a 1530 incline under the Smith bar so the bar tracks over the upper chest. Retract/depress the scapulae, plant feet, and grip slightly wider than shoulder width. Unrack, lower to the upper chest with elbows tucked ~4560 and forearms vertical, then press to full elbow extension under control. Set safeties just below chest depth.', '2025-11-25 20:58:10.504738', '2025-11-25 20:58:10.504738');
INSERT INTO public.exercise_example_translations VALUES ('319cf72b-7ac8-44d2-bb01-72c7e17871c8', 'f6dd98f1-ad1d-4ea2-ba97-9939ce0fc028', 'ua', '      ', '     1530    ,       . / ,   ,     .   ,         ~4560   ,        .       .', '2025-11-25 20:58:10.504738', '2025-11-25 20:58:10.504738');
INSERT INTO public.exercise_example_translations VALUES ('7cb33536-d972-4501-ab65-6c86d10988a1', 'f6dd98f1-ad1d-4ea2-ba97-9939ce0fc028', 'ru', '      ', '     1530    ,       . / ,    ,     .   ,         ~4560   ,        .       .', '2025-11-25 20:58:10.504738', '2025-11-25 20:58:10.504738');
INSERT INTO public.exercise_example_translations VALUES ('aec4b77d-0005-4e9d-acd4-c3715d302582', 'd20646b6-efd1-49fc-8ffa-180461aea5ab', 'en', 'Smith Machine Upright Row', 'Set the Smith machine bar at mid-thigh height and load plates. Stand tall with a shoulder-width stance and take a grip just outside shoulder width. Unrack by rotating the bar off the hooks. Inhale, brace, and lead with the elbows high and wide as you pull the bar up along the body to about upper-chest/shoulder height (stop if shoulder comfort dictates). Keep wrists neutral and torso steady. Pause briefly, then lower the bar under control to full elbow extension and re-rack as needed. Use a slightly wider grip and moderate range to reduce shoulder impingement risk.', '2025-11-25 21:36:24.815143', '2025-11-25 21:36:24.815143');
