INSERT INTO public.exercise_example_translations VALUES ('999aed53-7daf-4703-a67c-dad72a9e83f7', 'afd7f719-5789-48a0-a5d9-77e9cb1669bb', 'en', 'Standing Cable Reverse Fly', 'Set both pulleys to chest height and attach single handles. Stand tall with a slight knee bend, arms extended in front with a soft elbow. Grip the handles (neutral), brace the core, and avoid shrugging. Pull the arms out laterally in a wide arc until hands are in line with the shoulders without over-pinching the shoulder blades; pause, then lower under control to the start and repeat.', '2025-11-25 21:52:33.483666', '2025-11-25 21:52:33.483666');
