INSERT INTO public.exercise_example_translations VALUES ('9b366f20-fcaa-4359-9ae2-ecae6cd94134', 'e1511aa4-1d34-4984-aa54-88f88029a96e', 'en', 'Cable Crossovers (Mid Chest)', 'Set pulleys at roughly shoulder/mid-chest height. Step forward (split stance), depress/retract the scapulae, keep a soft elbow bend, and sweep the hands on a wide arc to meet slightly in front of the sternum. Avoid elbow flexion/extension to minimize triceps; control the eccentric to a comfortable chest stretch. This fly variation emphasizes the mid (sternocostal) pec fibers with some clavicular and anterior deltoid assistance.', '2025-11-25 22:11:58.650079', '2025-11-25 22:11:58.650079');
INSERT INTO public.exercise_example_translations VALUES ('2c15f329-7576-453e-a3d0-268d9dc737ff', 'cebf4622-c0a9-4759-a070-48c7556da67d', 'en', 'Squatting Cable Curl', 'Attach a straight bar to a low pulley. Face the machine and grasp the bar with a shoulder-width underhand grip. Squat down with a neutral spine and chest up, placing the backs of your upper arms (just behind the elbows) on your knees to fix the elbows in place. Keep wrists neutral and curl the bar toward your shoulders until full elbow flexion; squeeze briefly, then lower under control to full extension without letting the arms slide off your knees. Inhale before the curl, exhale near the top. Repeat for reps.', '2025-11-28 10:55:12.405282', '2025-11-28 10:55:12.405282');
INSERT INTO public.exercise_example_translations VALUES ('ee4cdf80-c785-4e4e-a2cd-25507ce3835d', 'e1511aa4-1d34-4984-aa54-88f88029a96e', 'ua', '    ( )', '       .     ,    .          ,     .      ,    ;        .    (-)          .', '2025-11-25 22:11:58.650079', '2025-11-25 22:11:58.650079');
