INSERT INTO public.exercise_example_translations VALUES ('3e390269-9445-4c99-b614-ba85f86cd797', '8a73b841-1d4e-4808-8ed7-58c4931e0e96', 'en', 'Decline Dumbbell Bench Press', 'Set a decline bench to ~1530. Lie back with dumbbells over the lower chest, wrists neutral, and scapulae retracted/depressed. Lower the bells to the lower-pec line with elbows tucked ~45, slight flare acceptable at the bottom. Press back up on a slight arc keeping ribs down and shoulder blades stable. Control the eccentric; avoid excessive shoulder protraction.', '2025-11-26 09:50:06.242348', '2025-11-26 09:50:06.242348');
