INSERT INTO public.exercise_example_translations VALUES ('1dbfda41-9740-4dd6-a772-749b27357098', '48191b99-06fa-4218-b61b-c9b9abd73278', 'en', 'Seated Dumbbell Press', 'Set an adjustable bench to upright (8090). Sit tall with feet planted and back supported. Clean the dumbbells to shoulder level and rotate to a pronated grip with wrists stacked over elbows. Inhale and brace, then press overhead in the scapular plane until biceps are near the ears without shrugging or arching the lower back. Lower under control to about chin/upper-chest level and repeat.', '2025-11-26 10:06:23.623891', '2025-11-26 10:06:23.623891');
INSERT INTO public.exercise_example_translations VALUES ('32827718-9c7a-47aa-8228-984dabbe8a54', '77aa5752-a586-4dfe-b69d-4da16fff0b79', 'en', 'Seated Dumbbell Lateral Raise', 'Sit on the edge of a flat bench with feet planted and a neutral grip on each dumbbell. Keep a soft bend in the elbows, wrists neutral, and torso still. Lead with the elbows to raise the bells out to the sides in the scapular plane until arms are about parallel to the floor without shrugging. Pause briefly, then lower under control to the start and repeat.', '2025-11-26 10:29:30.768679', '2025-11-26 10:29:30.768679');
