INSERT INTO public.exercise_example_translations VALUES ('a047cae3-1d34-43b9-82e6-ddc6505f40d8', '12221e5c-0208-48fc-8c56-62c266932f74', 'en', 'Dumbbell Lateral Raise', 'Select a pair of dumbbells and stand tall with feet shoulder-width. With a neutral grip and a slight bend in the elbows, raise the dumbbells out to your sides in the scapular plane (1530 forward) until your hands reach shoulder heightlead with the elbows, wrists neutral. Avoid shrugging and keep the torso still. Pause briefly, then lower under control to the start and repeat.', '2025-11-27 10:15:10.621406', '2025-11-27 10:15:10.621406');
