INSERT INTO public.exercise_example_translations VALUES ('575e2420-8bcb-437f-b1fe-2bc4fa562ca8', '414a1891-1a28-4dbe-84e3-a992c6e879bc', 'en', 'Seated Neutral Grip Dumbbell Wrist Curl', 'Sit on a bench and hold a dumbbell in a neutral (thumbs-up) grip. Rest your forearm on the bench or thigh with the wrist hanging off the edge. Without moving the elbow or shoulder, flex and extend the wrist through a comfortable range, controlling the lowering phase. Keep the forearm planted to keep tension on the forearm muscles.', '2025-11-27 13:51:01.420543', '2025-11-27 13:51:01.420543');
INSERT INTO public.exercise_example_translations VALUES ('b2229d76-cf84-4587-890c-4b15bb13b253', '414a1891-1a28-4dbe-84e3-a992c6e879bc', 'ru', '     ( )', '       (  ) .       ,     .     ,       ,  .   ,      .', '2025-11-27 13:51:01.420543', '2025-11-27 13:51:01.420543');
INSERT INTO public.exercise_example_translations VALUES ('5e47dfa9-c5e7-49b0-b2c1-d2552726f6e7', '7e0566c6-eefb-4992-a673-d19902933c26', 'en', 'Cable Curl (Rope Extension)', 'Attach a rope to a low pulley and select the load. Stand tall, feet shoulder-width, core braced. Grasp the rope with a neutral grip (thumbs up), elbows pinned to your sides. Create light pre-tension and curl without letting the upper arms move; at the top, optionally separate the rope ends to intensify the squeeze. Lower under control to a full stretch without letting the stack slam. Repeat for the desired reps.', '2025-11-27 14:25:02.874186', '2025-11-27 14:25:02.874186');
