INSERT INTO public.exercise_example_translations VALUES ('1bcdd181-23f3-4ba9-a605-defddada106d', '9be8d3a0-574b-40dc-a42c-06ab42af7e66', 'en', 'Close Grip Dumbbell Press (Crush Press)', 'Lie on a flat bench with neutral grips and the dumbbells touching. Retract/depress the scapulae, keep elbows tucked ~3045, and actively squeeze the bells together throughout the press to create constant chest tension. Press up over the lowermid chest and lower under control without letting the dumbbells drift apart. Keep wrists neutral and avoid shrugging or excessive arching.', '2025-11-28 14:11:09.574922', '2025-11-28 14:11:09.574922');
INSERT INTO public.exercise_example_translations VALUES ('bcd056cc-8371-46b6-80b1-ea33221d8dfa', '9be8d3a0-574b-40dc-a42c-06ab42af7e66', 'ua', '    ', '       .    ,    .     (~812  / ~2030 ,    ).    ,      ,           .        /     ,   ~3045  ,  .    ,      .        .    .', '2025-11-28 14:11:09.574922', '2025-11-28 14:11:09.574922');
INSERT INTO public.exercise_example_translations VALUES ('e9d558ea-850d-4ef9-847d-1bcde842788b', '9be8d3a0-574b-40dc-a42c-06ab42af7e66', 'ru', '    ', '       .    ,    .     (~812  / ~2030 ,    ).    ,      ,       -   .        /     ,   ~3045  ,  .    ,      .        .     .', '2025-11-28 14:11:09.574922', '2025-11-28 14:11:09.574922');
INSERT INTO public.exercise_example_translations VALUES ('efb63760-e137-4bc1-91dd-94733eeff293', 'e21344ff-b825-4a99-bf8b-a778bf1964d1', 'en', 'Decline Close Grip Bench Press', 'Lie on a decline bench and set your hands at shoulder-width or slightly closer. Hook your feet under the pads and set your shoulder blades by pinching them together into the bench. Take a deep breath and get a handoff to maintain upper-back tightness. Let the weight settle. Inhale, unlock the elbows, and lower the bar under control to just below the sternum. Keep elbows tucked (3045), wrists neutral, and forearms stacked under the bar. Press the bar back up in a straight line by driving yourself into the bench and extending the elbows. Repeat for the desired reps.', '2025-11-28 14:20:42.575305', '2025-11-28 14:20:42.575305');
INSERT INTO public.exercise_example_translations VALUES ('b2774cf9-d45d-4c4f-bd72-3e21105b4478', 'c21d3b0f-c8a8-4b7f-92ea-90dc567a1183', 'en', 'Close Grip EZ Bar Press', 'Load an EZ bar and lie on a flat bench with feet planted. Take a close grip (just inside shoulder width) on the angled EZ sections, wrists stacked over forearms. Retract and depress the shoulder blades, keep a light arch and tight upper back, then press the bar to lockout to start.
INSERT INTO public.exercise_example_translations VALUES ('3fc38b65-7f40-4573-b7a7-a1f647b15919', 'e21344ff-b825-4a99-bf8b-a778bf1964d1', 'ua', '         ', '              .       ,    .       ,     .   .            .   (~3045),  ,   .     ,      .    .', '2025-11-28 14:20:42.575305', '2025-11-28 14:20:42.575305');
INSERT INTO public.exercise_example_translations VALUES ('7314e5d3-8497-4c49-90fe-c40ca6422745', 'e21344ff-b825-4a99-bf8b-a778bf1964d1', 'ru', '         ', '              .       ,    .      ,     .   .           .   (~3045),  ,   .    ,      .     .', '2025-11-28 14:20:42.575305', '2025-11-28 14:20:42.575305');
INSERT INTO public.exercise_example_translations VALUES ('9fb1e458-8b52-4447-8180-fe0f0e99bcb0', 'd7abed66-3c4a-490b-91cc-8e714336f9fa', 'en', 'Dumbbell Preacher Curl', 'Select the desired dumbbell and sit upright with your chest supported on the preacher bench. Pin your upper arm to the pad and use a supinated (palms up) grip. From full elbow extension, lower the weight under control without letting the shoulder move or the wrist bend. When the biceps are fully lengthened, curl back to the start, briefly squeeze at the top, then lower again. Repeat for both sides.', '2025-11-28 15:47:24.337994', '2025-11-28 15:47:24.337994');
INSERT INTO public.exercise_example_translations VALUES ('db53b264-5f7d-4193-8507-dbe0b673b79e', 'd7abed66-3c4a-490b-91cc-8e714336f9fa', 'ru', '    ', '    ,     .           ( ).           ,       .   ,    ,   ;      .    .', '2025-11-28 15:47:24.337994', '2025-11-28 15:47:24.337994');
INSERT INTO public.exercise_example_translations VALUES ('bc91421f-d0b5-47a1-a00f-a73204a2b0f8', '984e5dac-f3a8-4980-bfc9-da370cf45e46', 'en', 'Incline Rear Delt Fly', 'Set an adjustable bench to a 3040 incline. Lie prone with your chest on the bench and feet planted. Hold dumbbells with a neutral grip and keep a slight bend in the elbows. Set the shoulders down and lightly retracted. Inhale, then raise the arms out to the sides in line with your shoulders by driving the elbows out (not back) until the upper arms are level with your torso. Avoid shrugging or turning it into a row. Pause briefly at the top, then lower the dumbbells under control to the start. Repeat for the desired reps.', '2025-11-29 16:18:54.190538', '2025-11-29 16:18:54.190538');
INSERT INTO public.exercise_example_translations VALUES ('797ca8cb-c09b-47a8-a683-35c7a2a99684', '984e5dac-f3a8-4980-bfc9-da370cf45e46', 'ua', '      ( )', '    3040.   ,    ,   .    ,   .  ,   .          ,    ( ),         .         .   ,       .', '2025-11-29 16:18:54.190538', '2025-11-29 16:18:54.190538');
