INSERT INTO public.exercise_example_translations VALUES ('5d60105c-7e72-4063-ad7d-f5c5c4e5b8d8', '68381c41-b015-4218-93cb-2bcb64bee255', 'en', 'One-Arm Standing Dumbbell Front Raise', 'Grab a dumbbell with a pronated grip and stand with a shoulder-width stance. Brace your core, keep a slight bend in the elbow and the wrist neutral. Inhale and raise your arm straight in front by moving only at the shoulder until its just above parallel to the floor. Avoid swinging or shrugging the shoulder. Pause briefly at the top, then lower the dumbbell under control to the start without letting it rest on the thigh. Repeat for desired reps and switch arms.', '2025-11-29 16:25:26.674911', '2025-11-29 16:25:26.674911');
