INSERT INTO public.exercise_example_translations VALUES ('4ac66935-2648-4361-b800-a80325c82829', 'aada0f37-1f30-4d61-a284-8003027bc871', 'en', 'Cable Face Pull', 'Set a cable with a rope attachment at upper-chest to face height. Take a split or athletic stance, brace your core, and grasp the rope with a neutral/pronated grip. Pull toward the nose/forehead with high elbows, spreading the rope and finishing with slight external rotation (thumbs back) without shrugging. Pause, then return under control keeping ribs down and torso still.', '2026-01-05 14:07:13.746481', '2026-01-05 14:07:13.746481');
