INSERT INTO public.exercise_example_translations VALUES ('e493929d-84e1-4a0c-9948-1830ec87ae42', '118eab6d-cae9-4c0b-b8e6-57f3e5541f1a', 'en', 'Flat Bench Cable Flys', 'Set a flat bench between dual adjustable pulleys, attach D-handles, and lie supine. With slight elbow bend fixed, sweep the arms in an arc to bring the handles together over the chest, then return under control. Keep shoulder blades retracted/depressed and avoid turning it into a press to maintain chest isolation and constant cable tension.', '2026-01-08 10:46:28.865909', '2026-01-08 10:46:28.865909');
INSERT INTO public.exercise_example_translations VALUES ('7ab5337f-4b90-402b-8194-c18b56859679', '118eab6d-cae9-4c0b-b8e6-57f3e5541f1a', 'ua', '     ', '      ,  D-    .          ,    ,    .    ;     ,        .', '2026-01-08 10:46:28.865909', '2026-01-08 10:46:28.865909');
