INSERT INTO public.exercise_example_translations VALUES ('b0a97ad2-8544-407c-88c1-ddcd58cff4df', 'f2868e11-6e1d-4ce4-a1a8-eb0384a60b71', 'en', 'Floor Crunch (Legs on Bench)', 'Place a mat on the floor and position a flat bench at the end to form a T. Lie supine with calves resting on the bench so hips and knees are ~90. Lightly touch your temples with your fingertips (do not pull on the neck). Posteriorly tilt the pelvis, lift the shoulder blades slightly off the mat, and brace. Exhale as you curl the ribcage toward the pelvis; keep elbows open and the low back gently flattened. Pause 12 s at the top, then lower under control until the shoulder blades hover above the mat. Keep reps slow and avoid using momentum.', '2026-01-08 10:58:24.598002', '2026-01-08 10:58:24.598002');
INSERT INTO public.exercise_example_translations VALUES ('7746805d-68e8-4cb5-97a0-de1979f4211f', 'f2868e11-6e1d-4ce4-a1a8-eb0384a60b71', 'ua', '   (  )', '        ,   - .   ,   ,     ~90.      (   ).     ,        .       ;  ,   .  12    ,    ,      .   ,  .', '2026-01-08 10:58:24.598002', '2026-01-08 10:58:24.598002');
