INSERT INTO public.exercise_example_translations VALUES ('14198cf7-b97a-42e8-b7ec-4abbc5c4db0f', '4f9bdd10-28bc-447e-8cf5-fbf47cd9af79', 'ua', '  ', '   EZ-     . ,    ,     .   ( 2030 ,    ),    ,   ,  ,      .       ,           .        ,    .      .    .', '2026-01-13 17:53:53.328435', '2026-01-13 17:53:53.328435');
