INSERT INTO public.exercise_example_translations VALUES ('af7f633c-ae8a-4352-b27d-cd57144fe49b', 'a90f4822-63c5-42b9-943c-ff0ceacad1eb', 'en', 'High Pulley Overhead Tricep Extension', 'Attach a straight bar to a high pulley and select the load. Stand facing away from the stack with a small forward lean, feet staggered for balance. Grip the bar overhand at shoulder width and bring it behind your head with elbows close to your ears; upper arms stay roughly parallel to the floor. Extend only at the elbows to press the bar forward until the arms are straight. Pause, then return under control to the start, keeping the torso and shoulders stable. Repeat for reps.', '2026-01-13 18:11:00.732142', '2026-01-13 18:11:00.732142');
