INSERT INTO public.exercise_example_translations VALUES ('c8ba56c2-3b3f-467f-b99c-d320a9d4c040', 'a2736a56-04b3-4437-835e-1e2dc8029c9e', 'en', 'Spider Curl', 'Set up facing the preacher bench with your chest against the pad and arms hanging vertically over the top edge. Grip an EZ bar shoulder-width with an underhand (supinated) grip. Keep upper arms perpendicular to the floor, elbows fixed, and wrists neutral. Curl the bar by flexing only the elbowsno swinging or shrugging. Squeeze at the top, pause, then lower under control (23 s) to a full stretch. Repeat for the desired reps.', '2026-01-13 18:21:56.68714', '2026-01-13 18:21:56.68714');
INSERT INTO public.exercise_example_translations VALUES ('b4c062e4-ff1b-430a-b05b-2fc46f444eeb', 'a2736a56-04b3-4437-835e-1e2dc8029c9e', 'ua', '-   (EZ-)', '    ,     ,      .   EZ-     .      ,  ,  .         .     ,     23    .    .', '2026-01-13 18:21:56.68714', '2026-01-13 18:21:56.68714');
INSERT INTO public.exercise_example_translations VALUES ('0e2ce466-856b-41f8-b086-fcf2ac32dbfb', 'a2736a56-04b3-4437-835e-1e2dc8029c9e', 'ru', '-   (EZ-)', '    ,    ,      .   EZ-     .      ,  ,  .         .     ,    23    .     .', '2026-01-13 18:21:56.68714', '2026-01-13 18:21:56.68714');
INSERT INTO public.exercise_example_translations VALUES ('6d778933-98ca-4f4d-8fc1-4d009037b138', '92d77415-1f9a-430b-ba52-0a09ec07b3a1', 'en', 'Standing Dumbbell Shoulder Press', 'Stand with feet shoulder-width, brace your trunk, and keep ribs down and glutes lightly engaged. Raise the dumbbells to shoulder level with a pronated grip; wrists stacked over elbows. Press overhead in the scapular plane until biceps are near the ears without shrugging or overextending the lower back. Lower under control to about chin/upper-chest level and repeat.', '2026-01-13 18:39:31.530306', '2026-01-13 18:39:31.530306');
INSERT INTO public.exercise_example_translations VALUES ('c64a8394-6827-4357-9015-04da49c92073', '92d77415-1f9a-430b-ba52-0a09ec07b3a1', 'ua', '  ', '   ,  ,  ,    .       ,   .     ,      ,      .      /   .', '2026-01-13 18:39:31.530306', '2026-01-13 18:39:31.530306');
