INSERT INTO public.exercise_example_translations VALUES ('1d831dae-0789-462d-9cef-9471a54117bf', 'ff188494-a871-4721-9d1e-26742539080c', 'en', 'Cable Front Raise (Bilateral)', 'Stand shoulder-width with the low cable running between your legs. Attach a straight bar and grasp it with both hands using a pronated grip. Brace your core, keep a slight bend in the elbows and wrists neutral. Raise the bar straight in front by moving only at the shoulders until arms are at or just above parallel. Avoid leaning back or shrugging. Pause briefly, then lower under control to the start. Repeat for the desired reps.', '2026-01-13 18:54:16.099241', '2026-01-13 18:54:16.099241');
INSERT INTO public.exercise_example_translations VALUES ('50389fdf-c83d-482e-adfa-98521181c45b', 'ff188494-a871-4721-9d1e-26742539080c', 'ua', '     ( )', '   ,      .           .  ,     ,  .     ,     ,         .       .  ,       .    .', '2026-01-13 18:54:16.099241', '2026-01-13 18:54:16.099241');
INSERT INTO public.exercise_example_translations VALUES ('ef16b29f-6f29-445d-a307-cf8e9046b825', 'ff188494-a871-4721-9d1e-26742539080c', 'ru', '     ()', '   ,      .           .  ,     ,  .     ,     ,          .       .  ,      .    .', '2026-01-13 18:54:16.099241', '2026-01-13 18:54:16.099241');
INSERT INTO public.exercise_example_translations VALUES ('8e629a4b-976d-4dcc-8136-3f45d19b9c11', '9a4eec3b-3f0b-4b36-a2b5-0f544376cf78', 'en', 'Decline Cable Chest Press', 'Set a decline bench between dual adjustable pulleys, attach D-handles, and set pulleys slightly below shoulder height. Press down and forward in an arcing path to bias the lower fibers of the chest. Keep shoulder blades depressed/retracted, elbows slightly tucked, and control the return to maintain constant cable tension.', '2026-01-13 19:18:33.224233', '2026-01-13 19:18:33.224233');
INSERT INTO public.exercise_example_translations VALUES ('c9270721-87b9-49d2-8652-22b89d171cb8', '9a4eec3b-3f0b-4b36-a2b5-0f544376cf78', 'ua', '       ', '        ,  D-       .      ,    .     ,   ,     ,    .', '2026-01-13 19:18:33.224233', '2026-01-13 19:18:33.224233');
