INSERT INTO public.exercise_example_translations VALUES ('b134aa20-7425-4f36-9b03-d914714ab7cb', '9fc5ae4d-2868-4576-bb67-9c83663fc005', 'en', 'EZ Bar Preacher Curl', 'Adjust the preacher bench so your upper arms rest firmly on the pad. Load the EZ bar and grip shoulder-width with an underhand (palms up) grip. Set your shoulders down and back, keep elbows pinned to the pad, and wrists neutral. Lift the bar off the rests with a slight elbow bend. Curl until your forearms are near vertical without letting the shoulders roll forward; pause and squeeze the biceps. Lower the bar slowly to a near-straight elbow without locking out. Maintain a still torso and avoid bouncing. Repeat for the desired reps.', '2026-01-13 19:32:03.442144', '2026-01-13 19:32:03.442144');
INSERT INTO public.exercise_example_translations VALUES ('eb1e91cb-9bc0-4aed-88cc-f7b00b70a755', '9fc5ae4d-2868-4576-bb67-9c83663fc005', 'ua', '   EZ-   ', '   ,        .  EZ-       .    ,    ,  .         .     ,    ;     .        .  ,  .    .', '2026-01-13 19:32:03.442144', '2026-01-13 19:32:03.442144');
INSERT INTO public.exercise_example_translations VALUES ('59dcd68c-20e6-4b28-a955-2c70dd0132aa', '9fc5ae4d-2868-4576-bb67-9c83663fc005', 'ru', '   EZ-   ', '   ,        .  EZ-       .    ,    ,  .         .     ,    ;     .         .  ,  .     .', '2026-01-13 19:32:03.442144', '2026-01-13 19:32:03.442144');
INSERT INTO public.exercise_example_translations VALUES ('1f11d156-22f8-448b-aa47-6f6e0bca2211', '04d275d8-71df-4695-ace9-899ce6e41b29', 'en', 'Seated Dumbbell Tricep Extension', 'Select the desired weight and set an adjustable bench to 90. Sit tall with your back on the pad and feet planted. Clean the dumbbell to the shoulder, overlap your hands around one head, then press it overhead. Brace your core, keep ribs down, wrists neutral, and elbows pointing up close to the ears.
INSERT INTO public.exercise_example_translations VALUES ('6160caa8-738f-48d3-9c83-d3bcdd8d267f', '04d275d8-71df-4695-ace9-899ce6e41b29', 'ua', '       ', '       90.  ,   ,   .    ,          .  ,  ,  ,      .    ,          .    ,   ,       .       .    .', '2026-01-13 20:25:46.998094', '2026-01-13 20:25:46.998094');
