INSERT INTO public.exercise_example_translations VALUES ('0254022c-e28d-4969-90bc-96555a5fa1b8', '748e0a60-9429-4a9d-8a6b-3ba76a7fc4b2', 'en', 'High Pulley Overhead Tricep Extension (Rope Extension)', 'Attach a rope to a high pulley and select the load. Stand with a split stance, hinge slightly forward, and grasp the rope overhead with a neutral grip. Keep elbows close to your ears and upper arms fixed. Extend only at the elbows, driving the rope forward/down and separating the ends at lockout. Pause under control, then return to the start without letting the shoulders or torso move. Repeat for reps.', '2026-01-16 09:55:57.666568', '2026-01-16 09:55:57.666568');
INSERT INTO public.exercise_example_translations VALUES ('ba901985-b467-471b-bd1e-5c2ef41fca60', '748e0a60-9429-4a9d-8a6b-3ba76a7fc4b2', 'ua', '         ', '       .    ,         .     ,    .   ,   /       .    ,         .    .', '2026-01-16 09:55:57.666568', '2026-01-16 09:55:57.666568');
INSERT INTO public.exercise_example_translations VALUES ('38a49a7d-2ac2-4b0b-9839-2a10494a26ea', '748e0a60-9429-4a9d-8a6b-3ba76a7fc4b2', 'ru', '         ', '       .    ,         .     ,    .   ,   /       .    ,         .     .', '2026-01-16 09:55:57.666568', '2026-01-16 09:55:57.666568');
INSERT INTO public.exercise_example_translations VALUES ('550913b1-c489-436f-a73c-e7b53a3c0f75', '7227c8f6-cf65-4134-97de-d5e64cb5ff1b', 'en', 'Toes Out 45 Degree Calf Raise', '45 leg press calf raise with toes externally rotated (~1530). Sit securely, place the balls of the feet on the bottom edge of the footplate (heels hanging). Extend the sled to unlock, keep knees softly extended (no hyperextension), pelvis neutral. Move only at the ankles: lower to a comfortable stretch, then plantarflex to the highest point; pause 12 s at the top and control the eccentric. Keep the balls of the feet on the edge (dont roll toward the toes), avoid bouncing. Toes-out may bias the medial gastrocnemius, but evidence is mixed.', '2026-01-21 10:02:49.366603', '2026-01-21 10:02:49.366603');
INSERT INTO public.exercise_example_translations VALUES ('b6d52e60-ee2b-4ab8-befa-71cf8af4d404', '7227c8f6-cf65-4134-97de-d5e64cb5ff1b', 'ua', '      45 (  )', '        45  ,   (~1530).  ,        ( ).  ,   ,     ( ),  .    :    ,       ;  12    .      (   ),   .          ,    .', '2026-01-21 10:02:49.366603', '2026-01-21 10:02:49.366603');
