INSERT INTO public.exercise_example_translations VALUES ('0ab1dbb3-4e11-44b9-9843-7090246fc229', 'b790c6a6-ecd1-4b3a-afbc-22cd82e55658', 'en', 'Lying Dumbbell Extension', 'Sit on the end of a flat bench with dumbbells on your thighs. Lie back and press the dumbbells to arms length over the shoulders using a neutral grip (palms facing each other). Keep wrists neutral, shoulders packed, and upper arms angled slightly back with elbows pointing toward the hips.
INSERT INTO public.exercise_example_translations VALUES ('b651fb8d-d495-49f4-8aef-ae18fcdcc727', 'b790c6a6-ecd1-4b3a-afbc-22cd82e55658', 'ua', '     ', '        .            (   ).   ,   ,      ,    .   ,       ;  ,  .  ,       .          .    .', '2026-01-21 10:09:54.164752', '2026-01-21 10:09:54.164752');
