INSERT INTO public.exercise_example_translations VALUES ('9adde1c6-e965-436a-9598-63e978641b62', '855bd9e5-3546-4cfd-b048-e8017f01bfeb', 'en', 'Dumbbell Tricep Kickback', 'Place a dumbbell next to a flat bench. Set up with your right knee and right hand on the bench, left foot on the floor, torso nearly parallel to the ground, and a neutral spine. Hold the dumbbell in your left hand with a neutral grip. Tuck the left upper arm close to your torso and keep it in line with your body; start around 90 of elbow flexion. Moving only at the elbow, extend until the arm is straight without swinging the shoulder. Pause briefly, then lower under control to the start. Complete reps and switch sides.', '2026-01-21 10:25:04.640717', '2026-01-21 10:25:04.640717');
INSERT INTO public.exercise_example_translations VALUES ('4ea768e5-ea23-4c8b-8311-cd21c1978725', '855bd9e5-3546-4cfd-b048-e8017f01bfeb', 'ua', '    ', '     .  :       ,    ;    ,  .       .             ;   ~90.    ,        ;  .     ,  .     .', '2026-01-21 10:25:04.640717', '2026-01-21 10:25:04.640717');
INSERT INTO public.exercise_example_translations VALUES ('c243c3d2-04e7-4f09-8083-7434cfe1ecd1', '855bd9e5-3546-4cfd-b048-e8017f01bfeb', 'ru', '    ', '     .  :       ,    ;    ,  .       .             ;    ~90.    ,       ;  .    ,  .     .', '2026-01-21 10:25:04.640717', '2026-01-21 10:25:04.640717');
INSERT INTO public.exercise_examples VALUES ('275097d4-3c8d-4040-9b2e-5f294919df04', 'Cable Concentration Tricep Extension', '2024-08-24 15:21:25.308798', '2025-09-15 16:32:48.61278', 'https://www.bodybuilding.com/images/2016/june/7-best-triceps-exercises-youre-not-doing-v2-7-700xh.jpg', 'Attach a single handle to a high cable. Set up in a half-kneeling stance (inside knee down) with the working elbow braced against the inside of the front thigh. Grip the handle supinated (palm up). Keep the upper arm fixed, shoulder packed, wrist neutral, and core braced.
INSERT INTO public.exercise_examples VALUES ('d6743870-0d5a-4180-9671-181b8f65e03e', 'Decline Lying Tricep Extension (Skullcrusher)', '2024-08-27 17:17:13.831319', '2025-09-15 16:09:42.883863', '', 'Set a decline bench to ~2030. Select the desired weight and lie back, keeping the bar close to your chest; press to lockout over the shoulders. Use a narrow overhand grip on the EZ bar, wrists neutral, elbows slightly tucked and fixed. From a stable upper-arm position, unlock the elbows and lower the bar toward the forehead or just behind the head. When the forearms reach parallel or slightly below, extend the elbows to lockout by contracting the triceps. Avoid shoulder movement, pause briefly, then repeat for reps.', 'isolation', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('7517ae2f-c198-4a33-8a1d-1dc7327d1430', '45 Degree Lying Tricep Extension (EZ Bar)', '2024-08-23 20:29:25.181737', '2025-10-19 14:45:24.010581', 'https://dsikfdo0rac0e.cloudfront.net/example-images/45_degree_lying_tricep_extension_ez_bar.png', 'Sit on the end of a flat bench with an EZ-bar resting on your thighs.
INSERT INTO public.exercise_examples VALUES ('faf6674c-2a2a-4b03-ab8b-7a033052b572', 'Alternating Bent-Over Dumbbell Kickback', '2024-08-24 13:49:36.23273', '2025-10-19 14:47:38.624507', 'https://dsikfdo0rac0e.cloudfront.net/example-images/alternating_bent_over_dumbbell_kickback.png', 'Select appropriate dumbbells. Hinge at the hips until your torso is nearly parallel to the floor, soft knees, neutral spine, shoulder blades lightly retracted.
INSERT INTO public.exercise_examples VALUES ('650e9725-d36c-4688-bcab-adf93dfe9e5d', 'EZ Bar Skullcrusher', '2024-08-23 15:44:41.300424', '2025-10-19 16:42:16.835591', '', 'Select your desired weight and sit on the edge of a flat bench.
INSERT INTO public.exercise_examples VALUES ('5985d847-0473-444e-8fe0-9da5341ef986', 'Cable Tricep Extension With V-Bar', '2024-08-26 14:10:38.408306', '2025-11-28 14:04:43.056032', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_tricep_extension_with_v_bar.png', 'Attach a V-bar to a high cable. Stand tall with a slight hip hinge and soft knees. Grip the V-bar with a semi-pronated grip, tuck your elbows to your sides, keep the upper arms fixed, shoulders down and back, and brace the core.
INSERT INTO public.exercise_examples VALUES ('e21344ff-b825-4a99-bf8b-a778bf1964d1', 'Decline Close Grip Bench Press', '2024-08-27 17:14:24.425351', '2025-11-28 14:20:42.575305', 'https://dsikfdo0rac0e.cloudfront.net/example-images/decline_close_grip_bench_press.png', 'Lie on a decline bench and set your hands at shoulder-width or slightly closer. Hook your feet under the pads and set your shoulder blades by pinching them together into the bench. Take a deep breath and get a handoff to maintain upper-back tightness. Let the weight settle. Inhale, unlock the elbows, and lower the bar under control to just below the sternum. Keep elbows tucked (3045), wrists neutral, and forearms stacked under the bar. Press the bar back up in a straight line by driving yourself into the bench and extending the elbows. Repeat for the desired reps.', 'compound', 'free', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('6a312bde-cc33-450b-8f1d-6091ccffe9cc', 'Reverse Grip Cable Tricep Extension', '2024-08-26 15:16:20.191397', '2025-09-15 16:18:28.988991', 'https://ignorelimits.com/wp-content/uploads/2017/08/how-to-reverse-grip-cable-triceps-pushdown-Copy.jpg', 'Attach a straight bar to a high cable and stand facing the stack. Grasp the bar shoulder-width with a supinated grip (palms up), hinge slightly forward, brace, and pin your elbows to your sides.
INSERT INTO public.exercise_examples VALUES ('89f423d0-315f-4d93-b346-dcb468a97045', 'Zottman Curl', '2024-08-27 20:17:28.409294', '2025-09-15 15:44:50.458407', '', 'Stand with feet shoulder-width apart holding dumbbells at your sides. Using a supinated (palms up) grip, keep elbows tucked and curl the dumbbells toward your shoulders without swinging. At the top, rotate to a pronated (palms down) position and lower the weights slowly under control. Re-supinate at the bottom and repeat for the desired reps.', 'isolation', 'free', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('11644e17-247a-46b0-a391-b3b2a2a6bba8', 'Cable Tricep Kickback', '2024-08-26 14:15:00.627444', '2026-01-05 12:24:48.421873', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_tricep_kickback.png', 'Attach a single-grip handle to a low pulley. Stand staggered, hinge at the hips until your torso is near parallel to the floor, and brace the core. Hold the handle in one hand, use the other hand for support on the machine or bench. Lift the working upper arm so the elbow is beside the torso and stays fixed there.
INSERT INTO public.exercise_examples VALUES ('9f0c8916-a08b-4fe5-9f24-e1680ef627a8', 'Bench Dip', '2024-08-24 15:05:24.055319', '2025-10-19 15:11:01.453747', 'https://dsikfdo0rac0e.cloudfront.net/example-images/bench_dip.png', 'Place two flat benches parallel, ~45 ft apart (adjust to your leg length). Put your heels on one bench and hands on the edge of the other, fingers forward, arms straight but not locked. Keep your torso close to the bench, shoulders down and back, and core braced.
INSERT INTO public.exercise_examples VALUES ('547f1f7e-3ee1-4b39-99eb-3462b1ec13af', 'Bent Over Dumbbell Tricep Kickback', '2024-08-24 15:14:04.484126', '2025-10-19 15:15:39.502845', 'https://dsikfdo0rac0e.cloudfront.net/example-images/bent_over_dumbbell_tricep_kickback.png', 'Select the desired weight from the rack and stand in an open area.
INSERT INTO public.exercise_examples VALUES ('490df80e-d34c-42cf-bfe5-c27ddd2cd734', 'Decline Lying Dumbbell Extension', '2024-08-27 17:08:58.772907', '2025-10-19 16:03:22.209916', '', 'Set an adjustable bench to a slight decline (1530) and select the desired dumbbells.
INSERT INTO public.exercise_examples VALUES ('47f00a63-05df-4db7-b2c7-68000c72be9b', 'Incline Dumbbell Bench Press', '2024-09-02 14:03:25.447382', '2025-11-23 14:34:16.866501', 'https://dsikfdo0rac0e.cloudfront.net/example-images/incline_dumbbell_bench_press.png', 'Incline dumbbell press emphasizing the upper chest. Set bench at ~3045, retract/depress scapulae, feet planted, neutral wrists. Lower dumbbells in a slight arc until forearms are vertical near the bottom without losing shoulder position; press up and back over the shoulders. Keep elbows ~4560 to the torso. Dumbbells improve ROM and side-to-side balance versus a barbell.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('ee8cc366-d33b-45a6-84b0-4ab416585ad1', 'Close Grip Press Behind-The-Neck', '2024-08-27 16:05:54.962719', '2025-11-23 21:40:22.258889', 'https://dsikfdo0rac0e.cloudfront.net/example-images/close_grip_press_behind_the_neck.png', 'Sit on a flat bench (back support preferred) and load an EZ bar or barbell. Grasp just inside shoulder width with an overhand grip.
INSERT INTO public.exercise_examples VALUES ('2522a61a-2190-43e9-ae52-ca6bb023815e', 'Cable Curl', '2024-08-27 20:13:52.504713', '2025-10-16 11:17:12.449842', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_curl.png', 'Attach a straight bar to the low pulley and select the load. Stand facing the stack, feet shoulder-width. Grip the bar shoulder-width with a supinated (palms up) grip. Set shoulders down and back, keep elbows tucked to your sides and wrists neutral. Curl the bar up until forearms are near vertical; pause and squeeze the biceps. Lower under control to near-full elbow extension without letting the shoulders roll forward. Repeat for desired reps.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('bbfbcfe2-1f56-492e-afa6-75e595b84fde', 'Standing Barbell Curl', '2024-08-27 20:04:23.470927', '2025-11-24 22:19:11.450047', 'https://dsikfdo0rac0e.cloudfront.net/example-images/standing_barbell_curl.png', 'Stand tall with feet hip-width, ribs down, glutes and abs braced. Grip a barbell shoulder-width with a supinated grip, arms fully extended, elbows tucked to sides. Without leaning back or swinging, curl the bar by flexing the elbows until forearms are near vertical; squeeze the biceps, then lower under control to full extension while keeping wrists neutral and the bar off the body. Repeat for reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('ddc2e877-7197-42fa-ae1e-59706d209774', 'Standing Dumbbell Curl', '2024-08-27 19:58:20.484787', '2025-11-24 22:26:14.403369', 'https://dsikfdo0rac0e.cloudfront.net/example-images/standing_dumbbell_curl.png', 'Stand tall with feet hip-width and core braced. Hold dumbbells at your sides with a supinated grip (palms up), shoulders down and elbows tucked. Without swinging or leaning back, curl by flexing the elbows until forearms are near vertical; keep wrists neutral. Squeeze briefly at the top, then lower under control to full elbow extension while maintaining tension. Repeat for reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('53defdc5-bfec-4af4-bfba-60440e3493cc', 'EZ Bar Incline Skullcrusher', '2024-08-27 17:40:04.03333', '2025-09-15 16:06:04.550945', '', 'Set an adjustable bench to 2030. Sit, lie back with the EZ bar close to your chest, then press to lockout over the shoulders. Keep upper arms fixed and elbows tucked. Unlock the elbows and lower the bar toward the forehead (or just behind the head) until forearms are slightly below parallel. Extend the elbows to return to lockout, keeping wrists neutral and torso still. Repeat for reps.', 'isolation', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('a90f4822-63c5-42b9-943c-ff0ceacad1eb', 'High Pulley Overhead Tricep Extension', '2024-08-27 17:44:25.490434', '2026-01-13 18:11:00.732142', 'https://dsikfdo0rac0e.cloudfront.net/example-images/high_pulley_overhead_tricep_extension.png', 'Attach a straight bar to a high pulley and select the load. Stand facing away from the stack with a small forward lean, feet staggered for balance. Grip the bar overhand at shoulder width and bring it behind your head with elbows close to your ears; upper arms stay roughly parallel to the floor. Extend only at the elbows to press the bar forward until the arms are straight. Pause, then return under control to the start, keeping the torso and shoulders stable. Repeat for reps.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('9a4eec3b-3f0b-4b36-a2b5-0f544376cf78', 'Decline Cable Chest Press', '2024-09-02 21:11:10.373493', '2026-01-13 19:18:33.224233', 'https://dsikfdo0rac0e.cloudfront.net/example-images/decline_cable_chest_press.png', 'Set a decline bench between dual adjustable pulleys, attach D-handles, and set pulleys slightly below shoulder height. Press down and forward in an arcing path to bias the lower fibers of the chest. Keep shoulder blades depressed/retracted, elbows slightly tucked, and control the return to maintain constant cable tension.', 'compound', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('748e0a60-9429-4a9d-8a6b-3ba76a7fc4b2', 'High Pulley Overhead Tricep Extension (Rope Extension)', '2024-08-27 17:41:21.141757', '2026-01-16 09:55:57.666568', 'https://dsikfdo0rac0e.cloudfront.net/example-images/high_pulley_overhead_tricep_extension_rope_extension.png', 'Attach a rope to a high pulley and select the load. Stand with a split stance, hinge slightly forward, and grasp the rope overhead with a neutral grip. Keep elbows close to your ears and upper arms fixed. Extend only at the elbows, driving the rope forward/down and separating the ends at lockout. Pause under control, then return to the start without letting the shoulders or torso move. Repeat for reps.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('4de0744d-0a78-4052-aa1b-e5340959d9fe', 'Standing Dumbbell Reverse Curl', '2024-08-28 20:45:27.508894', '2025-09-15 15:21:42.982047', '', 'Select the desired weight from the rack and take a shoulder-width stance. Using a pronated (palms down) grip, keep your elbows pinned to your sides and your wrists straight. Curl the dumbbells toward your shoulders by flexing only at the elbowsavoid swinging or letting the shoulders roll forward. Briefly squeeze at the top, then lower under control for 23 seconds to full elbow extension. Repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('cfd086be-f452-4f1d-b0cc-3988d677a8b4', 'Dumbbell Hammer Preacher Curl', '2024-08-28 20:48:17.207982', '2025-11-20 19:44:53.579032', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_hammer_preacher_curl.png', 'Select a dumbbell and sit with your chest supported against the preacher bench. Pin your upper arm to the pad and use a neutral (thumbs-up, palms facing each other) grip. From full elbow extension, lower the weight under control, keeping the wrist straight and the shoulder still. When the biceps/brachialis are fully lengthened, curl back up without letting the elbow lift off the pad; pause and squeeze, then lower to the start. Repeat for both sides.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('7fd82f79-1f5f-4bae-8f2d-b94ecae595d5', 'Machine Bicep Curl', '2024-08-28 20:38:26.215597', '2025-11-23 13:34:03.325265', 'https://dsikfdo0rac0e.cloudfront.net/example-images/machine_bicep_curl.png', 'Adjust the seat so your elbows align with the machines pivot and your upper arms rest fully on the pad. Select a load, grasp the handle with a shoulder-width underhand grip, set your shoulders down/back, and keep wrists neutral. Create light pre-tension, then curl without letting the elbows lift or torso shift. Squeeze briefly at the top, and lower under control (23 s) to a full stretch without locking out. Repeat for the desired reps.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('b99df7e8-eb44-4be1-be81-701347580781', 'Lying Incline Bench Barbell Curl', '2024-08-28 21:11:35.028903', '2025-09-15 15:00:03.100637', '', 'Set an adjustable bench to ~30 and lie prone with your chest supported at the end of the bench. Grasp an EZ bar with a shoulder-width supinated grip, wrists neutral, elbows hanging under the shoulders. Brace, keep the torso still (no shrugging or swinging), and curl the bar under control. Squeeze the biceps near the top without letting the elbows drift forward, then lower slowly to full elbow extension. Repeat for the desired reps.', 'isolation', 'free', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('da809d98-950b-4ca0-a71b-c67d21fd66da', 'Seated Dumbbell Curl', '2024-08-28 20:44:17.593336', '2025-11-26 10:45:04.735684', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_dumbbell_curl.png', 'Sit tall on a flat bench with feet planted and a dumbbell in each hand, palms facing up (supinated). Keep elbows tucked to your sides, chest up, and wrists neutral. Curl both dumbbells by flexing only at the elbowsavoid swinging or letting the shoulders roll forward. Squeeze at the top, then lower under control for 23 seconds to full elbow extension. Repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('7e0566c6-eefb-4992-a673-d19902933c26', 'Cable Curl (Rope Extension)', '2024-08-28 20:36:41.142025', '2025-11-27 14:25:02.531548', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_curl_rope_extension.png', 'Attach a rope to a low pulley and select the load. Stand tall, feet shoulder-width, core braced. Grasp the rope with a neutral grip (thumbs up), elbows pinned to your sides. Create light pre-tension and curl without letting the upper arms move; at the top, optionally separate the rope ends to intensify the squeeze. Lower under control to a full stretch without letting the stack slam. Repeat for the desired reps.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('6d5dc164-3c35-4719-85f1-5c75558f0125', 'Wide Grip Cable Curl', '2024-08-28 20:53:42.332689', '2025-11-28 12:02:55.023736', 'https://dsikfdo0rac0e.cloudfront.net/example-images/wide_grip_cable_curl.png', 'Attach a straight bar to a low pulley and select the load. Stand tall facing the stack with feet shoulder-width apart. Grasp the straight bar with a supinated grip slightly wider than shoulder width; keep elbows tucked to your sides, wrists neutral, and torso still. Curl the bar toward your shoulders until full elbow flexion, squeeze briefly, then lower under control to full extension without letting the shoulders roll forward. Breathe in before the curl and exhale near the top. Repeat for reps.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('d7abed66-3c4a-490b-91cc-8e714336f9fa', 'Dumbbell Preacher Curl', '2024-08-28 20:47:16.396698', '2025-11-28 15:47:24.337994', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_preacher_curl.png', 'Select the desired dumbbell and sit upright with your chest supported on the preacher bench. Pin your upper arm to the pad and use a supinated (palms up) grip. From full elbow extension, lower the weight under control without letting the shoulder move or the wrist bend. When the biceps are fully lengthened, curl back to the start, briefly squeeze at the top, then lower again. Repeat for both sides.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('3d6e76b5-b409-4f5b-bba4-c22cb10cfbd4', 'Seated Bent Over Dumbbell Reverse Fly', '2024-08-29 15:28:20.973087', '2025-09-15 14:04:18.701842', '', 'Sit on the edge of a flat bench with feet planted, hinge forward from the hips keeping a neutral spine until the torso is close to the thighs. Let the arms hang under the shoulders with a neutral grip and a soft elbow bend. Lead with the elbows to raise the dumbbells out to the sides (horizontal abduction in the scapular plane) until upper arms reach about shoulder level without shrugging or over-retracting the shoulder blades. Pause briefly, then lower under control while keeping the torso still.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('04a13a1c-de2b-46f4-be62-3fa6b4655d0d', 'Barbell Concentration Curl', '2024-08-28 21:07:18.63992', '2025-10-08 09:07:00.226242', 'https://dsikfdo0rac0e.cloudfront.net/example-images/barbell_concentration_curl.png', 'Sit on the end of a flat bench with feet slightly wider than shoulder width. Grasp a barbell underhand with a close grip (about 68 in / 1520 cm). Hinge forward and pin your upper arms against the inner thighs to immobilize the shoulders; wrists neutral and spine long. Inhale, keep elbows fixed, and curl the bar toward your shoulders without swinging or letting the elbows drift. Squeeze briefly at the top, then lower under control to full extension. Repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('101f365e-5c84-438a-84b4-c8e798bd0aff', 'Incline Bench Hammer Curl', '2024-08-28 21:02:48.198286', '2025-11-22 12:13:21.60577', 'https://dsikfdo0rac0e.cloudfront.net/example-images/incline_bench_hammer_curl.png', 'Set an adjustable bench to ~45. Sit at the top end and hold a dumbbell with a neutral (hammer) grip. Brace the back of your upper arm on the pad and let the arm fully extend without letting the shoulder drift. Keep the wrist neutral and the elbow pinned to the pad. Curl the dumbbell by flexing the elbow only; do not supinate or swing. Squeeze briefly at the top, then lower under control to full extension. Repeat for reps, then switch arms.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('ff188494-a871-4721-9d1e-26742539080c', 'Cable Front Raise (Bilateral)', '2024-08-29 21:01:10.936876', '2026-01-13 18:54:16.099241', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_front_raise_bilateral.png', 'Stand shoulder-width with the low cable running between your legs. Attach a straight bar and grasp it with both hands using a pronated grip. Brace your core, keep a slight bend in the elbows and wrists neutral. Raise the bar straight in front by moving only at the shoulders until arms are at or just above parallel. Avoid leaning back or shrugging. Pause briefly, then lower under control to the start. Repeat for the desired reps.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('4f1c3655-21e7-4225-a39e-944774f59f76', 'Wide Grip Standing Barbell Curl', '2024-08-28 20:51:35.44937', '2025-11-22 14:04:19.600568', 'https://dsikfdo0rac0e.cloudfront.net/example-images/wide_grip_standing_barbell_curl.png', 'Stand tall with feet shoulder-width apart. Grasp a barbell with a wide underhand (supinated) grip slightly wider than shoulder width. Pin your elbows to your sides, keep wrists neutral, shoulders down and back, and torso braced. Curl the bar toward your shoulders until full elbow flexion without letting the elbows drift forward or the body sway; pause briefly, then lower under control to full extension. Inhale before initiating the curl and exhale near the top. Repeat for reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('a9545ccb-3ec7-4646-95c9-f3a708d0d968', 'Two-Arm Low Pulley Cable Curl', '2024-08-28 21:08:56.485198', '2025-11-22 14:21:06.628701', 'https://dsikfdo0rac0e.cloudfront.net/example-images/two_arm_low_pulley_cable_curl.png', 'Use a cable machine with two low pulleys and single handles. Stand centered between the stacks and take a small step forward to pre-tension the cables; arms extended slightly behind the body with a supinated grip. Brace, keep elbows pinned by your sides and shoulders still, then curl the handles toward your shoulders. Squeeze at the top without letting the elbows drift forward, and lower under control to full extension. Repeat for the desired reps.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('5e3c933f-7511-463e-88b1-a139c8276e69', 'Cross Body Hammer Curl (Pinwheel Curls)', '2024-08-27 20:27:54.259424', '2025-11-23 21:07:39.717403', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cross_body_hammer_curl_pinwheel_curls.png', 'Stand tall with dumbbells at your sides in a neutral grip (palms facing in). Brace your core, keep shoulders down, and pin your upper arm to your torso. Curl one dumbbell across the body toward the opposite shoulder/pec with the thumb leading; avoid swinging or rotating the torso. Pause and squeeze at the top, then lower under control to a full stretch. Keep the wrist neutral and the non-working arm still. Alternate sides rep by rep.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('816440ad-f8f2-4ef7-a11f-b6a2bd63fcef', 'Bent Over Dumbbell Reverse Fly', '2024-08-29 15:23:10.33151', '2025-10-09 08:43:43.084155', 'https://dsikfdo0rac0e.cloudfront.net/example-images/bent_over_dumbbell_reverse_fly.png', 'Stand with feet hip-width and hinge from the hips until the torso is nearly parallel to the floor, keeping a neutral spine. Hold dumbbells with a neutral grip and a soft bend in the elbows; let arms hang under the shoulders. Brace, avoid shrugging, and lead with the elbows to raise the bells out to the sides (horizontal abduction) until upper arms reach about shoulder level. Pause, then lower under control without swinging and repeat.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('48191b99-06fa-4218-b61b-c9b9abd73278', 'Seated Dumbbell Press', '2024-08-29 15:20:32.329274', '2025-11-26 10:06:23.623891', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_dumbbell_press.png', 'Set an adjustable bench to upright (8090). Sit tall with feet planted and back supported. Clean the dumbbells to shoulder level and rotate to a pronated grip with wrists stacked over elbows. Inhale and brace, then press overhead in the scapular plane until biceps are near the ears without shrugging or arching the lower back. Lower under control to about chin/upper-chest level and repeat.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('12221e5c-0208-48fc-8c56-62c266932f74', 'Dumbbell Lateral Raise', '2024-08-29 15:15:51.70192', '2025-11-27 10:15:10.621406', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_lateral_raise.png', 'Select a pair of dumbbells and stand tall with feet shoulder-width. With a neutral grip and a slight bend in the elbows, raise the dumbbells out to your sides in the scapular plane (1530 forward) until your hands reach shoulder heightlead with the elbows, wrists neutral. Avoid shrugging and keep the torso still. Pause briefly, then lower under control to the start and repeat.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('8d2a9df4-af32-4943-b74b-ae901e866b32', 'Close Grip EZ Bar Curl', '2024-08-28 21:12:39.501074', '2025-11-27 14:56:02.08358', 'https://dsikfdo0rac0e.cloudfront.net/example-images/close_grip_ez_bar_curl.png', 'Grasp an EZ bar with a close underhand grip (hands ~1520 cm apart). Stand tall, ribs down, glutes and abs braced; elbows stay near the torso and wrists neutral. Curl the bar under control without swinging or shrugging, squeeze the biceps near the top, then lower slowly to full elbow extension. Keep shoulders quiet and repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('7a933584-128c-4b82-8e5b-5e7312cadfdf', 'One-Arm Cable Front Raise', '2024-08-29 20:55:27.345366', '2025-09-13 13:51:08.071676', '', 'Attach a single-grip handle to a low pulley and select a moderate load. Stand facing away from the stack and grasp the handle with an overhand grip. Step forward to keep tension; feet shoulder-width, ribs down, wrist neutral, slight bend in the elbow. Raise the arm in the sagittal plane to shoulder height without swinging or leaning and avoid shrugging. Pause briefly, then lower under control without letting the stack touch. Repeat for reps and then switch arms.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('b22e5ada-86c1-4104-828b-b7e06a7f5d16', 'Seated Neutral Grip Dumbbell Shoulder Press', '2024-08-29 20:52:10.197207', '2025-09-13 13:51:47.574343', '', 'Set an adjustable bench to 90. Pick up dumbbells with a neutral grip (palms facing in), sit, and knee-kick them to shoulder height. Start with forearms vertical, wrists stacked over elbows, ribs down, and back against the pad. Inhale and press overhead without shrugging, finishing with biceps near ears and elbows extended but not hyperextended. Control the descent to ~90 elbow angle (or slightly below based on comfort), maintain the neutral grip, and repeat for reps.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('ed5db0ac-4343-4e68-a884-d5f84e4020c1', 'Bent Over Low Pulley Rear Delt Fly', '2024-08-29 20:46:11.377576', '2025-09-13 13:54:14.75226', '', 'Set both pulleys to the lowest position and attach single-grip handles. Hinge at the hips (~45) with a neutral spine, feet hip-width, arms hanging under shoulders. Reach across to grab each opposite handle with a neutral grip. With a slight elbow bend, raise the arms out to the sides in line with the rear delts; lead with the upper arm, not the hands. Avoid excessive scapular retraction or shruggingkeep the torso steady and tension on the cables. Pause at shoulder height, then lower under control to maintain constant tension. Repeat for the desired reps.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('b8fa1238-0f58-4daa-ade8-0f8c6fa2d1b1', 'Bent Over Rear Delt Fly (Head on Bench)', '2024-08-29 20:37:21.051883', '2025-09-13 13:54:54.488751', '', 'Set an adjustable bench to ~7080. Hinge at the hips until your forehead rests lightly on the top of the bench; keep a neutral spine and feet hip-width. Hold dumbbells with a neutral grip, arms hanging under the shoulders with a slight elbow bend. Lead with the upper arm and raise the dumbbells out to the sides until roughly shoulder heightavoid shrugging and excessive scapular retraction to keep the load on the rear delts. Pause briefly, then lower under control to maintain tension. Repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('8ca7bf65-0ddb-4c64-ba64-f71f25c85d7c', 'Wide Grip EZ Bar Curl', '2024-08-28 21:13:34.072785', '2025-11-22 14:07:32.738639', 'https://dsikfdo0rac0e.cloudfront.net/example-images/wide_grip_ez_bar_curl.png', 'Grasp an EZ bar with a wider-than-shoulder underhand grip. Stand tall, ribs down, glutes/abs braced, elbows close to your sides and wrists neutral. Curl the bar under control until the forearms are near verticalsqueeze the bicepsthen lower slowly to full elbow extension without swinging or leaning. Keep shoulders down (dont shrug) and repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('7e80becf-491c-4b48-a98a-a36fff26e29c', 'Dumbbell Side Bends', '2024-09-01 12:13:55.734978', '2025-09-13 13:41:47.000536', '', 'This exercise targets the obliques. Stand tall with a shoulder-width stance. Hold one dumbbell in the working hand (or two lighter dumbbells if preferred), palms facing in. Brace your core, keep your ribs down and spine neutral. Without leaning forward/back or rotating, slowly side-bend the torso toward the dumbbell until you feel a stretch on the opposite side. Exhale as you return to upright by contracting the obliques; avoid hiking the hip. Move through the torso only and keep the dumbbell close to your body. Alternate sides or complete all reps on one side. You may also perform this seated on a bench for more stability.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('e1361643-e92a-419b-8eb8-fe2a188016e0', 'Cable Crunch', '2024-09-01 09:37:56.256671', '2025-10-15 21:42:49.174639', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_crunch.png', 'Attach a rope to a high pulley and set an appropriate weight. Kneel facing the stack with shins on the floor and hips resting on your heels. Grip each end of the rope beside your head (elbows tucked). Brace, draw ribs down, and initiate a posterior pelvic tilt (tuck the tailbone). Curl the trunk to bring the sternum toward the pelvis, keeping the hips fixed (dont hinge). Pause briefly, then return under control without letting the rope pull you up. Breathe out as you crunch; keep the neck neutral and avoid pulling with the arms.
INSERT INTO public.exercise_examples VALUES ('fff561d6-3738-4360-a110-f93dcb3c8c10', 'Hammer Strength Bench Press', '2024-09-02 15:21:42.987341', '2025-11-25 19:58:13.799362', 'https://dsikfdo0rac0e.cloudfront.net/example-images/hammer_strength_bench_press.png', 'Set the seat so the handles align with mid-chest. Retract and depress the scapulae, keep a slight arch, wrists neutral. Press the independent arms to full elbow extension without shrugging; lower under control to a comfortable chest stretch. Use a steady tempo (e.g., 23 s down), maintain feet planted and ribcage up to bias the pecs. Best used after barbell/dumbbell presses for higher-rep hypertrophy work.', 'compound', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('d20646b6-efd1-49fc-8ffa-180461aea5ab', 'Smith Machine Upright Row', '2024-08-29 20:48:13.145019', '2025-11-25 21:36:24.815143', 'https://dsikfdo0rac0e.cloudfront.net/example-images/smith_machine_upright_row.png', 'Set the Smith machine bar at mid-thigh height and load plates. Stand tall with a shoulder-width stance and take a grip just outside shoulder width. Unrack by rotating the bar off the hooks. Inhale, brace, and lead with the elbows high and wide as you pull the bar up along the body to about upper-chest/shoulder height (stop if shoulder comfort dictates). Keep wrists neutral and torso steady. Pause briefly, then lower the bar under control to full elbow extension and re-rack as needed. Use a slightly wider grip and moderate range to reduce shoulder impingement risk.', 'compound', 'fixed', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('ac45c513-55f3-437f-a10f-ba3c0763a746', 'Standing Dumbbell Front Raise', '2024-08-29 20:31:23.01677', '2025-11-25 21:51:34.492929', 'https://dsikfdo0rac0e.cloudfront.net/example-images/standing_dumbbell_front_raise.png', 'Choose a pair of dumbbells with a pronated (overhand) grip and stand shoulder-width. Brace your abs, keep a slight bend in the elbows, and raise the arms straight in front until they reach shoulder height (avoid leaning back or swinging). Pause briefly, then lower under control to the start. Keep ribs down, shoulders relaxed (allow natural upward rotation), and move only at the shoulder. Repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('68381c41-b015-4218-93cb-2bcb64bee255', 'One-Arm Standing Dumbbell Front Raise', '2024-08-29 21:09:08.306005', '2025-11-29 16:25:26.674911', 'https://dsikfdo0rac0e.cloudfront.net/example-images/one_arm_standing_dumbbell_front_raise.png', 'Grab a dumbbell with a pronated grip and stand with a shoulder-width stance. Brace your core, keep a slight bend in the elbow and the wrist neutral. Inhale and raise your arm straight in front by moving only at the shoulder until its just above parallel to the floor. Avoid swinging or shrugging the shoulder. Pause briefly at the top, then lower the dumbbell under control to the start without letting it rest on the thigh. Repeat for desired reps and switch arms.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('6e4bc8b2-33ab-46da-9b79-9fff2266cd27', 'Seated Calf Raise', '2024-09-01 12:41:05.640161', '2025-10-16 12:48:44.588946', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_calf_raise.png', 'Sit on the seated calf raise machine with the balls of your feet on the platform (toes forward) and heels hanging off. Position the knee pad on the lower thighs just above the knees. Brace your torso, keep the knees bent ~90 and still. Extend the ankles to release the safety, then lower the heels under control to a comfortable stretch. Drive up by plantarflexing through the ball of the foot; pause 12 s at the top and avoid bouncing. Keep reps slow and controlled; do not let the heels rest on the platform between reps. If you feel pressure in the bottom of the foot or behind the knee, reduce the depth.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('4353173b-93b2-4fb1-b462-fc8330b15ce5', 'Cable Lateral Raise', '2024-08-29 20:20:58.523546', '2025-10-17 13:07:17.475182', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_lateral_raise.png', 'Set both pulleys to a low position and attach single handles. Stand facing away from the machine, grasp the opposite handle with each hand so the cables cross in front of you. Stand tall, brace the core, and keep a slight bend in the elbows. Lead with the elbows to raise the arms out to the sides in the scapular plane until about shoulder height without shrugging; pause, then lower under control to the start.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('a8f9abc7-4515-4f5e-a4f5-095b1b17b9e1', 'Hip Adduction Machine', '2024-08-31 22:01:53.328901', '2025-11-19 11:44:01.741463', 'https://dsikfdo0rac0e.cloudfront.net/example-images/hip_adduction_machine.png', 'Set up seated upright with your back against the pad, spine neutral, and pads resting on the inner thighs just above the knees. Grip the handles and brace your core. Exhale and adduct the hips by squeezing the pads together without leaning back or rocking the pelvis. Pause briefly when the pads meet, then return under control to a comfortable stretch. Keep knees tracking with toes and avoid bouncing. Repeat for the desired reps.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('1b8fe6fc-9ede-4f28-b4a0-30504db61fed', 'Single Arm Cable Lateral Raise (Crossbody)', '2024-08-29 20:26:45.591795', '2025-11-21 22:48:30.497265', 'https://dsikfdo0rac0e.cloudfront.net/example-images/single_arm_cable_lateral_raise_crossbody.png', 'Set the pulley to the lowest setting and attach a single handle. Stand side-on to the stack and reach across with the far hand (neutral grip).
INSERT INTO public.exercise_examples VALUES ('ff2d84fc-ff6d-4637-8128-91c1495c98e8', 'Incline Cable Flys', '2024-09-02 21:04:38.427162', '2025-09-13 13:06:46.314004', '', 'Set an adjustable bench to an incline between dual adjustable pulleys. Attach D-handles, lie supine, keep a slight fixed elbow bend, and sweep the arms up/in over the upper chest; return under control to maintain constant cable tension. Keep scapulae retracted/depressed to bias the upper pecs and avoid turning the movement into a press.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('2780e6d9-a86f-4038-b96f-ef59f961cb4b', 'Cable Chest Press', '2024-09-02 20:42:00.04352', '2025-10-15 21:15:37.684154', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_chest_press.png', 'Stand between dual pulleys set at mid-chest height, attach D-handles, and take a stable split stance. Retract/depress the scapulae, tuck elbows ~4560, and press the handles forward on a horizontal path; finish with slight scapular protraction, then return under control to keep constant cable tension. Keep ribs down and torso still to avoid turning it into a dip or fly.', 'compound', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('3a70ce9c-b1f0-43a7-8775-7d3e7c109c5d', 'Machine Reverse Fly', '2024-08-29 20:18:52.12644', '2025-11-23 13:39:54.931031', 'https://dsikfdo0rac0e.cloudfront.net/example-images/machine_reverse_fly.png', 'Adjust the seat so the handles align with your mid-delts (about shoulder height). Sit facing the pad with chest supported and feet flat. Grasp the handles with a neutral or pronated grip, keep a slight bend in the elbows, wrists neutral, and avoid shrugging. Initiate by leading with the elbows, moving the upper arms in a wide arc (horizontal abduction) until hands are roughly in line with the shoulders; pause briefly, then return under control without letting the shoulders roll forward.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('90b8d661-a9ef-47e5-8c98-b0599874a972', 'Seated Behind the Neck Shoulder Press', '2024-08-29 20:28:36.062554', '2025-11-23 21:49:42.838083', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_behind_the_neck_shoulder_press.png', 'Set the barbell on a rack just below shoulder height and load plates. Place an adjustable bench upright under the bar. Sit, take a pronated grip slightly wider than shoulder width, and unrack with a neutral spine. Inhale, brace, tuck the chin, and lower the bar to the upper traps/back of the neck (only within your available shoulder mobility). Press to lockout while keeping the ribs down and elbows under the bar. Control the descent and repeat for the desired reps.', 'compound', 'free', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('89ffca84-73f0-4a69-871f-9d9c96521a05', 'Toes Out Smith Machine Calf Raise', '2024-09-01 12:54:31.257041', '2025-09-13 13:32:40.391156', '', 'Smith machine standing calf raise with toes externally rotated (~1530). Place a step/block under the bar for more ROM; set the bar across the upper traps, balls of the feet on the edge, heels hanging. Unlock the hooks, keep knees softly extended and hips stacked over ankles. Plantarflex to rise; pause 12 s at the top; lower under control to a comfortable stretch without letting heels rest. Move at the ankles only (no knee bend), maintain steady tempo, avoid bouncing. Toes-out may bias the medial gastrocnemius, though this is debated and individual.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('8a39b1e7-986c-41e7-a0b9-44a4efb46360', 'Reverse Grip Dumbbell Bench Press', '2024-09-02 20:27:53.772919', '2025-09-13 13:13:43.048346', '', 'Lie on a flat bench with a supinated (reverse) grip on dumbbells, wrists straight and forearms vertical. Set scapular retraction and slight depression, feet planted. Lower the bells toward the upper chest/clavicles with elbows tucked ~3045, keeping forearms under the handles. Press to full elbow extension without losing rib cage position; control the tempo and range.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('e1511aa4-1d34-4984-aa54-88f88029a96e', 'Cable Crossovers (Mid Chest)', '2024-09-02 15:03:16.600447', '2025-11-25 22:11:58.650079', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_crossovers_mid_chest.png', 'Set pulleys at roughly shoulder/mid-chest height. Step forward (split stance), depress/retract the scapulae, keep a soft elbow bend, and sweep the hands on a wide arc to meet slightly in front of the sternum. Avoid elbow flexion/extension to minimize triceps; control the eccentric to a comfortable chest stretch. This fly variation emphasizes the mid (sternocostal) pec fibers with some clavicular and anterior deltoid assistance.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('ff20bd08-57ae-465f-aa54-d1ba0f7862a9', 'Push Up', '2024-09-02 20:29:17.383422', '2025-11-21 14:29:04.729186', 'https://dsikfdo0rac0e.cloudfront.net/example-images/push_up.png', 'Set up in a straight-line plank (wrists under shoulders, ribs down, glutes/braced). Lower the chest between the hands keeping elbows ~3045 from the torso and forearms vertical. Maintain neutral neck and packed shoulders; avoid sagging hips. Press the floor away to full lockout with slight protraction at the top. Breathe behind the brace; move in control.', 'compound', 'body_weight', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('21370a0a-b01b-4e32-8f43-8648a54cd35c', 'Pec Dec (Butterfly)', '2024-09-02 15:01:10.954626', '2025-11-22 09:51:07.241352', 'https://dsikfdo0rac0e.cloudfront.net/example-images/pec_dec_butterfly.png', 'Adjust the seat so the handles align with mid-chest. Retract/depress the scapulae, keep a slight bend in the elbows, and bring the forearms together on a wide arc to meet just in front of the sternum. Pause and squeeze the chest, then control the eccentric to a comfortable stretch. Avoid elbow flexion/extension and shrugging to keep the load on the pecs. Primarily targets the sternocostal pec fibers with assistance from the clavicular head and anterior deltoid.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('46b1efa3-a4f8-4492-a81c-9e48c650dd3d', 'Toes In Smith Machine Calf Raise', '2024-09-01 12:52:29.675', '2025-11-23 13:00:08.441338', 'https://dsikfdo0rac0e.cloudfront.net/example-images/toes_in_smith_machine_calf_raise.png', 'Smith machine standing calf raise with toes internally rotated (~1530). Place a step/block under the bar for more ROM; set the bar across the upper traps, balls of the feet on the edge, heels hanging. Unlock the hooks, keep knees softly extended and hips stacked over ankles. Plantarflex at the ankles to rise; pause 12 s at the top; lower under control to a comfortable stretch without letting heels rest. Move only at the ankles (no knee bend), maintain steady tempo, avoid bouncing. Toes-in may bias the lateral gastrocnemius, but evidence is mixed.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('f11c8751-e5ca-413e-b30d-2b387ec14733', 'Toes Out Seated Calf Raise', '2024-09-01 12:56:50.688111', '2025-11-23 13:12:06.25262', 'https://dsikfdo0rac0e.cloudfront.net/example-images/toes_out_seated_calf_raise.png', 'Seated machine calf raise with toes externally rotated (~1530). Place the balls of the feet on the platform (use a block for more ROM), knees ~90 under the pad, spine neutral. Unlock safety, keep knees softly extended (no knee pumping). Plantarflex the ankles to lift the pad; pause 12 s at the top, then dorsiflex under control without letting heels fully rest. Move through the ball of the foot, keep tempo steady. Toes-out biases the medial gastrocnemius; the seated position emphasizes the soleus.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('c5864272-ae27-4363-add6-7ead1b7b3379', 'Reverse Grip Barbell Curl', '2024-09-03 08:32:01.580419', '2025-09-11 18:57:25.854338', '', 'Stand with a shoulder-width pronated (overhand) grip on a barbell. Keep elbows tight to your sides, upper arms still, and wrists neutral (no wrist curling). Flex the elbows to raise the bar until forearms are near vertical, pause, then lower under control to full extension. Avoid swinging, shrugging, or leaning back.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('c2059aab-d7b5-4532-a8a7-ad15a4054b33', 'Standing High to Low Cable Fly', '2024-09-02 21:07:15.394991', '2025-09-13 13:06:03.967447', '', 'Set pulleys high on a dual-cable station, attach D-handles, and take a stable split stance. With a slight fixed elbow bend and scapulae retracted/depressed, sweep the arms down and in toward the hips to bias the lower chest; return under control to keep constant cable tension. Avoid turning it into a press (no elbow extension).', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('f467d244-5568-40f6-bd7a-b3bdcad82398', 'Standing High to Low Cable Fly', '2024-09-02 20:40:09.521144', '2025-09-13 13:09:56.50883', '', 'Set the pulleys high on a dual-cable station and attach D-handles. Take a stable split stance, brace, and keep a slight fixed elbow bend with the scapulae retracted/depressed. Sweep the arms down and in toward the hips to bias the lower chest; pause, then return along the same arc under control. Avoid elbow extension so it stays a fly, not a press.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('b720265e-a3ce-48d3-8e8e-87e05c07b8a3', 'Standing Low to High Cable Fly', '2024-09-02 20:35:21.719463', '2025-09-13 13:11:02.537696', '', 'Set the pulleys at the lowest setting on a dual-cable station and attach D-handles. Take a stable split stance, brace the core, keep a slight fixed elbow bend, and sweep the arms up and in toward upper-chest level; pause, then return along the same arc under control. Maintain scapular retraction/depression and avoid elbow extension so it remains a fly, not a press.', 'isolation', 'fixed', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('3d0c8e76-37a9-4f4c-84fa-47a6a07aaacc', 'Decline Bench Press', '2024-09-02 20:26:26.267059', '2025-11-20 19:50:48.735977', 'https://dsikfdo0rac0e.cloudfront.net/example-images/decline_bench_press.png', 'Set up on a decline bench with a secure foot hold. Retract and depress the scapulae, take a medium grip, and lower the bar toward the lower chest/upper abdomen with elbows at ~45. Touch lightly and press to full elbow extension while keeping the ribcage stacked and glutes in contact with the bench.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('e68781f2-7021-4907-af54-de18b80d181a', 'Decline Push Up', '2024-09-02 20:59:37.517802', '2025-11-20 23:10:32.635662', 'https://dsikfdo0rac0e.cloudfront.net/example-images/decline_push_up.png', 'Place your feet on a flat bench or box (body angled downward), hands slightly wider than shoulder width. Brace the core, keep a straight line from head to heels, retract/depress the scapulae, and lower the chest between the hands with elbows ~45. Press back up, finishing with gentle scapular protraction. Maintain controlled tempo and neutral neck.', 'compound', 'body_weight', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('f2cf498f-d991-4b85-b08e-58c5f9ff563e', 'Hanging Leg Raise', '2024-09-01 12:11:44.128319', '2025-11-22 09:58:31.740071', 'https://dsikfdo0rac0e.cloudfront.net/example-images/hanging_leg_raise.png', 'The hanging leg raise builds the anterior core. Hang from a pull-up bar with a shoulder-width grip, depress the shoulders, and brace the midsection. With legs straight, posteriorly tilt the pelvis (tuck the tailbone) and raise the legs as one unit until they reach at least hip heighthigher if control allows. Pause briefly, then lower under control without swinging. Keep the torso still, ribs down, and avoid using momentum. Advanced lifters can add load by holding a dumbbell between the feet.', 'compound', 'body_weight', 'pull', 'advanced');
INSERT INTO public.exercise_examples VALUES ('be3c01a7-3bd0-448c-844b-583bd824c90b', 'Dumbbell Stiff Leg Deadlift', '2024-09-05 12:54:46.778198', '2025-09-22 19:52:10.769152', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_stiff_leg_deadlift.png', 'Stand with a hip-width stance holding dumbbells in front of the thighs. Brace, keep a neutral spine and soft knees (about 1015). Hinge by pushing the hips back, keeping shins nearly vertical and the dumbbells close to your legs. Lower until you feel a strong hamstring stretch (typically to mid-shin) without rounding. Keep lats tight and shoulders packed. Drive the hips forward to stand tall by contracting hamstrings and glutes; avoid hyperextending the lower back. Control the descent and repeat.', 'compound', 'free', 'hinge', 'beginner');
INSERT INTO public.exercise_examples VALUES ('d806b4f1-399c-4ceb-bb91-663ec0350e6d', 'Reverse Hyperextension', '2024-09-03 11:21:01.336163', '2025-09-22 20:18:32.241504', 'https://dsikfdo0rac0e.cloudfront.net/example-images/reverse_hyperextension.png', 'Set up prone on a reverse hyper or GHD with your hips at the front edge of the pad and legs hanging freely. Grip the handles, brace (ribs down), keep a neutral spine with a slight posterior pelvic tilt. Initiate by squeezing the glutes to extend the hips, raising the legs until your body is roughly in line; avoid lumbar hyperextension and swinging. Pause briefly, then lower under control, allowing a gentle stretch below hip line. Keep knees soft, torso quiet, and breathe/brace each rep. Add ankle straps or a light load only if you can maintain perfect control.', 'isolation', 'body_weight', 'hinge', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('7d823dc8-8303-4ddd-a25d-935569c662b7', 'Hyperextension', '2024-09-03 11:04:13.299536', '2025-09-23 11:50:23.064628', 'https://dsikfdo0rac0e.cloudfront.net/example-images/hyperextension.png', 'Set the pad so the top edge sits at your hip crease and lock your heels into the footplate. Keep a soft knee bend, brace (ribs down, neutral spine), and hinge at the hips to lower the torso under control without rounding the low back. Drive the hips into the pad and extend until your body forms a straight line; squeeze the glutes and avoid lumbar hyperextension. Pause briefly, then descend with a smooth tempo and repeat.', 'isolation', 'body_weight', 'hinge', 'beginner');
INSERT INTO public.exercise_examples VALUES ('b515dd55-701a-45f4-938f-fdb26d2d5cba', 'Seated Cable Wrist Curl', '2024-09-03 09:43:17.728797', '2025-09-23 18:09:21.246105', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_cable_wrist_curl.png', 'Set a low pulley and attach a straight bar. Sit on a flat bench facing the stack with your forearms resting on your thighs or the bench and wrists hanging past the edge, palms up. Grip shoulder-width with thumbs wrapped. Keep elbows and forearms fixed, shoulders relaxed. Lower by allowing controlled wrist extension, then curl the bar by flexing the wrists until it nears the forearms. Pause, avoid shoulder/hip motion and ulnarradial deviation, and use a smooth full range of motion.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('60bd8dbc-6bb8-4be0-9ee7-f4c5a295c5b4', 'Reverse Grip Preacher Curl (EZ Bar)', '2024-09-03 09:39:30.846405', '2025-09-24 09:15:17.262192', 'https://dsikfdo0rac0e.cloudfront.net/example-images/reverse_grip_preacher_curl_ez_bar.png', 'Set the preacher bench so your upper arm is fully supported and the armpit meets the top of the pad. Grip an EZ bar with a shoulder-width reverse (pronated) grip on the angled segments. Lock the upper arm to the pad, brace the core, and keep wrists neutral. From full elbow extension, flex the elbows to raise the bar without letting the shoulders roll forward; pause near the top, then lower under control to full extension without bouncing. Avoid wrist curling and torso sway to keep tension on the elbow flexors and forearms.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('8324ae75-08e9-48de-a00b-55d229085712', 'Standing Hammer Curl', '2024-08-27 20:02:25.685377', '2025-11-22 10:56:19.557104', 'https://dsikfdo0rac0e.cloudfront.net/example-images/standing_hammer_curl.png', 'Stand tall with feet hip-width, core braced. Hold dumbbells at your sides with a neutral grip (palms facing in), shoulders down and elbows tucked. Without swinging or leaning back, curl by flexing the elbows until forearms are near vertical; keep wrists neutral throughout. Squeeze briefly at the top, then lower under control to full extension while maintaining tension. Repeat for reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('b53daf0a-c7b6-4be8-9230-b33695eb5340', 'Seated Reverse Barbell Wrist Curl', '2024-09-03 09:38:26.916652', '2025-09-24 14:37:34.730996', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_reverse_barbell_wrist_curl.png', 'Sit on a flat bench with your forearms resting on your thighs or the bench, wrists just past the edge so they can move freely. Grip a barbell shoulder-width with a pronated (palms-down) grip. Fix the elbows and forearms; only the wrists move. Start with the wrists flexed (bar lowered), then extend the wrists to raise the bar; pause, and lower under control to a full stretch without letting the bar roll from your hands. Keep shoulders relaxed and avoid elbow lift or torso sway.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('f4041256-a9ac-430d-b611-d8a957e2aeb0', 'Straight Arm Lat Pulldown', '2024-09-06 11:10:17.447399', '2025-09-21 20:44:17.992831', 'https://dsikfdo0rac0e.cloudfront.net/example-images/straight_arm_lat_pulldown.png', 'Attach a straight bar to a high cable and stand tall with a slight hip hinge. Grip the bar pronated at shoulder width. Keep the elbows softly bent and fixed (no elbow flexion). Initiate by depressing the shoulder blades, then extend the shoulders to sweep the bar in an arc down to your thighs. Pause, keep ribs down, and return overhead under control without shrugging or extending the lower back.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('bb9c756b-0c9e-4e87-826f-bb2cbd16d86b', 'Dumbbell Wrist Curl (Over Bench)', '2024-09-03 09:30:01.935018', '2025-10-02 18:51:56.590805', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_wrist_curl_over_bench.png', 'Sit on a flat bench and rest your forearm on the bench or thigh with the palm up (supinated), wrist just past the edge. Hold a dumbbell, keep the elbow fixed and shoulder relaxed. Lower into a full stretch by extending the wrist, then curl by flexing the wrist and briefly pausing at the top. Avoid elbow flexion, forearm rotation, or swinging to keep tension on the wrist flexors.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('676f21e5-7b5a-4c11-a505-4545822673de', 'Trap Bar Romanian Deadlift', '2024-09-05 13:42:24.371375', '2025-09-22 08:58:49.939606', 'https://dsikfdo0rac0e.cloudfront.net/example-images/trap_bar_romanian_deadlift.png', 'Stand inside the trap bar with a hip-width stance and neutral grip. Deadlift to the top (hips/knees locked). Brace, keep a neutral spine and soft knees, then push the hips back to hinge while keeping the handles close and shins nearly vertical. Lower to just below knee height or until strong hamstring tensionno lumbar rounding. Keep lats tight, drive through the whole foot, extend the hips by squeezing the glutes to return to the start without hyperextending. Control the descent and repeat.', 'compound', 'free', 'hinge', 'beginner');
INSERT INTO public.exercise_examples VALUES ('f11ef4dd-cc6b-42ad-844d-0e94cef691f0', 'Glute Ham Raise', '2024-09-05 13:38:49.26673', '2025-09-22 09:17:45.842022', 'https://dsikfdo0rac0e.cloudfront.net/example-images/glute_ham_raise.png', 'Set up on a GHR/GHD with knees bent, hips extended, and torso upright. Brace, keep a neutral spine, and maintain hip extension throughout. Extend the knees until the body is straight and parallel to the floor; pause. Return by flexing the knees while keeping the hips open (no lumbar hyperextension). Move under control; avoid swinging.', 'isolation', 'body_weight', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('ca38bcba-658f-4c7a-be54-b2c3f845fbe0', 'Sumo Deadlift', '2024-09-05 13:37:08.596231', '2025-09-22 09:29:34.259024', 'https://dsikfdo0rac0e.cloudfront.net/example-images/sumo_deadlift.png', 'Set a wide (sumo) stance with toes turned out and the bar over mid-foot. Grip the bar shoulder-width with a double overhand inside the knees. Brace, keep a neutral spine, push the knees out, and wedge the hips toward the bar with lats tight. Drive the floor away as you extend the knees and hips, keeping the bar close on a near-vertical path. Stand tall to lock out by squeezing the glutes (no lumbar hyperextension), then hinge back to lower under control.', 'compound', 'free', 'hinge', 'beginner');
INSERT INTO public.exercise_examples VALUES ('379d64cd-24bf-4a81-9b97-936c9a088e17', 'Trap Bar Deadlift', '2024-09-05 13:12:38.899013', '2025-09-22 11:03:54.452469', 'https://dsikfdo0rac0e.cloudfront.net/example-images/trap_bar_deadlift.png', 'Stand inside the trap bar with a hip-width stance and grab the neutral handles. Brace your core, set a neutral spine and pelvis, and pull the slack out of the bar. Find mid-foot pressure with chest up and lats tight. Drive the floor away by extending knees and hips together, keeping the load centered over the foot. Stand tall without overextending the lower back, then return the bar under control by hinging at the hips and bending the knees. Reset your brace and repeat.', 'compound', 'free', 'hinge', 'beginner');
INSERT INTO public.exercise_examples VALUES ('b35c5710-3c80-4f48-8ee4-295e5a15999f', 'Reverse Grip Cable Curl', '2024-09-03 09:34:29.268873', '2025-10-01 12:25:31.059426', 'https://dsikfdo0rac0e.cloudfront.net/example-images/reverse_grip_cable_curl.png', 'Attach a straight bar to a low pulley. Stand tall, take a shoulder-width reverse (pronated) grip, lock elbows to your sides, keep shoulders down and wrists neutral. Curl by flexing the elbows until the bar reaches mid-chest, squeeze briefly, then lower under control to full elbow extension. Avoid swinging, shrugging, or flexing/overextending the wrists to keep tension on the elbow flexors and forearms.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('7545289f-f7c8-456b-98e9-f7b15600254c', 'Seated Reverse Dumbbell Wrist Curl', '2024-09-03 09:32:06.540342', '2025-10-02 18:00:37.581437', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_reverse_dumbbell_wrist_curl.png', 'Sit on a flat bench with forearms supported on your thighs/bench, palms down (pronated) and wrists just past the edge. Hold dumbbells lightly, keep elbows still and shoulders relaxed. Extend at the wrists to lift the backs of your hands, pause, then lower under control to a full stretch. Avoid elbow flexion, swinging, or supination to keep tension on the forearm extensors.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('10870aab-3086-462e-a64e-14710e3fbffe', 'One-Arm Seated Dumbbell Wrist Curl', '2024-09-03 09:28:24.986138', '2025-10-02 18:59:13.848491', 'https://dsikfdo0rac0e.cloudfront.net/example-images/one_arm_seated_dumbbell_wrist_curl.png', 'Sit on a flat bench and work one arm at a time. Rest the forearm on the bench or thigh with the palm up (supinated) and the wrist just beyond the edge. Hold a dumbbell, keep the elbow fixed and shoulder relaxed. Lower into wrist extension under control, then flex the wrist to curl the weight, pausing briefly at peak. Avoid elbow flexion, forearm rotation, or swinging to keep tension on the wrist flexors. Unilateral execution helps address side-to-side imbalances.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('d59d340d-774d-4c81-8b3d-251175936221', 'Reverse Grip Barbell Wrist Curl (Over Bench)', '2024-09-03 09:26:50.08384', '2025-10-02 19:06:23.161318', 'https://dsikfdo0rac0e.cloudfront.net/example-images/reverse_grip_barbell_wrist_curl_over_bench.png', 'Sit on a flat bench and rest your forearms on the bench or thighs with a pronated (reverse) grip. Let the wrists hang just beyond the edge. Keeping elbows fixed and shoulders relaxed, extend the wrists to raise the back of the hands, then lower under control through full range. Avoid elbow flexion or swinging to keep tension on the wrist extensors. The bench support increases stability and focus on the forearm muscles.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('13826a3e-6b12-464c-95c8-5790f0e13947', 'Reverse Grip Bent-Over Dumbbell Row', '2024-09-07 15:16:24.597402', '2025-09-18 13:42:30.373116', 'https://dsikfdo0rac0e.cloudfront.net/example-images/reverse_grip_bent_over_dumbbell_row.png', 'A free-weight pulling row with a supinated (underhand) grip that biases the lower lats while recruiting the mid/upper back and biceps. Select dumbbells, hinge at the hips with a neutral spine and slight knee bend, and let the weights hang just below knee height. Keep elbows close to the torso and pull toward the lower ribs/upper stomach while retracting and depressing the shoulder blades. Pause briefly, then lower under control without shrugging or using leg/hip drive.', 'compound', 'free', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('baa3f656-0ad7-422b-ba8b-e5e9f5d4cd63', 'Seated Cable Row', '2024-09-07 15:06:50.255195', '2025-09-18 19:32:34.630165', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_cable_row.png', 'The seated cable row is a compound back exercise performed on a cable row station.
INSERT INTO public.exercise_examples VALUES ('950cd0cd-fc3b-442f-aba9-3c48bfc6cda9', 'Bent Over Barbell Row', '2024-09-07 15:00:25.3268', '2025-09-18 19:37:56.32144', 'https://dsikfdo0rac0e.cloudfront.net/example-images/bent_over_barbell_row.png', 'Stand with a barbell using a double overhand (pronated) grip. Hinge forward until your torso is nearly parallel to the floor, keep a neutral spine and braced core, and let the shoulders protract slightly. Initiate by depressing/retracting the shoulder blades, then drive the elbows behind the body to pull the bar toward the lower ribs/belly button without shrugging. Pause and squeeze, then lower under control to a full stretch. Avoid torso swing or lumbar extension; keep the bar close throughout.', 'compound', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('c1ca2c25-9148-4977-99fe-3acda0b4ad33', 'One Arm Dumbbell Row', '2024-09-07 14:58:48.633749', '2025-09-18 19:41:15.3318', 'https://dsikfdo0rac0e.cloudfront.net/example-images/one_arm_dumbbell_row.png', 'Stand holding one dumbbell with a neutral grip. Hinge until your torso is near parallel to the floor, keep a neutral spine, square the hips/shoulders, and brace the core. Initiate by depressing/retracting the working-side shoulder blade, then drive the elbow behind the body to pull the dumbbell toward the lower ribs/hip without shrugging or rotating. Pause and squeeze, then lower under control to a full stretch. Optionally brace the free hand on a flat bench or rack for stability.', 'compound', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('85a317d2-6cf2-4155-a6ea-a271afc4a803', 'Behind Neck Lat Pulldown', '2024-09-06 21:35:46.021334', '2025-09-19 10:55:01.191476', 'https://dsikfdo0rac0e.cloudfront.net/example-images/behind_neck_lat_pulldown.png', 'Attach a wide-grip lat bar to the pulldown. Sit with thighs locked, torso tall with a slight forward lean, and take a pronated grip wider than shoulders. Initiate by depressing and retracting the shoulder blades, then pull the bar behind the head toward the upper traps without craning the neck or flaring the ribs. Pause and squeeze, then return the bar overhead under control. Use a pain-free range and adequate shoulder external-rotation mobility; stop short of any discomfort.', 'compound', 'fixed', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('c25a5f07-d65f-4ba9-9b0d-cb4d5b426455', 'Close Grip Handle Pulldown', '2024-09-06 21:31:44.423014', '2025-09-19 17:22:57.99747', 'https://dsikfdo0rac0e.cloudfront.net/example-images/close_grip_handle_pulldown.png', 'Attach a close-grip handle (triangle) to the lat pulldown and sit with thighs secured. Take a neutral grip, keep the torso tall with a slight forward lean, and initiate by depressing/retracting the shoulder blades before bending the elbows. Pull the handle to the upper chest until elbows align with the torso, pause, then return overhead under control without shrugging or leaning back. Keep ribs down and avoid using momentum.', 'compound', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('e84c6031-9d71-41a1-ae2c-6c9901ea1d6b', 'Wide Grip Lat Pulldown', '2024-09-06 21:22:25.300036', '2025-09-19 18:32:05.136424', 'https://dsikfdo0rac0e.cloudfront.net/example-images/wide_grip_lat_pulldown.png', 'Attach a wide-grip bar to the lat pulldown machine and sit tall with feet planted. Grasp the bar with a pronated (overhand) grip wider than shoulder width. Brace, hinge slightly at the hips without leaning back, depress the shoulder blades, then drive the elbows down and out to pull the bar to the upper chest (not behind the neck). Pause and squeeze, then return overhead under control without shrugging or swinging.', 'compound', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('9b3f9b20-544d-49e1-880e-879e24e81581', 'Dumbbell Hamstring Curl', '2024-09-05 13:08:00.578297', '2025-09-22 15:28:01.572486', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_hamstring_curl.png', 'Optionally elevate a flat bench to increase range of motion. Lie face down with hips extended and knees at the bench edge. Secure a dumbbell between the arches of your feet and squeeze to hold it. Brace your core, keep the pelvis neutral, and keep hips down on the pad.
INSERT INTO public.exercise_examples VALUES ('b5c6e6a6-6eec-422c-ad4a-8dca82287312', 'Romanian Deadlift (RDL)', '2024-09-05 13:06:37.160782', '2025-09-22 15:34:36.962569', 'https://dsikfdo0rac0e.cloudfront.net/example-images/romanian_deadlift.png', 'Position the bar over mid-foot (shoelaces) and take a hip-width stance. Grip double-overhand just outside hip width and deadlift the bar to the start with hips and knees locked. Soften the knees slightly, brace, keep a neutral spine, and push the hips back to hinge while keeping the bar close (slides along thighs) and shins nearly vertical. Lower until you feel strong hamstring tension or the bar is just below the kneesno lumbar rounding. Drive through the whole foot to extend the hips, stand tall without hyperextending, briefly pause, then repeat. Control the descent and re-brace each rep.', 'compound', 'free', 'hinge', 'beginner');
INSERT INTO public.exercise_examples VALUES ('f451289a-6d35-4926-981d-8ebae71741a2', 'Cable Shrug', '2024-09-07 20:22:58.464988', '2025-09-17 19:55:41.619238', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_shrug.png', 'Set the cable to the lowest pulley and attach single handles. Stand tall with arms straight, wrists neutral, and the ribcage stacked over the pelvis. Raise the shoulders straight up toward the ears by contracting the upper traps (no elbow bend, no shoulder roll), pause 12 s at the top, then lower under control to a full stretch while keeping the head neutral and core braced. Use a load that allows smooth, vertical scapular elevation through the full range.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('cae7b841-a7f8-4973-baf0-4aadbbdcd0ca', 'Smith Machine Shrug', '2024-09-07 20:20:03.750749', '2025-09-17 20:06:09.476281', 'https://dsikfdo0rac0e.cloudfront.net/example-images/smith_machine_shrug.png', 'Set the safeties, stand with feet shoulder-width, and grasp the Smith bar with an overhand grip. Brace the core, keep arms straight, and elevate the shoulders straight up toward the ears (no rolling). Pause 12 s at the top, then lower under control to a full stretch while keeping the neck neutral and elbows extended.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('5de5124e-8ebb-4477-b4b3-e1122cc80496', 'Dumbbell Shrugs', '2024-09-07 20:10:41.915207', '2025-09-17 20:15:55.241754', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_shrugs.png', 'Stand tall with a dumbbell in each hand at your sides. Keep arms straight, neck neutral, and raise your shoulders straight up toward your ears by contracting the traps. Pause briefly at the top, then lower slowly under control. Avoid rolling the shoulders or using momentum to maintain trap emphasis.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('6bb0675d-eba0-496c-bd20-5fd11a4a0282', 'Reverse Grip Incline Bench Barbell Row', '2024-09-07 20:04:30.711798', '2025-09-17 20:32:34.237755', 'https://dsikfdo0rac0e.cloudfront.net/example-images/reverse_grip_incline_bench_barbell_row.png', 'Set an incline bench to ~30 and lie prone with the chest and hips anchored. Take a shoulder-width underhand (supinated) grip, keep elbows tucked, shoulders down and back, and pull the bar toward the lower chest/upper ribs. Squeeze the back at the top, then lower under control to a full stretch. Avoid shrugging or excessive neck extension; the chest-supported setup reduces lower-back strain while emphasizing the lats.', 'compound', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('abe543c6-ec69-49ad-b9ca-ef959ffa10f2', 'Seated Dumbbell Shrug', '2024-09-07 20:18:56.606676', '2025-10-19 19:23:56.93994', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_dumbbell_shrug.png', 'Sit tall on a flat bench holding a dumbbell in each hand at your sides. Brace the core, keep arms straight and neck neutral, then elevate the shoulders straight up toward the ears (no rolling). Pause 12 s at the top and lower slowly to a full stretch, avoiding elbow bend or leaning back.
INSERT INTO public.exercise_examples VALUES ('77aa5752-a586-4dfe-b69d-4da16fff0b79', 'Seated Dumbbell Lateral Raise', '2024-08-29 15:30:57.598844', '2025-11-26 10:29:30.768679', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_dumbbell_lateral_raise.png', 'Sit on the edge of a flat bench with feet planted and a neutral grip on each dumbbell. Keep a soft bend in the elbows, wrists neutral, and torso still. Lead with the elbows to raise the bells out to the sides in the scapular plane until arms are about parallel to the floor without shrugging. Pause briefly, then lower under control to the start and repeat.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('6da53baf-d357-4392-927f-7da1bf7449dc', 'Incline Bench Barbell Row', '2024-09-07 20:02:52.933304', '2025-09-17 20:34:03.733043', 'https://dsikfdo0rac0e.cloudfront.net/example-images/incline_bench_barbell_row.png', 'Set an incline bench to ~30 and lie prone with the chest supported. Take a wide overhand (pronated) grip, keep a neutral head and ribs down, depress/retract the shoulder blades, and row the bar toward the lower chest/upper ribs leading with the elbows. Pause and squeeze between the shoulder blades, then lower under control to a full stretch. Avoid shrugging or jerking; the chest support minimizes lower-back strain.', 'compound', 'free', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('7976a83a-f4db-4cc5-9cac-7f16f2bc430f', 'Seated Row (Rope Extension)', '2024-09-07 19:58:28.333853', '2025-09-17 21:10:38.60127', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_row_rope_extension.png', 'Attach a rope to a low cable row. Sit tall with a neutral spine, feet braced, and a slight hip hinge. Grip the rope with a neutral grip, set the shoulders by depressing/retracting the scapulae, then pull toward the mid-section (navel/low ribs) while spreading the rope ends apart. Pause and squeeze the shoulder blades together, then return under control to a full stretch without rounding the back. Avoid shrugging or excessive torso lean.', 'compound', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('8cccb149-8553-494d-bcb5-ffa9b06e7c0f', 'Pendlay Row', '2024-09-07 19:54:36.108775', '2025-09-18 08:48:30.364305', 'https://dsikfdo0rac0e.cloudfront.net/example-images/pendlay_row.png', 'A strict bent-over row from a dead stop on the floor to build explosive pulling strength and upper-back development. Set the bar over mid-foot, hinge until the torso is nearly parallel to the floor, brace, and keep a flat back. Grip double overhand and pull explosively toward the lower chest/upper stomach while retracting the shoulder blades; elbows track roughly 4560. Lower under control back to the floor and let the plates settle before the next rep. Avoid using hip extension or torso rise for momentum.', 'compound', 'free', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('0be1c49c-d742-4881-b014-360bc297af34', 'Reverse Grip Bent Over Row', '2024-09-07 19:52:35.860933', '2025-09-18 09:02:34.161415', 'https://dsikfdo0rac0e.cloudfront.net/example-images/reverse_grip_bent_over_row.png', 'A compound pulling row with an underhand grip that shifts emphasis to the lower lats and biceps while the rhomboids and midlower traps handle scapular retraction. Stand about shoulder-width, hinge at the hips with a neutral spine until the bar hangs below the knees, brace, and keep the torso angle fixed. Pull the bar toward the lower chest/upper stomach, tucking elbows close and squeezing the shoulder blades; pause briefly, then lower under control without shrugging or using hip drive.', 'compound', 'free', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('3488eaaa-a999-43c5-acd6-b177b8a3df8a', 'Dumbbell Flys', '2024-09-02 14:08:08.34696', '2025-11-18 18:29:51.856972', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_flys.png', 'Isolation movement for the chest: lie on a flat bench, slight elbow bend (~1530) maintained throughout, palms facing each other. Lower arms in a wide arc until upper arms are near shoulder line (no overstretch), keep scapulae retracted/depressed, neutral wrists; bring the dumbbells together over the chest by horizontal adduction. Control tempo and range to minimize shoulder strain.', 'isolation', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('cbb152c0-ba9c-47ea-a8a3-28ad88f56eb6', 'Smith Machine Bent-Over Row', '2024-09-07 15:29:18.453486', '2025-09-18 09:13:47.74879', 'https://dsikfdo0rac0e.cloudfront.net/example-images/smith_machine_bent_over_row.png', 'A compound pulling row on a fixed bar path that targets the lats, rhomboids, and midlower traps with added machine stability. Stand facing the bar, grip overhand slightly wider than shoulder-width, unlock, and hinge to ~3045 with a neutral spine and braced core. Keep shins vertical, bar over midfoot, and torso angle fixed. Drive elbows back to pull the bar toward the lower chest/upper stomach, squeeze the shoulder blades, pause briefly, then lower under control without shrugging or using hip drive.', 'compound', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('eaf575b3-2cb6-45a3-914f-81838c4c7e4d', 'Rope Straight Arm Pulldown', '2024-09-06 21:28:12.837801', '2025-09-19 17:03:31.465717', 'https://dsikfdo0rac0e.cloudfront.net/example-images/rope_straight_arm_pulldown.png', 'Attach a rope to a high cable stack and stand a half-step back. Take a neutral grip, set a slight hip hinge with soft knees, and brace your core. Keep elbows straight or slightly flexed (fixed). Initiate by depressing the shoulder blades, then extend the shoulders to sweep the rope down in an arc to the thighs/hip crease. Pause, then return overhead under control without shrugging, bending the elbows, or extending the lower back.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('978f906a-8584-4cdf-9d7f-f96d60865e3b', 'Dumbbell Squat', '2024-09-07 20:36:12.342466', '2025-09-17 10:59:51.368633', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_squat.png', 'Hold a pair of dumbbells at your sides with a neutral grip, shoulders packed, feet about shoulder-width. Brace the core, keep the chest tall and spine neutral. Sit the hips down and slightly back, letting the knees track over the toes, until thighs reach parallel (or lower as mobility allows). Drive up through the whole foot without bouncing or forcefully locking the knees. Keep the bells close to the body and avoid knee valgus throughout.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('a4bf88ee-8865-4b1f-88a3-28cf59d28739', 'Zercher Squat', '2024-09-08 11:51:56.624377', '2025-09-16 20:27:00.798319', 'https://dsikfdo0rac0e.cloudfront.net/example-images/zercher_squat.png', 'Hold a barbell in the crook of your elbows (Zercher), brace the core, keep the torso relatively upright, and squat to depth with knees tracking over toes. The front-loaded position increases quadriceps demand; glutes and adductors assist hip extension and frontal-plane control; the core stabilizes; biceps/forearms support the cradle hold; hamstrings act mainly eccentrically; calves stabilize the ankle.
INSERT INTO public.exercise_examples VALUES ('a40b23bf-bd6d-41d0-adbe-254bce002c2d', 'Wide Hack Squat', '2024-09-08 11:48:44.494903', '2025-09-16 20:32:41.835866', 'https://dsikfdo0rac0e.cloudfront.net/example-images/wide_hack_squat.png', 'Set up on the hack squat machine with a wider-than-shoulder stance and toes slightly turned out. Keep the torso braced against the back pad, descend until hips are below knees, and drive through mid-foot/heel to stand. Wide stance shifts emphasis toward inner quads and increases adductor/glute contribution while the machine reduces stabilization demands.
INSERT INTO public.exercise_examples VALUES ('1e51b837-215d-4069-9d14-c9510c1b1b61', 'Smith Machine Lunge', '2024-09-07 21:02:58.920827', '2025-09-17 09:02:06.849769', 'https://dsikfdo0rac0e.cloudfront.net/example-images/smith_machine_lunge.png', 'A unilateral lunge performed on a Smith machine. Set feet in a split stance under the bar, keep the bar path vertical over the mid-foot, brace the core, and descend until the back knee nears the floor; drive through the whole front foot to stand. The fixed bar path lowers global stabilization while the unilateral setup increases frontal-plane control demands. Quadriceps are primary; glutes and adductors assist hip extension and pelvis control; hamstrings act mainly eccentrically; calves and core stabilize.
INSERT INTO public.exercise_examples VALUES ('5ab252b3-204d-4846-80e8-a7629f2d2e25', 'Frog Squat', '2024-09-07 20:56:42.175068', '2025-09-17 09:10:31.730611', 'https://dsikfdo0rac0e.cloudfront.net/example-images/frog_squat.png', 'Bodyweight squat with a wider stance and toes slightly turned out. Drop hips between the knees while keeping the chest up and spine neutral; elbows can gently press against the inner knees to encourage knee tracking. Descend under control to a comfortable depth and stand by driving through the mid-foot/heel. Emphasizes knee flexion (quadriceps) with notable adductor/glute contribution; hamstrings act mainly eccentrically; calves and core stabilize.
INSERT INTO public.exercise_examples VALUES ('4da455c2-c154-4da7-b9c5-6195bd137eec', 'Dumbbell Goblet Squat', '2024-09-07 20:38:40.685439', '2025-09-17 10:56:21.858924', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_goblet_squat.png', 'Hold a dumbbell vertically against the chest in a goblet position with elbows tucked. Stand shoulder-width, brace the core, keep the torso tall, and let the knees track over the toes. Descend by sitting between the hips to at least thighs-parallel (or lower as mobility allows) while keeping heels down and a neutral spine. Drive up through the mid-foot/heel without bouncing or forcefully locking the knees; keep the weight close to the chest throughout.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('ddaf509f-3c99-437c-b872-a4651a91601f', 'Behind-The-Back Barbell Wrist Curl', '2024-09-03 08:33:21.446664', '2025-10-03 09:31:05.387451', 'https://dsikfdo0rac0e.cloudfront.net/example-images/behind_the_back_barbell_wrist_curl.png', 'Stand tall holding a barbell behind your hips with a shoulder-width overhand grip. Keep elbows straight but not locked, shoulders down, and torso still. Let the wrists extend under control, then flex to curl the bar up using the forearm flexors only; avoid elbow bending or shrugging. Pause briefly and lower through a full range of motion.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('7b006564-2c61-4661-ab8c-d4cf60fdb3ed', 'Smith Machine Squat', '2024-09-07 21:00:33.453044', '2025-09-17 09:05:29.937508', 'https://dsikfdo0rac0e.cloudfront.net/example-images/smith_machine_squat.png', 'A barbell squat performed on a Smith machine. Stand with feet under the bar, brace the core, descend to at least parallel keeping a tall torso and knees tracking with toes; drive through the whole foot to stand. The fixed bar path reduces global stabilization and keeps the pattern more knee-dominant (quadriceps). Glutes assist hip extension; hamstrings contribute mainly eccentrically; adductors and calves aid stability; core and upper back support the bar.
INSERT INTO public.exercise_examples VALUES ('ad76d69c-5e90-4643-b507-9e9226d8b5cd', 'Trap Bar Shrug', '2024-09-07 20:21:09.839764', '2025-09-17 20:00:58.679719', 'https://dsikfdo0rac0e.cloudfront.net/example-images/trap_bar_shrug.png', 'Stand inside the trap bar with feet hip-width and a neutral grip. Brace the core, keep arms straight, and elevate the shoulders straight up toward the ears (no rolling). Pause 12 s at the top, then lower under control to a full stretch while keeping the neck neutral and elbows extended.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('24c43903-d3a7-4a39-9231-5bc7d5cec5da', 'Dumbbell Split Squat', '2024-09-07 20:54:24.859554', '2025-09-17 09:22:55.919513', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_split_squat.png', 'Hold dumbbells at your sides, set a stable split stance, brace the core, and descend under control until the back knee nears the floor; drive through the whole front foot to stand. Quadriceps are primary; glutes assist hip extension; hamstrings contribute mainly eccentrically; adductors/abductors aid frontal-plane control; calves and core stabilize.
INSERT INTO public.exercise_examples VALUES ('395bb56a-d4af-4f4a-abb3-51a9ef1dc686', 'Wide Stance 45 Degree Leg Press', '2024-09-08 11:47:42.803848', '2025-09-16 20:37:58.710561', 'https://dsikfdo0rac0e.cloudfront.net/example-images/wide_stance_45_degree_leg_press.png', 'Set up on a 45 leg press with a wider-than-shoulder stance and toes slightly turned out. Keep hips and low back on the pad, descend until thighs approach parallel to the platform, and drive through mid-foot/heel to extend the knees. Wide stance increases inner-thigh (adductor/vastus medialis) involvement while the machine reduces overall stabilization demands.
INSERT INTO public.exercise_examples VALUES ('4dc80274-2d3e-482e-a736-9f9399330c76', 'Machine Hack Squat', '2024-09-07 20:50:37.219599', '2025-09-17 10:40:37.134449', 'https://dsikfdo0rac0e.cloudfront.net/example-images/machine_hack_squat.png', 'Set feet shoulder-width on the hack platform, toes slightly out, and keep hips/back flat against the pad. Brace, descend by bending knees while allowing knees to track over toes, then drive through the mid-foot/heel to stand without locking out hard. Keep ribs down, neutral spine, and full foot contact. Primary emphasis is on the quadriceps; glutes and adductors assist hip extension and frontal-plane control; hamstrings contribute minimally (mostly co-contraction), while calves and abs stabilize.', 'compound', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('88baf661-c550-4ecd-b15a-0d1ca4d41116', 'One Leg Dumbbell Squat (AKA Dumbbell Bulgarian Split Squat)', '2024-09-07 20:44:02.278455', '2025-09-17 10:46:56.411635', 'https://dsikfdo0rac0e.cloudfront.net/example-images/one_leg_dumbbell_squat.png', 'Rear foot elevated on a bench (laces down) in a split stance. Hold dumbbells at the sides with a neutral grip. Brace, descend on the front leg until the back knee approaches the floor, keeping the front knee tracking over toes, pelvis level, and full-foot pressure. Minimize push-off from the rear leg; drive through the mid-foot/heel to stand while maintaining hipkneeankle alignment. Primary emphasis is on the quadriceps; glutes and adductors assist hip extension and frontal-plane control; hamstrings co-contract; calves and abdominals stabilize; forearms support the grip.', 'compound', 'free', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('10f8ff0e-38c6-465d-b99a-26c4026d22c6', 'Leg Extension', '2024-09-07 20:42:37.44943', '2025-09-17 10:50:22.062122', 'https://dsikfdo0rac0e.cloudfront.net/example-images/leg_extension.png', 'Set up on the leg extension machine with the seat depth adjusted so your knees align with the machines pivot/axis. Position the back pad to maintain a neutral spine and place the shin pad just above the ankles. Grip the handles, keep hips and glutes anchored to the seat, dorsiflex the ankles, and extend the knees to fully contract the quadriceps without forcefully locking out. Pause briefly, then lower the weight under control (slightly slower on the way down) while keeping the pelvis level and avoiding momentum.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('21d5ce50-6ffa-44d9-869f-abcfeb518018', 'Dumbbell Goblet Split Squat', '2024-09-08 11:56:12.840633', '2025-09-16 20:12:22.640404', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_goblet_split_quat.png', 'Hold one dumbbell vertically at chest level (goblet). Take a long split stance with the front foot flat and torso upright. Descend until the back knee approaches the floor, keeping the front knee tracking over the toes. Drive through the whole front foot to stand. Primary emphasis is on the quadriceps; glutes and adductors assist in hip extension and frontal-plane control; hamstrings act mainly eccentrically; calves and core stabilize; the anterior deltoid supports the goblet hold.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('ea89fe55-c50f-4bbf-acc1-96e7df46101a', 'One Leg 45 Degree Leg Press', '2024-09-08 11:42:23.510138', '2025-09-16 20:56:23.808987', 'https://dsikfdo0rac0e.cloudfront.net/example-images/one_leg_45_degree_leg_press.png', 'Use one foot centered on the 45 leg press platform. Keep hips/pelvis square to the pad, brace the core, and track the knee over the toes. Lower under control to ~90 knee flexion and press through the mid-foot/heel. Unilateral setup increases frontal-plane control demands (glute medius/adductors) while quadriceps remain the primary driver; glutes/hamstrings assist hip extension; calves stabilize the ankle.
INSERT INTO public.exercise_examples VALUES ('4ef87c39-b004-4c4c-82a8-ddd0338de8c8', 'Smith Machine Front Squat', '2024-09-08 11:38:55.940763', '2025-09-17 08:58:26.686075', 'https://dsikfdo0rac0e.cloudfront.net/example-images/smith_machine_front_squat.png', 'A front-loaded squat performed on a Smith machine. Keep an upright torso, brace the core, and let the knees track over the toes as you descend to depth; drive through the mid-foot to stand. The fixed bar path lowers global stabilization demands and keeps emphasis on knee extension (quadriceps). Glutes assist hip extension; hamstrings contribute mainly eccentrically; calves and core stabilize; upper back (rhomboids) supports the front rack.
INSERT INTO public.exercise_examples VALUES ('64406a09-56a6-43da-9329-ff0fb0d83e4f', '45-Degree Leg Press', '2024-09-07 20:41:37.047377', '2025-09-17 10:53:09.354676', 'https://dsikfdo0rac0e.cloudfront.net/example-images/45_degree_leg_press.png', 'Sit with hips and low back firmly on the pad and place your feet shoulder-width on the sled (toes slightly out if comfortable). Unlock the safeties with soft knees, brace, and lower the sled under control until the knees reach about 90 of flexion (thighs near parallel to the sled) without the pelvis rolling off the pad. Drive through the mid-foot/heel to extend the knees and hips, keeping the knees tracking over the toes. Avoid bouncing, lifting the hips, or forcefully locking out at the top.', 'compound', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('22df24eb-6bb7-45bc-ab46-9d6022eec774', 'Barbell Back Squat', '2024-09-07 20:34:58.039052', '2025-09-17 11:03:52.083953', 'https://dsikfdo0rac0e.cloudfront.net/example-images/barbell_back_squat.png', 'Set the bar across the upper back (not the neck), grip just outside shoulders, and unrack to step back with a shoulder-width stance. Brace the core, keep ribs down, and maintain a neutral spine. Sit the hips down and slightly back, let the knees track over the toes, and keep pressure through the whole foot (midfoot/heelnot the toes). Descend to parallel or as mobility allows without butt-wink, then stand by driving the floor away and finishing with hips under the torso. Avoid collapsing the chest or knee valgus; lock out under control without hyperextending.', 'compound', 'free', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('d180a698-a12e-4731-8234-b96e8f3ca7d9', 'Barbell Upright Row', '2024-09-07 20:15:00.934798', '2025-09-17 20:13:28.801673', 'https://dsikfdo0rac0e.cloudfront.net/example-images/barbell_upright_row.png', 'Stand with feet shoulder-width and grip the bar slightly inside shoulder width. Keep the bar close to the body and lead with the elbows, pulling to about upper-chest height while elevating the shoulders. Keep wrists neutral, torso upright, and avoid swinging or rolling the shoulders. Pause briefly at the top, then lower the bar under control. If shoulder discomfort occurs, widen the grip or reduce the range.', 'compound', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('738d7264-00af-48dd-a475-3c4d12e28188', 'Chin Up', '2024-09-06 21:19:43.22155', '2025-09-21 19:09:24.80499', 'https://dsikfdo0rac0e.cloudfront.net/example-images/chin_up.png', 'Using a supinated (underhand) shoulder-width grip, hang from the bar with elbows fully extended. Take a deep breath, squeeze your glutes, and brace your abs. From an active hang, depress and retract the shoulder blades, then drive the elbows straight down to pull your upper chest to the bar (chin over the bar). Keep the ribs down and neck neutral; pause, then lower under control to a full hang without swinging or kipping.', 'compound', 'body_weight', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('d3f54e1c-6333-4a15-b09b-0264ec0b68fe', 'Reverse Grip Barbell Curl (EZ Bar)', '2024-09-03 08:35:16.704123', '2025-09-11 18:54:52.507562', '', 'Stand tall holding an EZ bar with a pronated (overhand) grip about shoulder-width. Keep elbows pinned to your sides, wrists neutral (avoid flexing/extension), and torso still. Flex the elbows to curl until forearms are near vertical, then lower under control without swinging or shrugging. The pronated grip shifts emphasis toward the brachioradialis and forearm extensors while the biceps assist.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('6115df45-ddad-4fa6-bfb0-1c0cd72de766', 'Smith Machine Stiff Leg Deadlift', '2024-09-05 13:49:52.421936', '2025-09-22 08:42:18.786204', 'https://dsikfdo0rac0e.cloudfront.net/example-images/smith_machine_stiff_leg_deadlift.png', 'Load the Smith machine and set the bar to a comfortable height. Stand feet hipshoulder width and grasp the bar overhand. Position the feet slightly forward to keep the bar tracking vertically over midfoot. Keep a neutral spine, soft (not locked) knees, and hinge at the hipspush the hips back while keeping the bar close to your legs and shins nearly vertical. Lower until you feel a strong hamstring stretch without rounding or posterior pelvic tilt. Brace, keep lats engaged, then drive the hips forward by contracting hamstrings and glutes to stand tall without hyperextending. Control the descent and repeat.', 'compound', 'fixed', 'hinge', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('ad98534e-b2d9-4fef-9983-578ef12b28f7', 'Stiff Leg Deadlift', '2024-09-05 13:05:01.285262', '2025-09-22 15:42:57.549249', 'https://dsikfdo0rac0e.cloudfront.net/example-images/stiff_leg_deadlift.png', 'Position the bar over mid-foot (shoelaces) in a hip-width stance. Hinge by pushing the hips back with minimal knee bend (515) and grasp the bar shoulder-width, double-overhand. Brace, keep a neutral spine, set the lats, and keep shins nearly vertical as the bar tracks straight over mid-foot. Extend the hips to stand tall without hyperextending the lumbar spine. Reverse by pushing the hips back and lowering until you feel strong hamstring tension or plates reach mid-shinno lumbar rounding. Keep the bar close, control the descent, re-brace, and repeat.', 'compound', 'free', 'hinge', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('b2e39ab6-118d-46bd-ad8c-8acf9864af6c', 'Barbell Bench Press', '2024-09-02 14:57:19.319304', '2025-10-08 08:58:18.504463', 'https://dsikfdo0rac0e.cloudfront.net/example-images/barbell_bench_press.png', 'The barbell bench press primarily targets the pectoralis major (sternocostal fibers), with strong assistance from the anterior deltoids and triceps. Key cues:
INSERT INTO public.exercise_examples VALUES ('1dcd59ab-674e-49d8-9a06-9c17c2a05730', 'Conventional Deadlift', '2024-09-05 12:56:19.187681', '2025-09-22 16:02:55.358672', 'https://dsikfdo0rac0e.cloudfront.net/example-images/conventional_deadlift.png', 'Set the bar over mid-foot (about 23 cm from the shins). Take a hip-width stance and grip just outside the legs. Brace 360, set a neutral spine, pull the slack out, and engage the lats (bar to shins). Push the floor away: extend knees and hips together keeping the bar over mid-foot and close to the body. Stand tall by squeezing the glutes without hyperextending. Return by hinging back; once the bar passes the knees, bend them and guide the bar to the floor under control. Reset and repeat.', 'compound', 'free', 'hinge', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('b39cc5b5-8335-4918-a504-f9cdfb85ceba', 'Good Mornings', '2024-09-03 11:13:27.408276', '2025-09-22 21:23:52.582461', 'https://dsikfdo0rac0e.cloudfront.net/example-images/good_mornings.png', 'Set a barbell across the upper back (not the neck) and unrack from a squat rack. Stand hip-width with a slight knee bend, feet flat. Brace the torso (ribs down), keep a neutral spine, and pin the bar in place by pulling elbows down and lats tight. Hinge by pushing the hips back until you feel a strong hamstring stretch while shins stay near vertical; stop before lumbar flexion. Drive the floor and extend the hips to stand tall without hyperextending. Move under control with consistent tempo; use light-to-moderate loads and spotter arms when learning.', 'compound', 'free', 'hinge', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('f5f03cc7-c2bc-4367-9042-107114d634ce', 'Barbell Wrist Curl (Over Bench)', '2024-09-03 09:44:32.006932', '2025-09-23 12:00:18.141517', 'https://dsikfdo0rac0e.cloudfront.net/example-images/barbell_wrist_curl_over_bench.png', 'Set up kneeling or seated behind a flat bench. Rest your forearms on the bench with wrists hanging past the edge, palms up (supinated), hands shoulder-width, and thumbs wrapped around the bar. Keep elbows fixed and shoulders relaxed. Lower the bar by extending the wrists under control, then curl it up by flexing the wrists until the bar approaches the forearms. Pause, avoid ulnar/radial deviation and momentum, keep forearms glued to the bench, and use a smooth full range of motion.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('a2f8dd49-606e-4d86-ae04-8af61c0b40e9', 'Seated Reverse Grip Cable Wrist Curl', '2024-09-03 09:42:04.632581', '2025-09-23 18:41:37.482216', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_reverse_grip_cable_wrist_curl.png', 'Set a low pulley and attach a straight bar. Sit on a flat bench facing the stack with forearms resting on your thighs or the bench edge, wrists hanging off. Take a shoulder-width reverse (overhand) grip with thumbs wrapped. Keep elbows and forearms fixed, shoulders relaxed. From wrist flexion, extend the wrists to lift the bar; pause near neutral/comfortable extension, then lower under control back into flexion. Avoid elbow movement, torso sway, and ulnar/radial deviation; use a smooth full range of motion.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('d7871e0c-5e1b-4ffd-a9ab-951028246a01', 'Behind-The-Back Cable Wrist Curl', '2024-09-03 09:37:05.548408', '2025-09-24 21:01:50.997989', 'https://dsikfdo0rac0e.cloudfront.net/example-images/behind_the_back_cable_wrist_curl.png', 'Set a low pulley with a straight bar. Stand facing away from the stack with the bar held behind your hips, hands shoulder-width. Keep elbows straight, shoulders down, and forearms still. Let the wrists extend to feel a stretch in the forearms, then flex the wrists to pull the bar up toward your glutes; pause and lower under control. Avoid shrugging, bending the elbows, or using momentum to keep tension on the forearm flexors.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('61a31a0d-a736-48b5-b03e-44aa1ad7f3eb', 'Seated Barbell Wrist Curl', '2024-09-03 08:30:59.451731', '2025-10-03 10:20:29.595607', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_barbell_wrist_curl.png', 'The seated barbell wrist curl isolates the wrist flexors of the forearm. Sit on a flat bench with forearms resting on your thighs (palms up), grip the bar slightly wider than hip width. Let the bar roll toward the fingers, then flex the wrists to raise it while keeping elbows and shoulders still. Use a controlled tempo (especially a slow eccentric) and avoid excessive range that causes pain.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('de4e9652-b068-4558-9fd3-38d45e5aa0d9', 'Toes In Seated Calf Raise', '2024-09-01 12:49:37.135904', '2025-11-23 11:48:17.443036', 'https://dsikfdo0rac0e.cloudfront.net/example-images/toes_in_seated_calf_raise.png', 'Seated machine calf raise with toes internally rotated (~1530). Sit with knees ~90 under the pad, balls of the feet on the platform edge (heels hanging). Extend the ankles to release the safety. Lower under control into dorsiflexion to a comfortable stretch, then plantarflex strongly to the top; pause 12 s and avoid letting the heels rest at the bottom. Keep movement at the ankle only (no knee pumping), use a steady tempo, and drive through the ball of the foot. Toes-in may bias the lateral gastrocnemius; the seated position emphasizes the soleus.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('13fcd794-54fb-413f-8bbf-44353cd29869', 'Cable Iron Cross', '2024-09-02 20:22:38.703372', '2025-10-16 10:51:37.386572', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_iron_cross.png', 'Stand centered in a cable crossover with D-handles set slightly above shoulder height. Take a staggered stance, brace the core, and keep a slight elbow bend (~1530). Retract and depress the scapulae, then sweep the arms in a wide arc to meet in front of the chest without changing elbow angle; pause and return under control to a deep stretch without letting the shoulders roll forward. Keep it a fly (no pressing) and avoid shrugging.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('2bc37dec-7b06-404c-af63-99bf3f60fb68', 'Dumbbell Pullover', '2024-09-02 14:06:48.380733', '2025-10-17 14:29:40.348753', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_pullover.png', 'Compound upper-body movement bridging chest and back. Lie on a flat bench, hold one dumbbell with both hands above the chest, soft elbows (~1530). Inhale as you lower in an arc behind the head without losing ribcage/neutral spine; exhale and return by shoulder extension. To bias chest: keep elbows slightly wider and cue ribcage down; to bias lats: tuck elbows closer and drive upper arms toward hips. Keep scapulae depressed/retracted; avoid excessive lumbar arch.', 'compound', 'free', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('9572d666-227a-4639-9ea3-defd67123fbc', 'Smith Machine Zercher Squat', '2024-09-08 11:54:36.16859', '2025-09-16 20:19:37.904417', 'https://dsikfdo0rac0e.cloudfront.net/example-images/smith_machine_zercher_squat.png', 'Set the Smith bar in the crooks of your elbows (Zercher position). Stand with feet shoulder-width, brace the core, and squat with an upright torso. The fixed bar path lowers global stabilization demands while the anterior load increases knee extension demand, shifting emphasis to the quadriceps. Glutes and adductors assist hip extension and frontal-plane control; hamstrings act mainly eccentrically; calves and core stabilize; biceps and forearms support the cradle hold.
INSERT INTO public.exercise_examples VALUES ('de763854-d06d-43e9-9973-f4ca8839201b', 'Dumbbell Walking Lunge', '2024-09-07 20:55:27.29392', '2025-09-17 09:16:46.53915', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_walking_lunge.png', 'Hold dumbbells at your sides, step forward into a lunge, descend until the back knee approaches the floor while the front knee tracks over the toes, then drive through the whole front foot to stand and step through. Quadriceps are primary; glutes assist hip extension; hamstrings contribute mainly eccentrically; adductors/abductors control the frontal plane; calves and core stabilize.
INSERT INTO public.exercise_examples VALUES ('2fd70951-2d44-407e-a7ee-daa94bf6af87', 'Front Squat', '2024-09-07 20:53:13.256272', '2025-09-17 10:15:13.748238', 'https://dsikfdo0rac0e.cloudfront.net/example-images/front_squat.png', 'Set up in a front rack (clean grip or cross-arm), elbows high, chest up, and bar over mid-foot. Brace the core, sit straight down keeping a relatively upright torso, knees tracking over toes, and stand by driving through the whole foot. Anterior load increases knee flexion demand (quadriceps) while glutes and adductors assist; hamstrings contribute mainly eccentrically; calves and core stabilize; upper back (traps/rhomboids) maintains thoracic extension.
INSERT INTO public.exercise_examples VALUES ('14dbd276-30fe-4558-9cf0-104751b58f2d', 'Dumbbell Rear Lunge', '2024-09-07 20:51:46.750556', '2025-09-17 10:22:21.658983', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_rear_lunge.png', 'Step back into a long split stance with dumbbells at your sides, torso upright, and core braced. Drop straight down until the back knee lightly touches the floor, front knee tracking over toes; drive through the whole front foot to stand. The reverse step biases hip/quad loading while reducing forward knee shear. Keep pelvis square, neutral spine, and steady arms (no trunk lean). Primary: quadriceps; glutes/adductors assist; hamstrings act mostly eccentrically; calves and core stabilize; abductors manage frontal-plane control.', 'compound', 'free', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('98791e1d-6029-4cb2-bcaf-611a337208ef', 'Cable Row to Neck', '2024-09-07 20:24:09.667421', '2025-09-17 15:49:06.557338', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_row_to_neck.png', 'Attach a rope to a cable stack at chest height. Sit or stand tall with a neutral spine and thumbs-up grip. Initiate by depressing/retracting the scapulae, then pull the rope toward the upper chest/neck line while spreading the ends apart and letting the elbows travel high and wide. Squeeze the midupper back and rear delts briefly, then return under control with the shoulders protracting slightly. Keep the ribs down, avoid shrugging or cranking the neck, and maintain neutral wrists.', 'compound', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('afd7f719-5789-48a0-a5d9-77e9cb1669bb', 'Standing Cable Reverse Fly', '2024-08-29 20:16:07.188606', '2025-11-25 21:52:33.483666', 'https://dsikfdo0rac0e.cloudfront.net/example-images/standing_dumbbell_shoulder_press.png', 'Set both pulleys to chest height and attach single handles. Stand tall with a slight knee bend, arms extended in front with a soft elbow. Grip the handles (neutral), brace the core, and avoid shrugging. Pull the arms out laterally in a wide arc until hands are in line with the shoulders without over-pinching the shoulder blades; pause, then lower under control to the start and repeat.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('7470e789-9509-4e22-9078-67857074867d', 'One-Arm Seated Cable Row', '2024-09-07 19:56:54.223291', '2025-09-17 21:16:09.962365', 'https://dsikfdo0rac0e.cloudfront.net/example-images/one_arm_seated_cable_row.png', 'Attach a single handle to a low cable. Sit tall with a neutral spine and slight hip hinge, feet braced. Grip the handle (neutral or overhand), set the shoulder by depressing/retracting the scapula, and pull the handle toward the mid-torso while keeping hips and shoulders square (avoid twisting). Pause and squeeze the working shoulder blade, then return under control to a full stretch without rounding. Do not shrug the shoulder.', 'compound', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('194fa2ee-7f92-4982-903e-3db80293d773', 'Barbell Preacher Curl', '2024-08-27 20:20:16.517741', '2025-10-08 09:19:17.563701', 'https://dsikfdo0rac0e.cloudfront.net/example-images/barbell_preacher_curl.png', 'Load the desired weight on a barbell and sit upright with your chest against the preacher pad. Press your upper arms firmly into the pad and use a supinated (palms up) grip about shoulder-width. Extend the elbows to a comfortable stretch without hyperextending. Brace, keep shoulders down, and curl the bar by bending only at the elbows until the bar reaches about shoulder height; pause and squeeze the biceps. Lower under control to the full stretch while keeping the arms glued to the pad. Repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('91f6781b-915e-4bb4-8d8c-e345aa66e42d', 'Incline Bench Two Arm Dumbbell Row', '2024-09-07 15:18:31.425724', '2025-09-18 12:14:06.573986', 'https://dsikfdo0rac0e.cloudfront.net/example-images/incline_bench_two_arm_dumbbell_row.png', 'Prone, chest-supported dumbbell row that reduces lower-back demand while targeting the upper/mid-back. Set an adjustable bench to ~3045, lie face down with a dumbbell in each hand (pronated grip), and keep a neutral spine and braced core. Drive the elbows back at ~3060 to the torso, pulling toward the lower ribs while retracting/depressing the shoulder blades. Pause briefly, then lower under controlallowing a gentle scapular protractionwithout shrugging or using hip/leg drive.', 'compound', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('4a2c7160-6cf2-456d-8ef4-80040b720420', 'Lat Pulldown', '2024-09-06 11:18:17.192491', '2025-09-21 19:25:37.819101', 'https://dsikfdo0rac0e.cloudfront.net/example-images/lat_pulldown.png', 'Attach a wide-grip bar to the lat pulldown and sit tall with feet flat. Grasp the bar with a pronated grip just outside shoulder width. Brace your core, initiate by depressing and slightly retracting the shoulder blades, then drive the elbows down to pull the bar toward the upper chest. Pause briefly, keep ribs down and wrists neutral, then return to a full overhead stretch under control without shrugging or leaning back.', 'compound', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('8e687b8b-0142-49f7-92e9-4d5df9aa86c9', 'Wide Grip Pull Up', '2024-09-06 11:15:01.132837', '2025-09-21 19:29:00.671519', 'https://dsikfdo0rac0e.cloudfront.net/example-images/wide_grip_pull_up.png', 'Using a pronated grip, grasp the pull-up bar wider than shoulder width. Take a deep breath, squeeze your glutes, and brace your abs. Initiate by depressing and slightly retracting the shoulder blades, then drive the elbows straight down to lift your chin over the bar while keeping ribs down and neck neutral. Pause briefly and lower to a full hang under control without swinging or kicking.', 'compound', 'body_weight', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('bd3338ee-1841-4686-a98c-3493ab9cfa7e', 'Reverse Grip Lat Pulldown', '2024-09-06 21:26:46.655349', '2025-09-21 20:13:10.715133', 'https://dsikfdo0rac0e.cloudfront.net/example-images/reverse_grip_lat_pulldown.png', 'Attach a straight bar to the lat pulldown and sit with thighs secured. Grasp the bar with a supinated (underhand) grip at or just inside shoulder-width. Sit tall, brace, depress the shoulder blades, and keep the elbows tucked as you drive them down and slightly back to pull the bar to the upper chest. Pause and squeeze the lats, then return overhead under control without shrugging, leaning back, or letting the ribs flare.', 'compound', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('c18b086c-b0c3-4d1c-a6a3-2653e36c5dff', 'Straight Leg Deadlift', '2024-09-05 13:44:20.952287', '2025-09-22 08:54:52.084709', 'https://dsikfdo0rac0e.cloudfront.net/example-images/straight_leg_deadlift.png', 'Set the bar on the rack just below hip height and load your plates. Stand shoulder-width and grasp the bar with a double overhand grip. Brace, keep a neutral spine and a slight (soft) knee bend, and hinge by pushing the hips back while keeping the bar over midfoot and close to your legs (shins nearly vertical). Lower until the bar is just below the kneecap without rounding. Keep lats tight, drive through the whole foot, and extend the hips to stand tall by squeezing the glutesavoid hyperextending the lower back. Control the descent; maintain the same knee angle throughout, and repeat.', 'compound', 'free', 'hinge', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('04d3e242-807d-4cba-9be4-e3d11a8efbc4', 'Reverse Hack Squat', '2024-09-05 13:33:56.320983', '2025-09-22 10:55:32.032179', 'https://dsikfdo0rac0e.cloudfront.net/example-images/reverse_hack_squat.png', 'Load the reverse hack squat machine. Face the pads with your chest on the chest pad and shoulders under the shoulder pads. Place your feet about shoulder-width on the lower platform with toes slightly turned out. Brace, keep a neutral spine and pelvis, press up to take the weight, and disengage the safeties. Descend under control by bending knees and hips, letting the knees track over the toes with heels planted until thighs are roughly parallel to the platform. Drive the platform away by extending knees and hips, squeeze the glutes at the top without locking the knees. Re-engage the safeties when finished.', 'compound', 'fixed', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('05b3842c-2a19-484e-bae3-a12e86c2fa4c', 'Leg Curl', '2024-09-05 12:59:02.097116', '2025-09-22 15:52:58.644476', 'https://dsikfdo0rac0e.cloudfront.net/example-images/leg_curl.png', 'Adjust the machine so your knee joint aligns with the machines pivot and the ankle pad rests just above the heel/Achilles. Set the hip/chest pad snug to prevent the hips from lifting. Brace, keep a neutral pelvis and ribs down. Flex the knees to curl the pad toward the glutes without swinging; squeeze briefly, then lower under control (23 s) to near full extension without locking out. Keep the movement at the kneeminimal hip motion. Dorsiflex the ankles to bias the hamstrings (plantarflexion increases calf involvement).', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('3a39a222-7b4d-4e0e-9e7e-034d78b5d6bf', 'Good Mornings Off Pins', '2024-09-05 12:48:41.905041', '2025-09-22 20:00:53.198367', 'https://dsikfdo0rac0e.cloudfront.net/example-images/good_mornings_off_pins.png', 'Set safety pins in a rack at the bottom of your desired range (torso near parallel to floor). Position the bar on your upper back against the pins, take a hip-width stance, and grip just outside shoulder-width. Inhale and brace, keep a neutral spine and soft knees (1015). Drive the hips forward to lift the bar off the pins and stand tall. Hinge by pushing the hips back with shins nearly vertical, keep lats tight and elbows pulled down. Lower under control until the bar lightly contacts the pins, pause (dead stop), fully re-brace, and repeat. Avoid lumbar rounding or hyperextension throughout.', 'compound', 'free', 'hinge', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('49ef1d62-a375-485a-84bd-289a5548e81b', 'Barbell Shrug', '2024-09-07 20:17:27.639092', '2025-10-19 15:04:31.975966', 'https://dsikfdo0rac0e.cloudfront.net/example-images/barbell_shrug.png', 'Stand tall with a barbell in front of the thighs and a double overhand grip. Brace the core, keep arms straight and neck neutral, then raise the shoulders straight up toward the ears (no rolling). Pause 12 s at the top and lower slowly to a full stretch, avoiding elbow bend or torso sway.
INSERT INTO public.exercise_examples VALUES ('78b3c689-0222-46de-a7b3-9bd6c75b920c', 'Barbell Hip Thrust', '2024-09-03 11:07:53.745619', '2025-09-23 10:42:42.003101', 'https://dsikfdo0rac0e.cloudfront.net/example-images/barbell_hip_thrust.png', 'Set your upper back on a flat bench and place a padded barbell across the crease of the hips. Plant the feet about shoulder-width with shins vertical at the top. Brace (ribs down, neutral spine), keep the chin tucked, and drive through the heels to extend the hips until the torso is parallel to the floor. Finish by squeezing the glutes with a slight posterior pelvic tiltavoid lumbar hyperextension. Lower under control by hinging at the hips and maintaining knee angle; pause lightly and repeat. Use smooth tempo and full hip extension without letting the knees cave in.', 'isolation', 'free', 'hinge', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('d2f28afc-e84c-467c-90d9-c6c2cb63acbc', '45 Degree Leg Press Calf Raise', '2024-09-01 12:47:02.01513', '2025-10-05 10:42:05.79259', 'https://dsikfdo0rac0e.cloudfront.net/example-images/45_degree_leg_press_calf_raise.png', 'Calf raise on a 45 leg press. Sit with hips/back supported and feet shoulder-width on the lower edge of the footplate so the heels hang off. Extend the legs to set the start position (keep knees locked or with a slight, constant bend). Lower the heels under control into dorsiflexion to a comfortable stretch, then plantarflex hard to the top; pause 12 s and avoid bouncing. Keep motion at the ankles only, brace the trunk, and maintain foot pressure through the ball of the foot. Safety: set/keep safeties engaged whenever adjusting foot placement; if you feel knee joint pressure, keep a slight bend and do not change knee angle during reps.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('4d72c2f1-2c10-45a3-9f5e-1f04012c0681', 'Alternating Incline Dumbbell Curl', '2024-08-28 20:59:16.602427', '2025-10-05 21:10:23.745817', 'https://dsikfdo0rac0e.cloudfront.net/example-images/alternating_incline_dumbbell_curl.png', 'Set an adjustable bench to a 3045 incline (lower = harder). Sit, pick up two dumbbells, and lie back with your head/upper back supported. Hold with an underhand (supinated) grip, arms hanging and elbows slightly bent to keep tension. Keep shoulders back and elbows pinnedno swinging. Curl one dumbbell by flexing the elbow only until the forearm is near vertical; squeeze briefly, then lower under control to full extension without letting the shoulder roll forward. Alternate arms and repeat for reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('f2fb31f0-7f6b-42b6-9a79-c22453ac6a63', 'Alternating Seated Dumbbell Curl', '2024-08-27 20:24:43.747305', '2025-10-06 20:54:37.950612', 'https://dsikfdo0rac0e.cloudfront.net/example-images/alternating_seated_dumbbell_curl.png', 'Sit tall on a flat bench with dumbbells at your sides, palms facing up. Brace your core, keep your back straight, shoulders down, and elbows pinned to your sides. Curl one dumbbell without swinging or letting the elbow drift forward until you reach a strong biceps contraction; pause, then lower under control to a full stretch. Alternate arms each rep while keeping the non-working arm still and wrists neutral.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('1f28edb2-29ae-467c-ad11-310c3f656fe2', 'Alternating Seated Hammer Curl', '2024-08-28 21:04:44.306578', '2025-10-06 21:45:18.946137', 'https://dsikfdo0rac0e.cloudfront.net/example-images/alternating_seated_hammer_curl.png', 'Sit on a flat bench with feet planted and torso tall. Hold two dumbbells at your sides with a neutral (hammer) grip; keep elbows tucked and still. Maintain slight elbow flexion to keep tension. Curl one dumbbell toward the shoulder without rotating the forearm or swinging the torso; squeeze briefly, then lower under control to full extension. Alternate arms rep to rep while the opposite arm stays braced. Keep wrists neutral and breathe steadily.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('908341ec-de1f-44bd-b84d-74ff8a7162a0', 'Alternating Standing Dumbbell Curl', '2024-08-28 20:40:22.148816', '2025-10-08 08:51:17.984992', 'https://dsikfdo0rac0e.cloudfront.net/example-images/alternating_standing_dumbbell_curl.png', 'Stand tall holding dumbbells at your sides with a supinated grip (palms up), wrists neutral, and elbows pinned to your torso. Create light pre-tension in the biceps. Curl one dumbbell up without swinging or letting the elbow drift forward; squeeze briefly at the top, then lower under control (23 s). Alternate sides each rep while keeping the non-working arm still and shoulders relaxed. Repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('93e6b1c4-0510-41d4-983c-a1fde003881f', 'Alternating Dumbbell Floor Press', '2024-08-24 13:55:14.325068', '2025-10-19 14:50:50.467794', 'https://dsikfdo0rac0e.cloudfront.net/example-images/alternating_dumbbell_floor_press.png', 'Sit on the floor with the dumbbells upright beside you. Pick each up, set them high in the hip crease, then lie back keeping them close to the torso. Plant feet and lightly retract the shoulder blades.
INSERT INTO public.exercise_examples VALUES ('6cb225d2-be00-461d-9bf0-7f0c87cfea0b', 'Straight Bar Tricep Extension', '2024-08-23 13:51:17.085276', '2025-11-23 11:55:47.762513', 'https://dsikfdo0rac0e.cloudfront.net/example-images/straight_bar_tricep_extension.png', 'Attach a straight bar to a high cable and assume a standing position with a slight hip hinge. Grasp the bar with a pronated grip (palms down), pull the shoulders down and back, and keep the elbows tucked by your sides.
INSERT INTO public.exercise_examples VALUES ('4aafe702-f2fc-4fa2-a7fb-c31c279adeda', '45 Degree Lying Tricep Extension', '2024-08-23 20:36:43.346849', '2025-10-19 14:40:11.203206', 'https://dsikfdo0rac0e.cloudfront.net/example-images/45_degree_lying_tricep_extension.png', 'Sit on the end of a flat bench with a barbell on your thighs.
INSERT INTO public.exercise_examples VALUES ('0eaa8980-e29e-4f33-88b0-915db5cf309a', 'Alternating Lying Dumbbell Extension', '2024-08-24 15:00:28.238965', '2025-10-19 14:53:46.161449', '', 'Set two dumbbells at the end of a flat bench. Pick them up with a neutral grip and sit with the ends on your thighs. Rock back to lie on the bench and press the dumbbells above your chest, wrists straight, elbows stacked under the bells.
INSERT INTO public.exercise_examples VALUES ('9c029423-aa52-4b90-97c0-f5d4b4574f12', 'Bent Over Dumbbell Row', '2024-09-07 15:02:05.982322', '2025-10-19 15:14:33.761766', 'https://dsikfdo0rac0e.cloudfront.net/example-images/bent_over_dumbbell_row.png', 'The bent over dumbbell row is a compound back exercise performed in a hinged position.
INSERT INTO public.exercise_examples VALUES ('6389ce45-7d30-4372-8c29-e5816d893b1a', 'Chest Supported Dumbbell Row', '2024-09-07 15:09:04.672927', '2025-10-19 15:37:04.667981', 'https://dsikfdo0rac0e.cloudfront.net/example-images/chest_supported_dumbbell_row.png', 'The chest-supported dumbbell row is a free-weight compound pulling exercise that targets the lats, rhomboids, and midlower traps while minimizing lower-back load.
INSERT INTO public.exercise_examples VALUES ('ab0d7384-444e-446a-911d-f64ac31db8ef', 'Close Grip Bench Press', '2024-08-23 15:30:18.860564', '2025-10-19 15:39:01.582879', 'https://dsikfdo0rac0e.cloudfront.net/example-images/close_grip_bench_press.png', 'Lie flat on a bench and set your hands just inside shoulder width.
INSERT INTO public.exercise_examples VALUES ('1959abd3-4ab1-42d4-b7e2-45693b899d51', 'Military Press (AKA Overhead Press)', '2024-08-29 15:18:06.528089', '2025-10-19 18:03:20.607613', 'https://dsikfdo0rac0e.cloudfront.net/example-images/military_press_aka_overhead_press.png', 'Set the bar in a rack at upper-chest height. Take a shoulder-width stance and grip just outside shoulder width with a pronated grip. Unrack, brace abs and glutes, ribs down. Inhale, tuck the chin and press the bar overhead in a straight path by moving the head slightly back, then bring the head through under the bar at midline. Lock out without excessive shrugging, then lower to the upper chest under control and repeat.', 'compound', 'free', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('31b8aa6a-448d-4e4c-bd1e-6386060b526e', 'Tripod Dumbbell Row', '2024-09-07 15:12:48.559544', '2025-10-19 21:10:31.253615', 'https://dsikfdo0rac0e.cloudfront.net/example-images/tripod_dumbbell_row.png', 'The tripod dumbbell row is a unilateral pulling exercise emphasizing the lats, rhomboids, and midlower traps with assistance from the biceps and posterior deltoid.
INSERT INTO public.exercise_examples VALUES ('8508cffc-1df6-4db2-9447-3bafd74a1325', 'Seated Hammer Curl', '2024-08-28 20:50:28.789635', '2025-11-18 17:50:09.321444', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_hammer_curl.png', 'Sit tall on a flat bench with feet planted. Hold dumbbells at your sides with a neutral (thumbs-up) grip, wrists straight, elbows tucked to your ribs, and torso braced. Curl the dumbbells without swinging or letting the elbows drift forward until you reach comfortable elbow flexion; pause and squeeze, then lower under control to full extension while keeping tension. Inhale before lifting, exhale near the top. Repeat for reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('db9ff44c-2e27-42df-8f6a-1b64429999e1', 'Chest Dip', '2024-09-02 15:26:06.627831', '2025-11-18 17:59:47.283604', 'https://dsikfdo0rac0e.cloudfront.net/example-images/chest_dip.png', 'Lean your torso slightly forward (1030), keep shoulders depressed and scapulae retracted. Lower under control until shoulders are just below elbows or a comfortable chest stretch, elbows tracking ~3045 from the torso. Drive up by pressing through the palms and squeezing the chest; avoid shrugging and excessive lockout. Brace the core and master bodyweight before adding load.', 'compound', 'body_weight', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('ec09f8c7-04cf-4219-8033-3dd17ea5c1d9', 'Incline Dumbbell Flys', '2024-09-02 20:16:40.175747', '2025-11-18 18:58:51.672782', 'https://dsikfdo0rac0e.cloudfront.net/example-images/incline_dumbbell_flys.png', 'Set an adjustable bench to ~3045. With dumbbells held above the shoulders and a soft elbow bend, retract/depress the scapulae and lower in a wide arc until you feel a chest stretch (avoid overstretching the shoulder). Hug the arms back together on the same arc, squeezing the upper chest at the top. Keep wrists neutral, elbows slightly flexed throughout, and dont let the shoulders roll forward.', 'isolation', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('3edb750e-4725-4338-a079-d48dc8797917', 'Decline Dumbbell Flys', '2024-09-02 21:02:37.703332', '2025-11-18 19:46:08.929623', 'https://dsikfdo0rac0e.cloudfront.net/example-images/decline_dumbbell_flys.png', 'Set a decline bench (1530). With a slight fixed elbow bend, lower the dumbbells in a wide arc until a stretch in the lower chest, then bring them together over the chest without turning it into a press. Keep scapulae retracted/depressed and control the eccentric; stop range if shoulder discomfort occurs.', 'isolation', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('cfb2d83a-b3dc-44e9-ab08-53f9269752d6', 'Concentration Curl', '2024-08-27 20:11:42.117375', '2025-11-18 22:02:55.73752', 'https://dsikfdo0rac0e.cloudfront.net/example-images/concentration_curl.png', 'Sit tall on a flat bench and hinge forward slightly. Plant feet, then wedge the working elbow against the inside of the same-side thigh near the knee. Hold a dumbbell with a supinated grip, wrist neutral. Keep torso still, shoulder packed, and elbow pinned. Curl the dumbbell toward the shoulder, squeeze the biceps at the top, then lower under control to a near-full stretch without letting the elbow slide. Repeat for both sides.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('548b3de6-0980-4795-ab86-763c20dbc325', 'Dumbbell Bench Press', '2024-09-02 14:01:43.604308', '2025-11-18 22:29:08.177313', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_bench_press.png', 'Flat dumbbell press emphasizing the pectorals with higher stabilizer demand than a barbell. 5-point setup (feet, glutes, upper back, head), scapulae retracted/depressed, neutral wrists. Lower to around mid-sternum with elbows ~4570; press in a slight arc up and back over the shoulders. Control tempo; avoid bouncing or excessive elbow flare.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('1fdffa53-d9cb-4aa1-9999-5c83fdb9be80', 'Hip Abduction Machine', '2024-08-31 21:55:50.613451', '2025-11-19 10:42:52.303312', 'https://dsikfdo0rac0e.cloudfront.net/example-images/hip_abduction_machine.png', 'Set up seated upright with your back against the pad, spine neutral, and pads on the outer thighs just above the knees. Grip the handles and brace your core. Exhale and abduct the hips by driving the knees outward to open the pads without leaning back or arching the lower back. Pause briefly at end range, then return under control to a comfortable stretch. Keep knees tracking with toes and avoid bouncing. Repeat for the desired reps.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('9e348a26-e5d0-4ee0-b3e6-fe58563ac698', 'Hack Squat Calf Raise', '2024-09-01 13:30:53.56497', '2025-11-20 16:47:12.722701', 'https://dsikfdo0rac0e.cloudfront.net/example-images/hack_squat_calf_raise.png', 'Machine calf raise performed on a hack squat. Setup: stand on the foot plate (toes on edge or a block for more ROM), chest against the pad, shoulders under pads, feet hip-width, neutral pelvis. Unlock the safety, keep knees softly extended (no hyperextension). Raise heels by plantarflexing only at the ankles; pause 12 s at peak, then lower under control without letting heels fully rest. Maintain straight line from hips to shoulders and steady tempo throughout the set.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('c5901a9a-580c-411b-85bd-2ec738123e14', 'Hanging Knee Raise', '2024-09-01 12:26:49.231068', '2025-11-20 16:50:46.550602', 'https://dsikfdo0rac0e.cloudfront.net/example-images/hanging_knee_raise.png', 'Hang from a pull-up bar with a shoulder-width grip (widen if your feet touch the floor). Pack the shoulders (scapular depression), brace, and keep the legs together. Raise the knees by flexing the hips and posteriorly tilting the pelvis to bring the knees toward the chest; avoid swinging. Pause 12 s, then lower under control to a full stretch. Keep the torso still and the tempo slow throughout. Progression: hold a dumbbell between the feet when strong enough.', 'compound', 'body_weight', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('21e7460d-aa00-448b-8c82-994a73e0164c', 'Dumbbell Tate Press', '2024-08-26 15:20:51.07074', '2025-11-20 19:12:01.076175', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_tate_press.png', 'Sit on a flat bench with a pair of dumbbells. Lie back keeping the weights close to your chest, then press them to near lockout.
INSERT INTO public.exercise_examples VALUES ('3a41edcb-2c19-4d06-9585-8fe745aba723', 'Machine Lateral Raise', '2024-08-29 20:34:53.7379', '2025-11-20 19:35:07.880903', 'https://dsikfdo0rac0e.cloudfront.net/example-images/machine_lateral_raise.png', 'Select the desired weight on the lateral raise machine. Adjust the seat so the pads line up with mid-forearm/elbow height. Sit tall with feet flat, eyes forward. Secure your arms against the pads and set a slight bend in the elbows. Keeping the torso still and shoulders down, raise the arms out to the sides in a smooth arc until the forearms are just above parallel. Pause and contract the delts, then lower under control along the same path. Avoid shrugging or swinging; move only at the shoulders.', 'isolation', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('2f49a8e8-6f42-422c-aa6f-c23e215620e2', 'Decline Sit-Up', '2024-09-01 12:14:59.677632', '2025-11-20 23:07:20.815036', 'https://dsikfdo0rac0e.cloudfront.net/example-images/decline_sit_up.png', 'Set the decline bench to ~3045. Secure your legs under the pads and lie back. Cross your arms over your chest (or lightly touch your templesdo not pull on the neck). Start with a slight posterior pelvic tilt so the low back is gently flattened and shoulder blades hover off the pad. Exhale as you curl the ribcage toward the pelvis until the torso is vertical; avoid yanking with the hip flexors. Pause 12 s at the top, then lower under control without letting your back touch the bench. Keep the tempo slow and the range of motion pain-free. Optional: add a small twist for more oblique emphasis or hug a plate/dumbbell for added load.', 'compound', 'body_weight', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('16ba69dc-e99d-4a71-bbcb-0f3ce096a9d9', 'Machine Shoulder Press', '2024-08-29 20:17:41.629601', '2025-11-20 23:14:26.040947', 'https://dsikfdo0rac0e.cloudfront.net/example-images/machine_shoulder_press.png', 'Adjust the seat so the handles are at or just below shoulder height. Sit tall with your back and head supported, feet planted. Grip the handles (neutral or pronated), brace your core, keep ribs down, and avoid excessive lumbar arch. Press overhead in the scapular plane until the elbows extend without shrugging; pause, then lower under control to just above shoulder level and repeat.', 'compound', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('506d1cc7-529a-42af-b5bf-4c4d0a9aa409', 'Smith Machine Shoulder Press', '2024-08-29 15:24:22.323538', '2025-11-20 23:19:34.314592', 'https://dsikfdo0rac0e.cloudfront.net/example-images/smith_machine_shoulder_press.png', 'Set an adjustable bench to upright (90) inside the Smith machine and position the bar around eye level. Sit with your back supported, feet planted, and take a pronated grip slightly wider than shoulder-width. Brace, keep ribs down and wrists stacked. Press overhead in the scapular plane without shrugging; finish with elbows extended but not locked. Lower under control to about chinupper-chest level, touch softly, and repeat.', 'compound', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('3b828d2f-797f-4a45-9d1d-1d3efe38fb54', 'Weighted Tricep Dips', '2024-08-23 15:50:27.637943', '2025-11-20 23:24:49.200931', 'https://dsikfdo0rac0e.cloudfront.net/example-images/weighted_tricep_dips.png', 'Step up onto the dip bars and take a neutral grip. Add external load as needed (dip belt or a dumbbell held between the feet).
INSERT INTO public.exercise_examples VALUES ('1f8abb63-8024-46ca-ac1e-2574a839eed6', 'Push Press', '2024-08-29 20:49:40.170706', '2025-11-21 12:59:23.858674', 'https://dsikfdo0rac0e.cloudfront.net/example-images/push_press.png', 'Set the bar in a rack at just below shoulder height and load plates. Take a shoulder-width stance, grip the bar just outside shoulder width (pronated), elbows slightly in front of the bar, and unrack with a neutral spine. Take two steps back, inhale and brace (ribs down, glutes tight). Dip 510% at knees and hips with a vertical torso and heels down, then drive hard through the legs and press the bar in a straight line to lockout overhead. Finish with biceps near ears and no lower-back overextension. Control the bar back to the shoulders, re-brace, and repeat for reps.', 'compound', 'free', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('af39600b-6fc5-435a-a5f8-a1d0a9994030', 'Incline Bench Dumbbell Curl', '2024-08-28 21:00:57.784199', '2025-11-22 12:02:59.108573', 'https://dsikfdo0rac0e.cloudfront.net/example-images/incline_bench_dumbbell_curl.png', 'Set an adjustable bench to ~45. Sit at the top end and brace the back of your upper arm on the pad. Hold a dumbbell with an underhand (supinated) grip, arm fully extended without letting the shoulder roll forward. Keep the elbow pinned and the wrist neutral. Curl by flexing the elbow only until the forearm is near vertical, squeeze briefly, then lower under control to full extension. Maintain steady torso contact with the bench and avoid shrugging or swinging. Repeat for reps, then switch arms.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('1b4402c2-2459-45c1-8d24-356322c71d20', 'Two Arm Standing Dumbbell Extension', '2024-08-26 14:46:34.072768', '2025-11-22 14:46:35.565175', 'https://dsikfdo0rac0e.cloudfront.net/example-images/two_arm_standing_dumbbell_extension.png', 'Select the desired weight and stand tall with feet shoulder-width. Clean the dumbbell to the shoulder, overlap the hands around one end, then press it overhead. Brace your core and glutes, keep ribs down, wrists neutral, and elbows pointing up close to the ears.
INSERT INTO public.exercise_examples VALUES ('385fb192-7c2c-405a-b483-f36e32e241c8', 'Close Grip Chest Press', '2024-08-26 14:31:15.917591', '2025-11-23 11:37:50.850026', 'https://dsikfdo0rac0e.cloudfront.net/example-images/close_grip_chest_press.png', 'Adjust rack height if needed and load the bar. Lie on a flat bench with feet planted. Take a close overhand grip (~812 in, just inside shoulder width). Retract and depress the shoulder blades, keep a slight arch and neutral wrists, then unrack to lockout over mid-chest.
INSERT INTO public.exercise_examples VALUES ('885918a3-5c64-4f15-982e-1b9a91cb3743', 'Incline Bench Press', '2024-09-02 14:58:44.028336', '2025-11-24 16:55:31.235049', 'https://dsikfdo0rac0e.cloudfront.net/example-images/incline_bench_press.png', 'Incline bench press targets the upper chest (clavicular head) with strong assistance from the anterior deltoids and triceps. Use a 3045 bench angle, retract/scapulae, keep wrists stacked over elbows, and press the bar in a slight arc up and back toward the shoulders. Moderate grip (just outside shoulder width) helps emphasize the upper chest and shoulder stability.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('09386394-e4e1-4a6d-adce-d5f5a518485c', 'Incline Dumbbell Curl', '2024-08-27 20:09:12.651079', '2025-11-24 21:44:51.79968', 'https://dsikfdo0rac0e.cloudfront.net/example-images/incline_dumbbell_curl.png', 'Set an incline bench to ~5565. Sit back with your head, upper back, and glutes on the pad; arms hang straight down. Grip the dumbbells supinated, shoulders set, elbows slightly behind the torso. Without swinging or letting the shoulders roll forward, curl the bells toward the shoulders, squeeze the biceps, then lower under control to a near-full stretch. Repeat for reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('9ab8fe00-58de-48c4-942d-b10e8d16f1c1', 'Seated Arnold Press', '2024-08-29 15:26:45.175874', '2025-11-24 21:56:19.824174', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_arnold_press.png', 'Set an adjustable bench to 8590. Sit tall with your back supported and feet planted. Clean the dumbbells to shoulder level, starting with palms facing you and elbows slightly forward. Brace, keep ribs down and wrists stacked. Press overhead while rotating the dumbbells to palms-forward; finish with biceps near the ears without shrugging. Lower under control, reversing the rotation to ~90 elbow angle, and repeat.', 'compound', 'free', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('4035dfef-3cc6-4a15-a97f-c167bd274d02', 'Seated Barbell Shoulder Press', '2024-08-29 15:34:32.562958', '2025-11-24 21:59:56.408482', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_barbell_shoulder_press.png', 'Set a squat rack so the bar is just below shoulder height and place an adjustable bench upright inside the rack. Sit tall with your back supported, feet planted, and take a pronated grip slightly wider than shoulder-width. Brace, keep ribs down and wrists stacked, then lower the bar to around upper chest without excessive arching. Press back up in the scapular plane to full elbow extension without shrugging; pause briefly and lower under control.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('01dff88c-893b-4410-8d54-1e36013b9fdb', 'Seated Dumbbell Calf Raise', '2024-09-01 12:43:01.520267', '2025-11-24 22:13:19.154792', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_dumbbell_calf_raise.png', 'Sit on the end of a flat bench with a step/block under the forefoot and heels hanging off. Place the ends of two dumbbells on the thighs close to the knees (use a towel for comfort). Keep knees bent ~90 and still. Lower the heels under control into a comfortable stretch, then drive up by plantarflexing through the ball of the foot; pause 12 s at the top and avoid bouncing. Do not let the heels touch down between reps; keep the torso braced and the motion at the ankles only.', 'isolation', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('5b7d739c-d130-466c-a5ac-9e8b318b77ad', 'Smith Machine Bench Press', '2024-09-02 21:01:10.551319', '2025-11-25 20:53:08.860137', 'https://dsikfdo0rac0e.cloudfront.net/example-images/smith_machine_bench_press.png', 'Set a flat bench under the Smith bar and position the bar over mid-chest. Retract/depress the scapulae, plant feet, and grip slightly wider than shoulder width. Unrack, lower to the mid-lower chest with elbows tucked ~4560, forearms vertical, then press back to full elbow extension under control. Set safeties to just below chest depth.', 'compound', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('f6dd98f1-ad1d-4ea2-ba97-9939ce0fc028', 'Smith Machine Incline Bench Press', '2024-09-02 20:38:34.922216', '2025-11-25 20:58:10.504738', 'https://dsikfdo0rac0e.cloudfront.net/example-images/smith_machine_incline_bench_press.png', 'Set an adjustable bench to a 1530 incline under the Smith bar so the bar tracks over the upper chest. Retract/depress the scapulae, plant feet, and grip slightly wider than shoulder width. Unrack, lower to the upper chest with elbows tucked ~4560 and forearms vertical, then press to full elbow extension under control. Set safeties just below chest depth.', 'compound', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('8a73b841-1d4e-4808-8ed7-58c4931e0e96', 'Decline Dumbbell Bench Press', '2024-09-02 20:31:29.272118', '2025-11-26 09:50:06.242348', 'https://dsikfdo0rac0e.cloudfront.net/example-images/decline_dumbbell_bench_press.png', 'Set a decline bench to ~1530. Lie back with dumbbells over the lower chest, wrists neutral, and scapulae retracted/depressed. Lower the bells to the lower-pec line with elbows tucked ~45, slight flare acceptable at the bottom. Press back up on a slight arc keeping ribs down and shoulder blades stable. Control the eccentric; avoid excessive shoulder protraction.', 'compound', 'free', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('0e2fe1e8-f8f1-48e6-b360-8c9d4d9991a6', 'Rope Tricep Extension', '2024-08-23 14:53:43.902288', '2025-11-26 10:00:07.792544', 'https://dsikfdo0rac0e.cloudfront.net/example-images/rope_tricep_extension.png', 'Attach a rope to a high cable stack and assume a standing position with a slight hip hinge and neutral spine.
INSERT INTO public.exercise_examples VALUES ('4d3a89ab-70ae-4311-8b40-a058b2f3057b', 'Seated Dumbbell Tricep Extension', '2024-08-23 14:41:48.900488', '2025-11-26 22:06:28.752674', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_dumbbell_tricep_extension.png', 'Set an adjustable bench to 90 and select the desired dumbbell.
INSERT INTO public.exercise_examples VALUES ('414a1891-1a28-4dbe-84e3-a992c6e879bc', 'Seated Neutral Grip Dumbbell Wrist Curl', '2024-09-03 08:56:48.824003', '2025-11-27 13:51:01.420543', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_neutral_grip_dumbbell_wrist_curl.png', 'Sit on a bench and hold a dumbbell in a neutral (thumbs-up) grip. Rest your forearm on the bench or thigh with the wrist hanging off the edge. Without moving the elbow or shoulder, flex and extend the wrist through a comfortable range, controlling the lowering phase. Keep the forearm planted to keep tension on the forearm muscles.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('cebf4622-c0a9-4759-a070-48c7556da67d', 'Squatting Cable Curl', '2024-08-28 20:55:59.966001', '2025-11-28 10:55:12.405282', 'https://dsikfdo0rac0e.cloudfront.net/example-images/squatting_cable_curl.png', 'Attach a straight bar to a low pulley. Face the machine and grasp the bar with a shoulder-width underhand grip. Squat down with a neutral spine and chest up, placing the backs of your upper arms (just behind the elbows) on your knees to fix the elbows in place. Keep wrists neutral and curl the bar toward your shoulders until full elbow flexion; squeeze briefly, then lower under control to full extension without letting the arms slide off your knees. Inhale before the curl, exhale near the top. Repeat for reps.', 'isolation', 'fixed', 'pull', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('9be8d3a0-574b-40dc-a42c-06ab42af7e66', 'Close Grip Dumbbell Press (Crush Press)', '2024-09-02 20:18:44.729356', '2025-11-28 14:11:09.574922', 'https://dsikfdo0rac0e.cloudfront.net/example-images/close_grip_dumbbell_press_crush_press.png', 'Lie on a flat bench with neutral grips and the dumbbells touching. Retract/depress the scapulae, keep elbows tucked ~3045, and actively squeeze the bells together throughout the press to create constant chest tension. Press up over the lowermid chest and lower under control without letting the dumbbells drift apart. Keep wrists neutral and avoid shrugging or excessive arching.', 'compound', 'free', 'push', 'intermediate');
INSERT INTO public.exercise_examples VALUES ('984e5dac-f3a8-4980-bfc9-da370cf45e46', 'Incline Rear Delt Fly', '2024-08-29 20:58:25.061062', '2025-11-29 16:18:54.190538', 'https://dsikfdo0rac0e.cloudfront.net/example-images/incline_rear_delt_fly.png', 'Set an adjustable bench to a 3040 incline. Lie prone with your chest on the bench and feet planted. Hold dumbbells with a neutral grip and keep a slight bend in the elbows. Set the shoulders down and lightly retracted. Inhale, then raise the arms out to the sides in line with your shoulders by driving the elbows out (not back) until the upper arms are level with your torso. Avoid shrugging or turning it into a row. Pause briefly at the top, then lower the dumbbells under control to the start. Repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('50774526-c91f-4d71-82a8-456526b0fbd0', 'California Skullcrusher', '2024-08-26 14:21:24.510891', '2026-01-05 12:06:18.690066', 'https://dsikfdo0rac0e.cloudfront.net/example-images/california_skullcrusher.png', 'Select an appropriate load and lie on a flat bench with an EZ bar held with a neutral/semineutral grip and elbows tucked. Press to lockout over the mid-chest and set the shoulder blades.
INSERT INTO public.exercise_examples VALUES ('c21d3b0f-c8a8-4b7f-92ea-90dc567a1183', 'Close Grip EZ Bar Press', '2024-08-26 14:36:25.633347', '2026-01-05 13:38:23.643402', 'https://dsikfdo0rac0e.cloudfront.net/example-images/close_grip_ez_bar_press.png', 'Load an EZ bar and lie on a flat bench with feet planted. Take a close grip (just inside shoulder width) on the angled EZ sections, wrists stacked over forearms. Retract and depress the shoulder blades, keep a light arch and tight upper back, then press the bar to lockout to start.
INSERT INTO public.exercise_examples VALUES ('aada0f37-1f30-4d61-a284-8003027bc871', 'Cable Face Pull', '2024-08-29 20:14:43.135772', '2026-01-05 14:07:13.746481', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_face_pull.png', 'Set a cable with a rope attachment at upper-chest to face height. Take a split or athletic stance, brace your core, and grasp the rope with a neutral/pronated grip. Pull toward the nose/forehead with high elbows, spreading the rope and finishing with slight external rotation (thumbs back) without shrugging. Pause, then return under control keeping ribs down and torso still.', 'compound', 'fixed', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('82890348-a566-4762-b9b4-f89e52534936', 'Cable Crossovers (Upper Chest)', '2024-09-02 20:20:26.742528', '2026-01-05 15:16:36.889913', 'https://dsikfdo0rac0e.cloudfront.net/example-images/cable_crossovers_upper_chest.png', 'Set the pulleys low on a cable crossover and attach D-handles. Take a staggered stance, brace the core, and keep a slight bend in the elbows (1530). Retract/depress the scapulae, then sweep the arms on a low-to-high arc to meet around upper-chest/eye level without changing elbow angle; pause and return under control to a stretch. Keep it a fly (not a press), avoid shrugging or overextending the low back.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('118eab6d-cae9-4c0b-b8e6-57f3e5541f1a', 'Flat Bench Cable Flys', '2024-09-02 21:09:41.728008', '2026-01-08 10:46:28.865909', 'https://dsikfdo0rac0e.cloudfront.net/example-images/flat_bench_cable_flys.png', 'Set a flat bench between dual adjustable pulleys, attach D-handles, and lie supine. With slight elbow bend fixed, sweep the arms in an arc to bring the handles together over the chest, then return under control. Keep shoulder blades retracted/depressed and avoid turning it into a press to maintain chest isolation and constant cable tension.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('f2868e11-6e1d-4ce4-a1a8-eb0384a60b71', 'Floor Crunch (Legs on Bench)', '2024-09-01 12:24:23.199368', '2026-01-08 10:58:24.598002', 'https://dsikfdo0rac0e.cloudfront.net/example-images/floor_crunch_legs_on_bench.png', 'Place a mat on the floor and position a flat bench at the end to form a T. Lie supine with calves resting on the bench so hips and knees are ~90. Lightly touch your temples with your fingertips (do not pull on the neck). Posteriorly tilt the pelvis, lift the shoulder blades slightly off the mat, and brace. Exhale as you curl the ribcage toward the pelvis; keep elbows open and the low back gently flattened. Pause 12 s at the top, then lower under control until the shoulder blades hover above the mat. Keep reps slow and avoid using momentum.', 'isolation', 'body_weight', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('4f9bdd10-28bc-447e-8cf5-fbf47cd9af79', 'French Press', '2024-08-26 14:52:11.233011', '2026-01-13 17:53:53.328435', 'https://dsikfdo0rac0e.cloudfront.net/example-images/french_press.png', 'Load a barbell or EZ bar and stand with feet shoulder-width. Hinge to pick the bar safely, then press it overhead. Grip about 812 inches (just inside shoulder width), brace your core and glutes, keep ribs down, wrists neutral, and elbows pointing up close to your head.
INSERT INTO public.exercise_examples VALUES ('a2736a56-04b3-4437-835e-1e2dc8029c9e', 'Spider Curl', '2024-08-28 20:42:25.582502', '2026-01-13 18:21:56.68714', 'https://dsikfdo0rac0e.cloudfront.net/example-images/spider_curl.png', 'Set up facing the preacher bench with your chest against the pad and arms hanging vertically over the top edge. Grip an EZ bar shoulder-width with an underhand (supinated) grip. Keep upper arms perpendicular to the floor, elbows fixed, and wrists neutral. Curl the bar by flexing only the elbowsno swinging or shrugging. Squeeze at the top, pause, then lower under control (23 s) to a full stretch. Repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('92d77415-1f9a-430b-ba52-0a09ec07b3a1', 'Standing Dumbbell Shoulder Press', '2024-08-29 15:21:42.152136', '2026-01-13 18:39:31.530306', 'https://dsikfdo0rac0e.cloudfront.net/example-images/standing_dumbbell_shoulder_press.png', 'Stand with feet shoulder-width, brace your trunk, and keep ribs down and glutes lightly engaged. Raise the dumbbells to shoulder level with a pronated grip; wrists stacked over elbows. Press overhead in the scapular plane until biceps are near the ears without shrugging or overextending the lower back. Lower under control to about chin/upper-chest level and repeat.', 'compound', 'free', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('9fc5ae4d-2868-4576-bb67-9c83663fc005', 'EZ Bar Preacher Curl', '2024-08-27 20:15:21.110573', '2026-01-13 19:32:03.442144', 'https://dsikfdo0rac0e.cloudfront.net/example-images/ez_bar_preacher_curl.png', 'Adjust the preacher bench so your upper arms rest firmly on the pad. Load the EZ bar and grip shoulder-width with an underhand (palms up) grip. Set your shoulders down and back, keep elbows pinned to the pad, and wrists neutral. Lift the bar off the rests with a slight elbow bend. Curl until your forearms are near vertical without letting the shoulders roll forward; pause and squeeze the biceps. Lower the bar slowly to a near-straight elbow without locking out. Maintain a still torso and avoid bouncing. Repeat for the desired reps.', 'isolation', 'free', 'pull', 'beginner');
INSERT INTO public.exercise_examples VALUES ('04d275d8-71df-4695-ace9-899ce6e41b29', 'Seated Dumbbell Tricep Extension', '2024-08-26 14:39:55.622736', '2026-01-13 20:25:46.998094', 'https://dsikfdo0rac0e.cloudfront.net/example-images/seated_dumbbell_tricep_extension.png', 'Select the desired weight and set an adjustable bench to 90. Sit tall with your back on the pad and feet planted. Clean the dumbbell to the shoulder, overlap your hands around one head, then press it overhead. Brace your core, keep ribs down, wrists neutral, and elbows pointing up close to the ears.
INSERT INTO public.exercise_examples VALUES ('7227c8f6-cf65-4134-97de-d5e64cb5ff1b', 'Toes Out 45 Degree Calf Raise', '2024-09-01 12:51:11.813368', '2026-01-21 10:02:49.366603', 'https://dsikfdo0rac0e.cloudfront.net/example-images/toes_out_45_degree_calf_raise.png', '45 leg press calf raise with toes externally rotated (~1530). Sit securely, place the balls of the feet on the bottom edge of the footplate (heels hanging). Extend the sled to unlock, keep knees softly extended (no hyperextension), pelvis neutral. Move only at the ankles: lower to a comfortable stretch, then plantarflex to the highest point; pause 12 s at the top and control the eccentric. Keep the balls of the feet on the edge (dont roll toward the toes), avoid bouncing. Toes-out may bias the medial gastrocnemius, but evidence is mixed.', 'isolation', 'fixed', 'push', 'beginner');
INSERT INTO public.exercise_examples VALUES ('b790c6a6-ecd1-4b3a-afbc-22cd82e55658', 'Lying Dumbbell Extension', '2024-08-23 14:29:51.253789', '2026-01-21 10:09:54.164752', 'https://dsikfdo0rac0e.cloudfront.net/example-images/lying_dumbbell_extension.png', 'Sit on the end of a flat bench with dumbbells on your thighs. Lie back and press the dumbbells to arms length over the shoulders using a neutral grip (palms facing each other). Keep wrists neutral, shoulders packed, and upper arms angled slightly back with elbows pointing toward the hips.
INSERT INTO public.exercise_examples VALUES ('855bd9e5-3546-4cfd-b048-e8017f01bfeb', 'Dumbbell Tricep Kickback', '2024-08-27 17:37:27.234715', '2026-01-21 10:24:51.173834', 'https://dsikfdo0rac0e.cloudfront.net/example-images/dumbbell_tricep_kickback.png', 'Place a dumbbell next to a flat bench. Set up with your right knee and right hand on the bench, left foot on the floor, torso nearly parallel to the ground, and a neutral spine. Hold the dumbbell in your left hand with a neutral grip. Tuck the left upper arm close to your torso and keep it in line with your body; start around 90 of elbow flexion. Moving only at the elbow, extend until the arm is straight without swinging the shoulder. Pause briefly, then lower under control to the start. Complete reps and switch sides.', 'isolation', 'free', 'push', 'beginner');
